INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(1, 1717, 'Нелепая птица', 'nelepaya_ptitsa', 'Нелепая птица-лидер установок в AppStore! Соревнуйся с друзьями, набери как можно больше очков.', 668, 750, 'prepyatstviya,ptitsy,lovkost', 'arkady', 'http://static.apitech.ru/D4DA3FA87E764342B9DD64B4AEDB6665RU', 0.01, 1, 1, 1398715200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(2, 1716, 'Что на картинке 2', 'chto_na_kartinke_2', 'Вторая часть для любителей отгадывать картинки. Вас ждут новые картинки с различной тематикой.\nВам необходимо разгадать 100 картинок без единой подсказки.', 1021, 580, 'logicheskie,vnimanie,na_soobrazitelnost,znanie,kartinki,um', 'logicheskie', 'http://static.apitech.ru/8ACB075942114F1F84C1894259D88E3BRU', 0.01, 1, 2, 1398628800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(3, 1713, 'Шустрая Курица', 'shustraya_kuritsa', 'В твоей тетради завелась курочка. Помоги ей собрать всех своих цыплят и при этом набери как можно больше очков.\nЧтобы набрать очки, собирай своих цыплят, зеленый перец и таймеры. Остерегайся острых шипов!', 668, 750, 'vremya,devochkam,kuritsa,prepyatstviya,skorost', 'arkady,dlya_devochek', 'http://static.apitech.ru/179078DC56C4408E8FB6CF395E8B15C6RU', 0.01, 1, 3, 1398369600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(4, 1706, 'Думка', 'dumka', 'Новая версия игры DOOMka. Теперь она называется просто Думка.\nИгра выполнена в страшной атмосфере и с черным юмором. Любителям трэша и психоделики понравится эта игра.\nИгра похожа на квест с элементами экшн. В каждой локации нужно драться или разгадывать головоломки. Нужно будет найти способы открыть двери, убить монстров.', 728, 1070, 'monstry,prizraki,uzhastiki', 'poisk_predmetov,brodilki', 'http://static.apitech.ru/9738EA60320A45E8B716FF82AF1A9A72RU', 0.01, 1, 4, 1397592000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(5, 1695, 'Робомания', 'robomaniya', 'Соревнуйся с друзьями в увлекательной игре! Помоги роботу собрать недостающие части. Собирай шестеренки и гаечные ключи, и остерегайся другого мусора! Набери как можно больше очков за 2 минуты.', 668, 750, 'vremya,roboty,lovkost', 'arkady', 'http://static.apitech.ru/16819B1DCF7F4DC79C87FC7A2C3949BDRU', 0.01, 1, 5, 1396382400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(6, 1691, 'Кирпичики', 'brickmaster_ru', 'Поместите каждый из цветных кирпичиков на свое место.', 588, 710, 'logicheskie,kubiki,na_soobrazitelnost', 'logicheskie', 'http://static.apitech.ru/ED7CF38639694B63B07C83BA8E0CE2CDRU', 0.01, 1, 6, 1396987200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(7, 1689, 'Достань луну', 'dostan_lunu', 'Управляя милой собачкой, ваша задача запрыгнуть как можно выше по падающим блокам, чтобы дотянуться до самой луны!', 588, 710, 'prepyatstviya,sobaka,skorost,lovkost', 'arkady', 'http://static.apitech.ru/BC623B6B8888433F9C1DC7D429F3B7D6RU', 0.01, 1, 7, 1395691200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(8, 1687, 'Котики в Блокнотике', 'kotiki_v_bloknotike', 'Мама-кошка растеряла своих котиков по всему блокнотику, помогите ей собрать их всех. Старайтесь набрать как можно больше очков. Для этого собирайте котиков, мышек, таймеры, и остерегайтесь собачьих будок.', 668, 750, 'arkady,navyki,prepyatstviya,razvlecheniya,beg,kotiki', 'arkady,dlya_devochek', 'http://static.apitech.ru/A0E7A7E1B63A4FD28E055486B78F08D8RU', 0.01, 1, 8, 1395691200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(9, 1685, 'Что на картинке', 'chto_na_kartinke', 'Отгадай 100 картинок. Для любителей 4 картинки и одно слово, 2 картинки и одно слово, Кто хочет стать миллионером. ', 1021, 580, 'logicheskie,vnimanie,na_soobrazitelnost,znanie,kartinki,um', 'logicheskie', 'http://static.apitech.ru/7E1E6C5BC1D44453BCDD528F8772B8A2RU', 0.01, 1, 9, 1395000000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(10, 1674, 'Заколдованный клад', 'zakoldovannyi_klad', 'Старому пирату попалась бутылка с картой на которой помечен клад, и он отправился в путешествие на его поиски. Найдя клад он обнаружил что тот заколдован, и его нельзя погрузить на корабль... В игре вы узнаете что придумал пират для того что бы все таки забрать драгоценности себе на корабль.', 788, 710, 'dragotsennosti,piraty,rezalka,skorost', 'arkady,ekshn', 'http://static.apitech.ru/CB9DD7EF8DFA4062A5CF3D530BE26606RU', 0.01, 1, 10, 1393963200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(11, 1673, 'Достать звезду', 'reach_the_star', 'Помоги экзотическим животным исполнить их мечту, дотянуться до звезды. Реши головоломки, выставляй блоки так чтобы они не упали. ', 668, 750, 'balans,devochkam,ravnovesie', 'arkady,dlya_devochek,fizicheskie_igry', 'http://static.apitech.ru/E70DE67C1F6C4EBBB201137F15CBB068RU', 0.01, 1, 11, 1393358400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(12, 1672, 'Фриранер', 'friraner', 'Бегай по крышам домов, постарайся пробежать как можно дальше.\nЕсли ты любишь паркур, то эта игра для тебя!', 668, 750, 'prepyatstviya,beg,skorost', 'arkady', 'http://static.apitech.ru/4E895EB30457494094D403BB39196B00RU', 0.01, 1, 12, 1393876800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(13, 1671, 'Голодная Акула', 'golodnaya_akula', 'Акула очень исхудала и ей нужно подкрепиться! Она плывет к барьерному рифу, где обитают вкусные и яркие коралловые рыбки. Помогите акуле пообедать и набрать хороший вес! Опасайтесь бомб, которые сбрасывают пираты, и ядовитых рыб!', 788, 810, 'vremya,vnimanie,rybki,skorost', 'arkady,dlya_devochek', 'http://static.apitech.ru/DC77840086FC461991D01BC75A27869ARU', 0.01, 1, 13, 1393272000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(14, 1667, 'Лыжник', 'lyzhnik', 'В тетради началась зимняя олимпиада. Помогите лыжнику стать чемпионом и набрать как можно больше очков. Для этого собирайте золотые медали, таймеры и перепрыгивайте ёлки.', 668, 750, 'prepyatstviya,skorost,lyzhi,zima', 'arkady', 'http://static.apitech.ru/019159AAC430400FBDA5D08F1DE81891RU', 0.01, 1, 14, 1392753600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(15, 1666, 'Побег из джунглей', 'letun_perdun', 'Помоги обезьянке выбраться из джунглей. Злобные туземцы расставили кучу ловушек на пути нашего героя, но ему ничто не помешает. Соревнуйся с друзьями, набери больше всего очков!', 788, 590, 'arkady,skorost,lovkost', 'arkady', 'http://static.apitech.ru/88F8549E5F6D4EB0B2BA3CD0C6A1568BRU', 0.01, 1, 15, 1393272000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(16, 1661, 'Ниндзя на кухне', 'nindzya_na_kukhne', 'Ниндзя пришел на программу ТВ, в которой готовят еду, и показал всем настоящее мастерство разрезания всего чего угодно в воздухе на много мелких кусочков! Чем больше мелких частей нарежет ниндзя, тем больше очков получит за этот трюк!', 788, 710, 'eda,vnimanie,lovkost', 'arkady', 'http://static.apitech.ru/0D426C275142424DBA3778672F4B2023RU', 0.01, 1, 16, 1392753600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(17, 1660, 'Угол', 'ugol', 'Агент дальней разведки Угол, возвращается на родной астероид. И обнаруживает, что дом захвачен врагом. Помогите инопланетянину перебить всех врагов.', 668, 750, 'monstry,strelyalki,inoplyanetyane', 'priklyucheniya,brodilki', 'http://static.apitech.ru/5F2DC0BC27F64B14992773568340D407RU', 0.01, 1, 17, 1391630400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(18, 1650, 'Санки на тетрадке', 'sanki_na_tetradke', 'Зима в самом разгаре, даже в тетради выпал снег.\nПомоги бравому человечку проехать как можно дальше и набрать как можно больше очков. Для этого собирай конфеты, время и перепрыгивай деревья.', 668, 750, 'prepyatstviya,sneg,skorost,lovkost', 'arkady', 'http://static.apitech.ru/FB9D5B6DF41F460BAD3ED1475508957DRU', 0.01, 1, 18, 1391112000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(19, 1649, 'Охота на зомби', 'okhota_na_zombi', 'На дворе Хеллоуин! А на вашу дачу нападают зомби прокопавшие подкоп через весь лес от самого кладбища прямо к вам в огород! Отстреливайтесь от них, и продержитесь как можно дольше по времени. Каждый "Pumpkin Head" (тыквенная голова, главный символ праздника темных сил "Хеллоуин") дает +10 секунд времени!', 668, 750, 'vremya,zombi,skorost,lovkost,mishen', 'arkady', 'http://static.apitech.ru/E5D8C8B33AF1462393174C955CA2F63ERU', 0.01, 1, 19, 1391112000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(20, 1646, 'Детские игры', 'besplatnye_detskie_igry', 'Целая красочная коллекция развивающих игр для вашего ребенка. Игры настолько увлекательные, что с ребенком смогут играть и их родители. Вам представлен целый аттракцион развлечений и загадок! \nСобирайте пальцем предметы и занимайтесь поиском предметов. Кормите животных. Играйте с животными. Отправляйте письма. Собирайте яблоки, яйца. Собирайте школьный портфель. Почините машину. Ходите в магазин и на природу. Помогите пчеле в стиле собери пазл.\nИгра понравится любителям Буренок и Рождественского календаря. В игре есть чебурашки. Одного зовут Чебурек, а другого Синяк. Войдите в этот увлекательный мир вместе с чебурашками.\nРазвивайте ваших детей и малышей.\nБесплатные детские игры ждут вас!', 728, 1070, 'detyam,sobiralki', 'logicheskie', 'http://static.apitech.ru/C6BA426EBC9141A4AB944BD4853247B3RU', 0.01, 1, 20, 1390334400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(21, 1643, 'Самура', 'Samura', 'Опасные опыты с инь и янь зомбировали крестьян соседних деревень. Над династией Мунь нависла угроза. Последней линией обороны стал преданный императору Самура.', 668, 750, 'samurai,ataka,lovkost', 'arkady', 'http://static.apitech.ru/DD5AE381EBEF43C0A63291D8F53107A4RU', 0.01, 1, 21, 1389902400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(22, 1641, 'Двойной удар', 'dvoinoi_udar', 'Стрельба по врагам из двух орудий одновременно. Не дай пройти квадратикам до края экрана.', 713, 810, 'zaschita,skorost,vzryv', 'arkady', 'http://static.apitech.ru/A1785529E792496B96CEFAEA191FE85ERU', 0.01, 1, 22, 1389556800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(23, 1639, 'Кенни против ниндзя', 'kenni_protiv_nindzya', 'Кенни окружили ниндзя! Помоги ему выжить.', 688, 610, 'nindzya,prepyatstviya,kenni', 'arkady', 'http://static.apitech.ru/EF79C4DD1001444FB07EB47867D57293RU', 0.01, 1, 23, 1389211200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(24, 1638, 'Нарушитель', 'Narushitel', 'Дул сильный ветер. Дерк порадовался, что у скафандра брейтов толстая броня и дополнительные импульсные ускорители на случай крайней необходимости. Он на предельной скорости убегал от погони, преодолевая препятствия в десятки метров, или возвращаясь назад во времени. Мимо проносились эмерельские башни города машин...', 668, 750, 'prepyatstviya,roboty,skorost,lovkost', 'arkady', 'http://static.apitech.ru/049CF0B1215B49E2A4753DB0DD57EF64RU', 0.01, 1, 24, 1389297600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(25, 1637, 'Страшное расследование', 'strashnoe_rassledovanie', 'Вы частный детектив, которому нужно раскрыть страшное, загадочное преступление. Опросите подозреваемых и свидетелей. Исследуйте мрачные локации дома. Не сойдите с ума от страшных призраков. Решайте головоломки.', 728, 1070, 'monstry,prizraki,uzhastiki', 'logicheskie,poisk_predmetov,brodilki', 'http://static.apitech.ru/3D70CC6B43004AD7AD99F65D05ED0B15RU', 0.01, 1, 25, 1389556800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(26, 1627, 'Новогодние приключения', 'novogodnie_priklyucheniya', 'Помогите Деду Морозу в его нелегкой миссии. Вооружившись ледяной пушкой, вы сражаетесь со всевозможными монстрами, зарабатываете бонусы, открываете боссов и новых врагов. Множество уровней, красочная графика, и разнообразие врагов и бонусов не дадут вам заскучать! С Новым Годом всех!:)', 588, 660, 'vremya,monstry,prepyatstviya,priklyucheniya,sneg', 'priklyucheniya', 'http://static.apitech.ru/EC8E6C88A3E04E6AAF9622C1BCC8B632RU', 0.01, 1, 26, 1387915200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(27, 1625, 'Дьяволенок', 'dyavolenok', 'Проверь свою реакцию! Кликай в тот момент, когда дьяволенок проходит через выделенную область, и чем точнее клик, тем больше очков. Множество уровней и разнообразных бонусов, так что скучать не придется!', 638, 660, 'shariki,skorost,lovkost', 'arkady', 'http://static.apitech.ru/5748870961774970AF48B62FCD4B5FC0RU', 0.01, 1, 27, 1387828800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(28, 1624, 'Рождественское приключение', 'rozhdestvenskoe_priklyuchenie', 'Помоги Санте найти все игрушки. Для прохождения уровня нужно найти минимум 10 игрушек.', 668, 750, 'monstry,prepyatstviya,priklyucheniya,sneg,podarki', 'priklyucheniya', 'http://static.apitech.ru/40A5CF480D2A4CC39D1D8D9BBB85BE11RU', 0.01, 1, 28, 1387915200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(29, 1621, 'Пингвинчик', 'pingvinchik', 'Управляйте пингвинчиком и уворачивайтесь от снежков, падающих сверху. Со временем айсберг становится уже, а снежков больше. Аккуратнее!', 668, 750, 'sneg,lovkost,pingviny', 'arkady', 'http://static.apitech.ru/664D2898E4E54778886453E279BBDD64RU', 0.01, 1, 29, 1387483200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(30, 1619, 'Свидания', 'in_couples', 'Физический паззл. Помоги симпатичной собачке и коту найти себе пару. Пройди 30 увлекательных уровней.', 668, 750, 'devochkam,zhivotnye,logicheskie,kotiki', 'dlya_devochek,logicheskie', 'http://static.apitech.ru/EEF7728A2D674BE5A53D64AF65345F74RU', 0.01, 1, 30, 1387310400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(31, 1618, 'Порабощение!', 'poraboschenie', 'Порабощение! - это подобие всем известных ТД игр(в народе "Башенки"), тут от вас так же требуют строить башни, совершенствовать их, но просто уничтожить врагов недостаточно! Интересно почему? Тогда вперед к Порабощению!', 588, 660, 'bashni,kosmicheskie,pushki,skorost', 'arkady', 'http://static.apitech.ru/532DE8CA77604B029D69222DA2CC64C1RU', 0.01, 1, 31, 1387224000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(32, 1617, 'Защити мой пирог', 'zaschiti_moi_pirog', 'Ваша задача - сбивать группы насекомых, которые движутся к вашему пирогу, чтобы съесть его. Прицелься и стреляй! При попадании исчезает целая группа насекомых одного цвета. Не дайте им добраться до вашего пирога!', 638, 760, 'arkanoid,nasekomye,vzryv', 'arkady', 'http://static.apitech.ru/8A84287ECC704ECAB7977B41F7ECA606RU', 0.01, 1, 32, 1387483200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(33, 1612, 'Котоландия', 'catalance', 'Физический паззл. Помоги симпатичным котам сделать семейную фотографию. Расставляй котов, собирай звёзды, пройди 40 увлекательных уровней.', 668, 750, 'balans,zhivotnye,kotiki', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/A6431010B2724F8C87415E6A29A97EDERU', 0.01, 1, 33, 1387137600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(34, 1606, 'Новогодние шарики', 'novogodnie_shariki', 'Интересная новогодняя игра. Запомни последовательность шариков, показанную в начале уровня, а потом по памяти постарайся восстановить ее, выбирая нужные шарики на нижней панели. Всего 15 уровней, попробуй пройди их все!', 638, 710, 'vremya,pamyat,shariki', 'logicheskie', 'http://static.apitech.ru/E156050FBC5E45EDB210B9E81F448193RU', 0.01, 1, 34, 1386792000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(35, 1605, 'Диаманты', 'diamanty', 'У вас есть пять минут! Задача - менять местами соседние алмазы так, чтобы в линию становилось хотя бы три одинаковых алмаза. Чем больше алмазов уничтожится, тем больше очков вы получите. Очки периодически немного уменьшаются, но я знаю, что Вам удастся поставить рекорд за отведенное время!', 523, 580, 'vremya,dragotsennosti,tri_v_ryad', 'arkady,dlya_devochek', 'http://static.apitech.ru/B4251667E63B4EFA9D941D17606ED7B0RU', 0.01, 1, 35, 1386619200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(36, 1604, 'Подводное регби', 'podvodnoe_regbi', 'Вы управляете командой рыбок-регбистов. \nЦель игры — занести мячик в ракушку соперников и не дать им занести мяч в вашу ракушку. \nМожно играть как с компьютером так и с другом (на одной клавиатуре).', 788, 830, 'vodnye,myach,sportivnye,skorost', 'arkady,sportivnye', 'http://static.apitech.ru/974A1CB5DA9A4846AEA6BCB882C85A0BRU', 0.01, 1, 36, 1386532800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(37, 1597, 'Саймон', 'saimon', 'Популярная настольная игра Саймон. Как только Саймон покажет необходимую последовательность, вам нужно по памяти повторить ее. С каждым разом эта последовательность становится длиннее. Проверь свою память!', 588, 610, 'pamyat,skorost,lovkost', 'arkady,logicheskie', 'http://static.apitech.ru/AED740D5166243C7A98386664F37CCD2RU', 0.01, 1, 37, 1386273600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(38, 1596, 'Собери змейку', 'soberi_zmeiku', 'С помощью вращения кусочков, собери целую змейку от головы до хвоста. Главное, чтобы длины хватило=) С каждым уровнем все сложнее, так что будь осторожнее. Набери побольше очков, и возглавь турнирную таблицу!', 548, 590, 'logicheskie,vnimanie,zmeika', 'logicheskie', 'http://static.apitech.ru/EB7F776B30514716B41D21194E861E47RU', 0.01, 1, 38, 1386273600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(39, 1595, 'Только шарики', 'onlyball', 'На планету добрых шариков напали злые квадратики. Вы играете за самого смелого шарика, которому предстоит пройти много испытаний, что бы спасти своих друзей. \nИзбегайте острых предметов, они вредят шарику. Избегайте всего, что может причинить вред.\n', 888, 750, 'logicheskie,prepyatstviya,priklyucheniya,shariki,lovkost', 'logicheskie,priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/2F284AEF20EB40208C1FAEA41162E7D8RU', 0.01, 1, 39, 1386792000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(40, 1592, 'Виртуальные Воины', 'virtualnye_voiny', 'Real Time Shooter от 3-го лица.\nИграйте Против реальных людей в реальном времени.\nВы находитесь в виртуальном мире где нужно выжить уничтожая других игроков. Объединяйтесь в команде. Используйте укрытия что бы избежать пуль и деревья что бы спрятаться от взора врага.', 788, 910, '', '', 'http://static.apitech.ru/367EB9B999954F87B03B5816F679FAB8RU', 0.01, 1, 40, 1386360000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(41, 1585, 'Пинбол', 'pinbol', 'Классический пинбол. Гоняйте шарик по полю с помощью двух лапок, и набирайте очки. Обгоните всех своих друзей!', 698, 760, 'shariki,reaktsiya,skorost', 'arkady,sportivnye', 'http://static.apitech.ru/B2E8C9F5F34548EE993DB56EC321E920RU', 0.01, 1, 41, 1385496000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(42, 1581, 'Побег из миров', 'pobeg_iz_mirov', 'Главный герой Олег отправился в опасные, загадочные портальные путешествия по разным мирам, чтобы спасти свою любимую девушку Ольгу от темных сил. Олегу предстоит пройти через Подводный мир, Подземный мир и Замок. В этих опасных мирах главного героя ждут монстры, загадки, головоломки, мрачная атмосфера, трупы людей, сражения с монстрами и многие другие завораживающие моменты.', 728, 1070, 'drobovik,monstry,prizraki,uzhastiki', 'logicheskie,poisk_predmetov,brodilki', 'http://static.apitech.ru/49FE588DE66F47A99F2D1675E2BE08CBRU', 0.01, 1, 42, 1385409600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(43, 1566, 'Приключения бегуна', 'priklyucheniya_beguna', 'Тебе предстоит пройти 20 опасных уровней и набрать как можно больше очков.', 668, 910, 'prepyatstviya,skorost,lovkost', 'arkady', 'http://static.apitech.ru/D56B7C0FEE9A41679ED43AF74A6F258DRU', 0.01, 1, 43, 1384718400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(44, 1564, 'Рука и Нож', 'ruka_i_nozh', 'Древнее развлечение! С виду безумное! Но играли что-бы развивать реакцию, внимание и скорость! \n\nИ иногда, что-бы проверить кто владеет ножом лучше ...', 788, 910, 'skorost,lovkost', 'arkady', 'http://static.apitech.ru/6BAF371B09CB4DDCA00C0FFDF3E75578RU', 0.01, 1, 44, 1384804800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(45, 1563, 'Рэгдолл Воллейбол', 'ragdoll_volleyball', 'Спортивная игра в волейбол с девушками в купальниках на крытом поле', 588, 710, '', '', 'http://static.apitech.ru/BFE70CFD605449A2A45F864DA132FD15RU', 0.01, 1, 45, 1384200000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(46, 1561, 'Зомби киллер', 'zombi_killer', 'Землю захватили зомби! Ты единственный выживший. Твоя задача убить побольше зомби.', 738, 610, 'zombi,pushki,skorost', 'arkady', 'http://static.apitech.ru/8974EB0F125D4301A5EEBE27827D7C25RU', 0.01, 1, 46, 1383681600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(47, 1560, 'Распутай меня!', 'rasputai_menya', 'Игра «Распутай меня» предоставляет собой увлекательную головоломку. Цель игры заключается в распутывании нитей связанных между собой пуговицами путем передвижения пуговиц по экрану. Цвет таймера показывает на сколько звезд вы идете.', 588, 660, 'logicheskie,golovolomka', 'logicheskie', 'http://static.apitech.ru/E314B90B7790438C9B77D39A819F5617RU', 0.01, 1, 47, 1384718400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(48, 1557, 'Дом ужасов - Роботы', 'dom_uzhasov_-_roboty', 'Продолжение игры. Олег должен попасть на космический корабль и спасти Ольгу. На пути будут головоломки, новые персонажи, новые враги и новая история. ', 728, 1070, 'drobovik,monstry,prizraki,roboty,uzhastiki', 'logicheskie,poisk_predmetov,brodilki', 'http://static.apitech.ru/E532C670B75F4849834C8B21984FBD9DRU', 0.01, 1, 48, 1383681600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(49, 1555, 'БЕЛКА', 'belka', 'Помогите белке открыть все сундуки ;)\nСтарайтесь не падать. Целеустремленных ждут бонусы в виде спасительного облака. Так же чем дальше вы проходите тем больше у вас шанс найти ключи от сундука . А открывать или нет сундуки это уже ваш выбор.', 788, 1310, 'zhivotnye,prepyatstviya,lovkost', 'arkady,dlya_devochek', 'http://static.apitech.ru/2569618FE24D48A296E0B0B519697A14RU', 0.01, 1, 49, 1383508800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(50, 1554, 'Тракторист Вася', 'traktorist_vasya', 'Тракторист Вася за работой. Помогите Васе заработать как можно больше очков. Для этого, собирайте бутылки с допингом и топливо. Старайтесь не падать в ямы, для этого прыгайте через них с помощью трамплинов.', 668, 750, 'arkady,vremya,ravnovesie,skorost', 'arkady', 'http://static.apitech.ru/ADBBCCC48F274BA0A0B74A04E3DE2F2BRU', 0.01, 1, 50, 1383163200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(51, 1544, 'Дом ужасов 2', 'dom_uzhasov_2', 'От создателей Дом ужасов, Дом страха, Дом страха - Побег.\nПродолжение игры расскажет о том, куда попали Олег с Ольгой через загадочный портал. Главным героям снова предстоит пройти необычные головоломки, страшных монстров и призраков. На пути будут встречаться новые персонажи, новые неожиданности. \nЕсли хотите продолжение игры, то распространяйте игру и ставьте хорошие оценки.', 668, 910, 'monstry,prizraki,uzhastiki', 'logicheskie,poisk_predmetov,brodilki', 'http://static.apitech.ru/6C2C492952724EEF952286824F5AC5C1RU', 0.01, 1, 51, 1382904000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(52, 1542, 'Дом ужасов', 'dom_uzhasov', 'Вас ждут страшные призраки и ходячие мертвецы! Головоломки и сражения с монстрами! Монстры постучатся к вам в дверь, когда вы будете спать, их скрип когтей о стенки подъезда будут разрезать ваше сердце страхом и ужасом бедствия апокалипсиса!', 668, 910, 'monstry,prizraki,uzhastiki', 'logicheskie,poisk_predmetov,brodilki', 'http://static.apitech.ru/A430F6396C264F66B03B22942693B638RU', 0.01, 1, 52, 1382644800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(53, 1540, 'Дом страха', 'dom_strakha', 'Все кто поиграл в эту игру умрут через 23 дня!\nСтарый жуткий дом с приведениями и многим другим уже ждет вашего присутствия в нем. Вам предстоит спасти вашего друга, который потерялся в заброшенном доме, а заброшенный ли он? Это вам и предстоит узнать. \nЖуткий дом ждет тебя, а Slender нервно курит в стороне. ', 668, 910, 'monstry,prizraki,uzhastiki', 'logicheskie,poisk_predmetov,brodilki', 'http://static.apitech.ru/7095769215F8499E8C334D1ACB412BCARU', 0.01, 1, 53, 1382472000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(54, 1531, 'Горячая Рыбка', 'hotfish', 'Подбросьте рыбку на 50 метров чтобы выиграть! \nДелайте рыбкой сальто и собирайте монетки чтобы подкинуть её выше\nААА! Еще кое-что! Остерегайтесь пираний! они очень больно кусаются :)', 893, 580, '', '', 'http://static.apitech.ru/EA0BF2CEC22E427EB291F6A5E130D94FRU', 0.01, 1, 54, 1384200000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(55, 1529, 'Захват замка', 'capturethecastle', 'Ваша задача – захватить вражеский замок. И желательно это сделать как можно быстрее.', 668, 750, 'armiya,voennye,zamki,zaschita,ataka', 'voennye,strategii', 'http://static.apitech.ru/31DB9957A6F84FA38446C43CA42A1F00RU', 0.01, 1, 55, 1381089600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(56, 1526, 'Скейтер', 'skeiter', 'Нарисованный человечек встал на скейт!  Помогите ему доехать как можно дальше. По пути собирайте деньги и время, вовремя прыгайте и приседайте чтобы как можно дольше оставаться на колесах.', 668, 750, 'prepyatstviya,skeitbordy,vnimanie,skorost', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/5B8776197EAC4BB29D0F9B5352106BC1RU', 0.01, 1, 56, 1380571200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(57, 1524, 'Столкновение', 'impact', 'К Земле приближается астероид и у вас есть всего несколько секунд, чтобы спасти людей до столкновения. Игра на реакцию. Кликайте мышкой по людям и машинам, чтобы заработать очки и дополнительное время. Скольких сможете спасти?', 828, 750, 'vremya,skorost,vzryv', 'arkady', 'http://static.apitech.ru/14B23B5C73414A64BAC955F51060815DRU', 0.01, 1, 57, 1380571200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(58, 1523, 'Марио-бегун', 'mario-begun', 'Старый добрый марио но в новой игре! Помоги нашему герою пробежать как можно дальше и побить все рекорды друзей.', 588, 710, 'arkady,mario,prepyatstviya', 'arkady', 'http://static.apitech.ru/E71446A048274CA49928177F725F25BCRU', 0.01, 1, 58, 1380225600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(59, 1522, 'Западный Поезд', 'zapadnyi_poezd', 'Игра про веселого Паровозика, который прибыл на дикий Запад и хочет собрать золото, что бы стать богатым и известным.', 668, 750, '', '', 'http://static.apitech.ru/A109836BAF69424E98ECFC396DFB57BDRU', 0.01, 1, 59, 1380484800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(60, 1520, 'Велир', 'velir', 'Игра создана по мотивам Bejeweled. Намного проще, но постепенно будет дополняться. За выделенное время Вам нужно убрать с поля наибольшее число комбинаций из разноцветных камней, чтобы набрать рекордное число очков. Попробуйте свои силы и побейте рекорды Ваших друзей!', 888, 810, 'arkady,logicheskie,vnimanie,tri_v_ryad', 'arkady,logicheskie', 'http://static.apitech.ru/9D0E5FF042DB4366BA834494DEA41D5FRU', 0.01, 1, 60, 1379966400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(61, 1519, 'Взорви нас!', 'vzorvi_nas', 'Соревнования по разрушению роботов начинаются! Взрывай, получай баллы и порви всех!', 688, 810, 'roboty,golovolomka,na_soobrazitelnost,vzryv', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/634BA900CEAC43B284A2A5A75EAFAE3BRU', 0.01, 1, 61, 1379275200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(62, 1518, 'Зомбания', 'zombaniya', 'Помогите зомби принять лекарство и снова стать людьми. Ведь у них нет ног и рук, и вам придется пораскинуть мозгами, чтобы помочь им добраться до лечебной микстурки.', 668, 750, 'zombi,logicheskie,padenie,kubiki', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/F7AB671B1C2D4EB4ADF7B40A7E8A782DRU', 0.01, 1, 62, 1379016000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(63, 1517, 'Сердитые животные', 'serditye_zhivotnye', 'Помогите животным справиться с инопланетянами.', 668, 750, 'armiya,balans,zhivotnye,angry_birds', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/648AD898DB874230B9D8A92FA0CA7005RU', 0.01, 1, 63, 1378670400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(64, 1516, 'Школьный Автобус', 'shkolnyi_avtobus', 'Школьный автобус спешит в школу, но вот беда, дети разбежались кто куда. Помоги школьному автобусу собрать детей и довезти их в школу. Набирай очки, собирай канистры с бензином и остерегайся острых шипов.', 668, 750, 'mashiny,prepyatstviya,spasatelnye', '', 'http://static.apitech.ru/E9C1B9AEA0C34DBDA89996C2EF166CD5RU', 0.01, 1, 64, 1378411200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(65, 1515, 'Вторжение инопланетян', 'vtorzhenie_inoplanetyan', 'Землю хотят захватить инопланетяне. Твоя задача не пропустить вражеские ракеты близко к земле иначе погибнет весь мир.', 775, 580, 'inoplyanetyane,skorost,rakety', 'arkady', 'http://static.apitech.ru/C4BC2B9198D64FA587E402FFBF46B789RU', 0.01, 1, 65, 1378411200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(66, 1514, 'Время разрезать', 'newsplitterpals', 'У странной желтой кляксы приступ голода. 40 уровней, 40 печенек, 40 приключений. Вызов принят.', 788, 810, 'logicheskie,smeshnye,golovolomka,rezalka', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/9DBC4309A7004C65B7D809423D8DD692RU', 0.01, 1, 66, 1377460800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(67, 1509, 'Веселые шарики', 'run_away', 'Двигай мышкой, продержись как можно дольше. Побей рекорды друзей.', 588, 660, 'shariki,skorost,lovkost', 'arkady', 'http://static.apitech.ru/C8B3D22B75A44704ACB85BDEA6749A0ERU', 0.01, 1, 67, 1377633600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(68, 1508, 'Пожиратель фруктов', 'pozhiratel_fruktov', 'Эта змейка может съесть очень много фруктов. Сделай так чтобы она съела как можно больше.', 663, 735, 'frukty,zmeika', 'arkady', 'http://static.apitech.ru/9D79A2A8303F48C2B2E33884318E8121RU', 0.01, 1, 68, 1376424000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(69, 1506, 'Разморозь меня!', 'razmoroz_menya', 'Птички оказались замороженными в таинственном подземелье, только ты сможешь помочь им выбраться! Используй воду и растопи лед в сердце бедняжек!', 628, 750, 'vodnye,rybki,moroz,golovolomka', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/3D49EC29D9FB4234BC5F5B4B96745B93RU', 0.01, 1, 69, 1375646400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(70, 1504, 'Приключение рыбки', 'priklyuchenie_rybki', 'Рыбка морской клоун решает покинуть свой дом и отправиться в путешествие по морскому дну, чтобы найти самое лучшее место во всем море.', 588, 830, 'arkady,vodnye,priklyucheniya,rybki', '', 'http://static.apitech.ru/046DD79082F3465DB3770CA551F9F4F7RU', 0.01, 1, 70, 1374782400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(71, 1501, 'Зеленые монстры', 'zelenye_monstry', 'Зеленые монстры совсем взбунтовались и отправились крушить шахту чтобы добыть самых ценных ресурсов. ', 713, 710, 'arkady,bomby,monstry,prepyatstviya,strelyalki', 'arkady,strelyalki,ekshn,fizicheskie_igry', 'http://static.apitech.ru/5A7058CAAEF94551A33117C00BB54AE9RU', 0.01, 1, 71, 1374696000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(72, 1498, 'Райский остров', 'raiskii_ostrov', 'Героиня ждет тебя на Райском острове, чтобы примерить новую коллекцию одежды.', 668, 750, 'devochkam,odevalki,odezhda', 'dlya_devochek,podbor_odezhdy', 'http://static.apitech.ru/87FA902A677548DDB3EF473A457FE820RU', 0.01, 1, 72, 1374523200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(73, 1496, 'Нян кэт', 'nyan_ket', 'Нян кэт отправился в путешествие собирать еду, но злые коты решили ему помешать, помоги нян кэту собрать всю еду и не дать злым котам ее отобрать.', 588, 830, 'arkady,devochkam,detyam,koshki,letalki,prepyatstviya', 'arkady,dlya_devochek', 'http://static.apitech.ru/6DD32A3FA52B42E7B5F3183113CD0488RU', 0.01, 1, 73, 1373572800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(74, 1495, 'Четкий баскетбол', 'chetkii_basketbol', 'Гопник Вован решил заняться спортом и отжав баскетбольный мяч у школьников отправляется на спорт площадку покидать в кольцо.', 648, 710, 'arkady,basketbol,myach,navyki,sportivnye,reaktsiya', 'sportivnye,fizicheskie_igry', 'http://static.apitech.ru/9AC1DB547B234B9B9DF5523861AED9D6RU', 0.01, 1, 74, 1373400000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(75, 1492, 'Охотник на уток', 'okhotnik_na_utok', 'Наконец то наступил сезон охоты и вы отправляетесь на природу, чтобы поохотиться на уток и принести домой на ужин.', 588, 830, 'arkady,vremya,strelyalki,reaktsiya,ptitsy', 'arkady,multiki,strelyalki,ekshn', 'http://static.apitech.ru/6B93C4F4E6684DCDAF39B08098966F77RU', 0.01, 1, 75, 1373227200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(76, 1491, 'Космические спасатели', 'kosmicheskie_spasateli', 'На нашу планету напали инопланетяне, вам выдалась честь защищать нашу планету. Вам доверили самый лучший космический корабль чтобы вы выполнили свою миссию. Не допускайте чтобы враги попали на нашу планету иначе вы проиграете.', 648, 710, 'arkady,bomby,voennye,korabli,kosmicheskie,letalki,strategii,strelyalki', 'arkady,voennye,strelyalki,ekshn', 'http://static.apitech.ru/6A42B901906A46A18F43027B13946FC7RU', 0.01, 1, 76, 1373227200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(77, 1490, 'Мемчеги', 'memchegi', 'Яо Минь отправляется на прогулку в лес, но тут на него нападают форевер алонов. В игре есть комбо удары и предметы для улучшения навыков.', 668, 830, 'arkady,draki,ulichnye,eksheny,krov,reaktsiya,e', 'arkady,draki,tryuki,ekshn,fizicheskie_igry', 'http://static.apitech.ru/7140154723A544B69132EBD80035D78CRU', 0.01, 1, 77, 1372968000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(78, 1488, 'Рембо на волне', 'rembo_na_volne', 'Вы отчаянный герой из восьми битных игр - Рембо, в этот раз вам предстоит пробираться через толпы врагов на скоростной сверхскоростной лодке по быстрой реке Амазонке. Крушите своих противников автоматом, собирайте бонусы, перепрыгивайте через препятствия и станьте настоящим Мастером Волн!', 588, 660, 'armiya,bomby,vodnye,drobovik,navyki,oruzhie,prepyatstviya,strelyalki,eksheny', 'voennye,priklyucheniya,strelyalki,ekshn', 'http://static.apitech.ru/7951EE3AFA504D108F4E96E2A680F6ADRU', 0.01, 1, 78, 1373400000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(79, 1487, 'Соник разрушитель', 'sonik_razrushitel', 'Соник отправился в путешествие на своем самолете, но вдруг на него напали враги. Помоги сонику справиться с врагами.', 588, 830, 'arkady,voennye,letalki,strelyalki,eksheny', 'arkady,strelyalki,ekshn', 'http://static.apitech.ru/8DF5DE08E7664EA197C17F8967EF154BRU', 0.01, 1, 79, 1372881600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(80, 1483, 'Весёлые Зверята', 'pets_balls_hd', 'Ваша задача подбрасывать мячик-зверушку в верх и не давать упасть. Каждое падение отнимает у вас одну жизнь. Попутно вы должны собирать звёзды которые помогут вам открыть новых зверей.\nИногда будет появляться снежинка, она поможет вам спастись от одного падения.\n', 668, 750, 'arkady,detyam,zhivotnye,sobiralki', 'arkady,multiki', 'http://static.apitech.ru/3830AA6C6B164B5580DCC19F024B5360RU', 0.01, 1, 80, 1372017600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(81, 1478, '5 головоломок', '5_brain_teasers', 'Решите 5 интересных логических задач и тренируйте мозг!', 668, 750, 'logicheskie,golovolomka,na_soobrazitelnost', 'logicheskie', 'http://static.apitech.ru/0EAF584F164249C0806133BDD449D421RU', 0.01, 1, 81, 1376337600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(82, 1476, 'Гравити Эксперимент', 'gravityexperiment', ' Помоги главному герою избежать ловушек, выбраться из гравитационной лаборатории. ', 668, 750, 'arkady,letalki,logicheskie,prepyatstviya', 'logicheskie', 'http://static.apitech.ru/4B5ED22721BD4544A6349CEC71710C92RU', 0.01, 1, 82, 1369166400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(83, 1468, 'Гирон', 'giron', 'Пробейтесь через бесчисленные ряды противников, чтобы покинуть враждебную планету "Гирон".', 668, 750, 'arkady,armiya,bomby,voennye,drobovik,oruzhie,prepyatstviya,strelyalki', 'arkady,voennye,strelyalki', 'http://static.apitech.ru/5DDD85C6B43C485CB159803562528EF3RU', 0.01, 1, 83, 1368388800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(84, 1459, 'Чувачки', 'chuvachki', 'Давно не был в тире? Не беда! Проверь свой навык стрельбы в увлекательной игре "Чувачки".Стреляй по всему, что движется, и постарайся остаться в живых!', 668, 750, 'arkady,strelyalki,unichtozheniya,pushki,reaktsiya,vnimanie', 'arkady,strelyalki,ekshn', 'http://static.apitech.ru/9EC4C072AD69480F862D1291D97388F5RU', 0.01, 1, 84, 1367870400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(85, 1457, 'Легенда об Анваре', 'legenda_ob_anvare', 'Цель главного героя игры - джинна Анвара - спасти свою возлюбленную от мрачного и коварного колдуна Гаданфара.\nПройдя определённый уровень, вы получаете способность, которая поможет вам открыть дорогу в других уровнях.\nПредусмотрена простая система прокачки, смена качества изображения и языка (Русский-Английский), система сохранения.\nУправление:\nWASD или Cтрелки = Движение;\nЛевая кнопка мыши = Использовать способность;\nShift = Пауза.', 588, 710, 'arkady,bashni,bomby,draki,zaschita,letalki,priklyucheniya', 'arkady,draki,priklyucheniya,strelyalki,fizicheskie_igry', 'http://static.apitech.ru/F038315C46EB49DAA798EE948B09F9EERU', 0.01, 1, 85, 1367438400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(86, 1449, 'Королевство Квадрикс', 'korolevstvo_kvadriks', 'Заходи и играй! Королевство Квадрикс - невероятное приключение квадратов. Тебе предстоит спасти королевство от злодеяний Квадриарти!', 788, 710, 'arkady,vremya,multiki,prepyatstviya,smeshnye,sobiralki,vnimanie', 'arkady,priklyucheniya', 'http://static.apitech.ru/125988922BE94BF097700CB6769560AFRU', 0.01, 1, 86, 1366574400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(87, 1448, 'Спанч Боб и Санта', 'spanch_bob_i_santa', 'Спанч Боб приготовил для Санты рождественский крабсбургер.\nНо и подводные обитатели не прочь полакомиться угощением.\nПомоги Спанчу доставить подарок по назначению.', 735, 760, 'arkady,letalki,multiki,prepyatstviya,priklyucheniya,razvlecheniya,sobiralki,reaktsiya', 'arkady,multiki,priklyucheniya', 'http://static.apitech.ru/A9C611C3366548FF955BEC7B0D86CFEBRU', 0.01, 1, 87, 1366228800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(88, 1446, 'Эволюция', 'evo', 'Сражайся за свое место в подводном мире! Собирай бонусы, убивай врагов и вырасти от планктона до настоящей рыбы.', 788, 910, 'arkady,vodnye,prepyatstviya,priklyucheniya,puzyri,reaktsiya', 'arkady,priklyucheniya', 'http://static.apitech.ru/8B5C65D6D162449B919FE4095F50D507RU', 0.01, 1, 88, 1365969600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(89, 1445, 'Месть Фенвира', 'mest_fenvira', 'Вы окажетесь в эре джинов и будете сражаться за магические артефакты, дающие их владельцу безграничную власть. Выберите бойца воина или монстра и начинайте бои с применением сокрушительных ударов.', 588, 710, 'arkady,volshebstvo,draki,kosmicheskie,letalki,spasatelnye,unichtozheniya', 'arkady,draki', 'http://static.apitech.ru/74C8407D070C4484808FDE1122017C8DRU', 0.01, 1, 89, 1365364800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(90, 1443, 'Мэд Риппер', 'med_ripper', 'Мэд Риппер - захватывающее приключение безумного диггера.', 588, 660, 'arkady,monstry,naiti,pamyat,prepyatstviya,prizraki,sobiralki', 'arkady,poisk_predmetov', 'http://static.apitech.ru/019CB05185234B30B0DD0F66E9CADFA5RU', 0.01, 1, 90, 1364760000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(91, 1442, 'Крупонг', 'krupong', 'Крупонг - это модификация знаменитого пинг-понга. Простая, но в тоже время, бросающая вызов игра. А смена цветов не даст заскучать игроку.', 668, 750, 'arkady,navyki', 'arkady', 'http://static.apitech.ru/217A55B208444AC2AC58127E41F1EE34RU', 0.01, 1, 91, 1364500800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(92, 1439, 'Дудл Флай - Зимнее приключение', 'dudl_flai_-_zimnee_priklyuchenie', 'Злые монстры поймали Санту, избили его и отобрали все подарки. Управляя Дудлером, ты должен собрать как можно больше подарков и наказать вредных монстров.', 735, 760, 'arkady,detyam,drakony,letalki,prepyatstviya,razvlecheniya,smeshnye,sobiralki,strelyalki', 'arkady,priklyucheniya,strelyalki', 'http://static.apitech.ru/E587AB90EF7748869759BB374DC6F209RU', 0.01, 1, 92, 1364155200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(93, 1437, 'Пузырьковое Безумие', 'puzyrkovoe_bezumie', 'Взорви подводный мир. Лопай пузырьки, собирай звезды, улучшай навыки. ', 788, 910, 'arkady,vodnye,devochkam,detyam,puzyri', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/C62D8CEAF4D345BE8BE0BA52157D2CD7RU', 0.01, 1, 93, 1363291200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(94, 1435, 'Напои рыбку', 'pour_the_fish', 'Суперхит теперь на русском! Рыбку засосало в трубу и ей срочно нужна твоя помощь! Рой туннели для воды, опасайся монстров, собирай бонусы и спаси няшную рыбку!', 752, 580, 'vodnye,logicheskie,priklyucheniya,razvlecheniya,smeshnye,sobiralki', 'logicheskie,priklyucheniya', 'http://static.apitech.ru/9CC83078EEDF41468B548D09BB0E9547RU', 0.01, 1, 94, 1369166400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(95, 1431, 'Гонщик', 'gonschik', 'Помогите вашему гонщику добраться как можно дальше в опасном тетрадном мире. Для этого избегайте столкновения с шипами и стенами, и не забывайте подбирать канистры с топливом. А чтобы набрать больше очков, собирайте доллары, много долларов!', 668, 750, 'arkady,vremya,gonki,letalki,mashiny,navyki,prepyatstviya,priklyucheniya,razvlecheniya,sobiralki,reaktsiya', 'arkady,gonki', 'http://static.apitech.ru/D2B616C8B9674FE196C2226C8A140429RU', 0.01, 1, 95, 1362340800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(96, 1423, 'Дудл Флай - Охота на монстров', 'dudl_flai_-_okhota_na_monstrov', 'Дудлеру вновь предстоит справиться с коварными монстрами!', 735, 760, 'arkady,detyam,letalki,navyki,prepyatstviya,priklyucheniya,sobiralki,vnimanie', 'arkady', 'http://static.apitech.ru/D70891697A2F448886251246B4427025RU', 0.01, 1, 96, 1360699200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(97, 1417, 'Дудл флай', 'dudl_flai', 'Вы когда-нибудь задумывались, куда попадают дудлы после смерти? Тогда милости просим в загробный мир дудлов!', 668, 760, 'arkady,detyam,prepyatstviya,priklyucheniya,sobiralki', 'arkady,brodilki', 'http://static.apitech.ru/76FCE47E06874C46A3BE7A33BA0C67B1RU', 0.01, 1, 97, 1359662400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(98, 1416, 'Супер Авиадиспетчер', 'sky_control', 'Вы отвечаете за безопасность воздушного движения. Направляйте самолёты, избегайте гроз, птичьих стай и НЛО. ', 788, 710, 'samolety,simulyatory,strategii', 'logicheskie,strategii', 'http://static.apitech.ru/658856CD45CE4F939041AE2EEFD768F6RU', 0.01, 1, 98, 1376424000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(99, 1415, 'Сокровища Дракона', 'sokrovischa_drakona', 'Помоги дракону собрать как можно больше сокровищ, извергая пламя и уничтожая ловушки людей.', 668, 760, 'arkady,letalki,naiti,prepyatstviya,sobiralki', 'arkady', 'http://static.apitech.ru/E4431571D99547A5B5A8E4944B0E081DRU', 0.01, 1, 99, 1359489600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(100, 1414, 'Пинг Понг. Матч Поинт', 'ping_pong_match_point', 'Настоящий настольный теннис.   Уникальный игровой процесс.   12 матчей с разными соперниками.', 738, 710, 'navyki,sportivnye,vnimanie,schet', 'sportivnye,fizicheskie_igry', 'http://static.apitech.ru/C4A46E514ED8464B81D478835B2F6F85RU', 0.01, 1, 100, 1359316800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(101, 1408, 'Самоцветрис', 'samotsvetris', 'Новый уникальный геймплей, рисуйте самоцветы любой формы и бросайте их в сосуд. \nСталкивайте 3 самоцвета одинакового цвета для того чтобы заработать очки. \nБольшие камни дают больше прибыли чем маленькие.\nОднако старайтесь не перегрузить сосуд слишком большим весом.\nСколько очков вы сможете заработать за заданное время?\n\nИнструкция:\nИспользуйте мышку чтобы рисовать самоцветы.', 788, 910, 'dragotsennosti,logicheskie,razvlecheniya,razukrashki', 'logicheskie', 'http://static.apitech.ru/38BEB17189EA4EC4A0396EA970097784RU', 0.01, 1, 101, 1359662400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(102, 1404, 'Спички', 'igruschechnye_spichki', 'Китайские головоломки. Необходимо ,передвигая или удаляя спички, в зависимости от условия уровня создать из одной фигуры другую. Управление мышкой. Двенадцать уровней. ', 668, 750, 'vremya,logicheskie', 'logicheskie', 'http://static.apitech.ru/C080CF1215854AB5844F09A040587A49RU', 0.01, 1, 102, 1360785600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(103, 1403, 'Та самая змейка', 'snake', 'Старая добрая змейка вернулась. Она прошла через огонь и воду. Теперь она не будет как прежде, но будьте уверены: она способна на многое.', 588, 610, 'arkady,prepyatstviya,razvlecheniya,sobiralki', 'arkady', 'http://static.apitech.ru/824B72FFFB1F438C9497E26E28B44275RU', 0.01, 1, 103, 1358625600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(104, 1402, 'Пигминатор: судный день', 'pigminator_the_judgment_day', 'Уничтожайте свиней копающихся в грязи!\nСтреляйте из 9 типов оружия по 12 различным врагам и получите 18 уникальных достижений пройдя все 12 уровней!\nИ не забудьте про злобного Пигминатора, который ожидает Вас в финале!', 688, 660, 'arkady,bomby,zhivotnye,unichtozheniya', 'arkady,voennye,ekshn,kvesty', 'http://static.apitech.ru/0817D8AE7587483788830ACD2DAC2D4BRU', 0.01, 1, 104, 1358625600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(105, 1397, 'Неправильная школа', 'ne_pravilnaya_shkola', 'Головоломка со спичками. Из спичек сложены математические примеры с ошибкой, необходимо переложить одну или две спички , в зависимости от условия, чтобы решение стало верным.', 668, 750, 'vremya,logicheskie', 'logicheskie', 'http://static.apitech.ru/E3B419EF964443F8AE616D5B95FED5C3RU', 0.01, 1, 105, 1366747200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(106, 1395, 'Марио попрыгун', 'mario_jumper', 'Вместе с Марио ты должен подниматься высоко вверх, прыгая с платформы на платформу, собирать волшебные грибы и цветы. Сможешь ли ты помочь ему преодолеть кирпичную стену, пробраться сквозь облачную завесу, вскарабкаться по скользкому льду?', 788, 610, 'arkady,mario,navyki,priklyucheniya,sobiralki', 'arkady,priklyucheniya', 'http://static.apitech.ru/26399A2B74AB4E9DA883E6E5FAAA2F6CRU', 0.01, 1, 106, 1357761600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(107, 1394, 'Флаивоидез', 'flyvoidez', 'Какой из тебя пилот? Сможешь ли ты выстоять против всех препятствий, которые встанут у тебя на пути? Ты сможешь проверить свои способности в этой игре. Уворачивайся от препятствий, используй дополнительные возможности, чтобы заработать больше очков, и ты станешь лучшим пилотом!', 688, 810, 'armiya,bomby,voennye,letalki,vtorzhenie', 'voennye,gonki,priklyucheniya,ekshn', 'http://static.apitech.ru/E8CA2C44B33B48AA909C43C5AC492944RU', 0.01, 1, 107, 1357502400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(108, 1392, 'Веселая стройка', 'veselaya_stroika', 'Строй дома из разноцветных блоков, сбрасываемых с воздушных шариков.', 668, 750, 'bashni,letalki,vnimanie,kubiki,schet', 'arkady', 'http://static.apitech.ru/B1FAA12EF8054902BD024E82791952B3RU', 0.01, 1, 108, 1356379200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(109, 1390, 'Новогодний Экспресс', 'christmas_express', 'Помоги Деду Морозу раздать подарки вовремя! Персонаж будет следовать за курсором твоей мыши.', 668, 750, 'rozhdestvo,sneg,sobiralki,vnimanie', 'arkady', 'http://static.apitech.ru/5976D9210FD44E75A0A2880645D644D0RU', 0.01, 1, 109, 1356292800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(110, 1389, 'Приключения Фрости', 'frosty_adventure', 'Помогите снеговику Фрости собрать свое тело воедино!', 728, 830, 'vremya,prepyatstviya,priklyucheniya,razvlecheniya,rozhdestvo,sobiralki', 'arkady,priklyucheniya', 'http://static.apitech.ru/3E0DA15E8C9D40F18FD1FCB58AA24883RU', 0.01, 1, 110, 1356292800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(111, 1386, 'Прыгун: Новый Год', 'prygun_novyi_god', 'Ну вот, Прыгун допрыгал до Нового Года! Помоги ему собрать елочные игрушки, получай за это как можно больше очков, и избегай острых шипов.', 668, 750, 'arkady,balans,letalki,priklyucheniya,razvlecheniya,vnimanie', 'arkady,priklyucheniya', 'http://static.apitech.ru/D2AAAAD69D244EC48DD56D0B006DEBEFRU', 0.01, 1, 111, 1355688000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(112, 1377, 'Облака войны', 'cloud_wars', 'Развивайте свое облачное царство в этой веселой игре, присылайте свои войска и захватывайте другие облака. Станьте королём небес!', 788, 910, 'vodnye,zaschita,letalki,vnimanie', 'arkady,kvesty', 'http://static.apitech.ru/95F892070B1646748BEC8EEEBCA4F324RU', 0.01, 1, 112, 1357675200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(113, 1376, 'Где моя голова?', 'haunted_halloween', 'Старина Скелет, готовясь к выходу, в свет отыскал и надел свой лучший костюм.  Но вот незадача, в последний момент он потерял свою голову! Помоги ему отыскать свою голову и не опоздать на бал!', 668, 830, 'volshebstvo,vremya,logicheskie,magiya,monstry,pamyat,prepyatstviya,prizraki,razvlecheniya', 'logicheskie,priklyucheniya,ekshn,kvesty', 'http://static.apitech.ru/7C7B1F866BC64DB6BDC312520C116261RU', 0.01, 1, 113, 1355083200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(114, 1375, 'Утопленники 2', 'utoplenniki_2', 'Спасайся кто может!!! Началось наводнение! Помоги бумажным человечкам выбраться из воды.', 718, 800, 'balans,vodnye,vremya,logicheskie,navyki,priklyucheniya', 'priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/EECC9127F35A41E3A30AA6546BDBD0D5RU', 0.01, 1, 114, 1355169600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(115, 1374, 'Разрушитель фортов', 'fort_blaster_ahoy_there', 'Что если вы пират, и у вас на корабле есть большие пушки?.. Наверняка, вам захотелось бы разнести что-нибудь большое! A что может быть лучше, чем вражеский форт с солдатами и куча сундуков набитых золотом? Свистать всех наверх!! У нас есть и то и другое!! Ahoy!!! Красочная аркада с элементами головоломки, пиратская тематика, голубое море, пальмы, песок, грог и морские напевы. 48 уровней в 3-х разных сеттингах. Разнообразное оружие. Набор достижений для настоящего пирата. И целая коллекция пиратских трофеев. Йо-хо-хо!!!', 654, 810, 'voennye,volshebstvo,vremya,korabli,navyki,oruzhie,prepyatstviya,priklyucheniya', 'arkady,logicheskie,priklyucheniya,kvesty', 'http://static.apitech.ru/A94D4BF79F6B4BF9A0E962D6CF68E0A7RU', 0.01, 1, 115, 1355169600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(116, 1373, 'Утопленники: Да придет Спаситель', 'utoplenniki_da_pridet_spasitel', 'Спаси бумажного утопленника. Это логическая игрушка! Вам необходимо придумать такой вариант комбинированных действий, что бы спасти утопленника от верной гибели!', 648, 800, 'balans,vodnye,vremya,kuritsa,logicheskie,malchik,prepyatstviya,priklyucheniya', 'logicheskie,priklyucheniya', 'http://static.apitech.ru/53F3CA0276B84A7E877CCC409551FBFBRU', 0.01, 1, 116, 1355169600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(117, 1371, 'Спринтер: Зимняя Тема', 'sprinter_zimnyaya_tema', 'В нарисованный мир спринтера пришла зима. \nПомоги спринтеру добежать как можно дальше. Собирай по пути елочные игрушки и звезды - они дают очки, и остерегайся острых шипов.', 668, 750, 'arkady,malchik,priklyucheniya,sneg,reaktsiya,vnimanie', 'arkady,dlya_devochek,priklyucheniya', 'http://static.apitech.ru/85620EEF68E948DF9A00441503048CC8RU', 0.01, 1, 117, 1354564800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(118, 1370, 'Помоги Санте', 'pomogi_sante', 'До нового года осталось совсем мало времени, а Санте нужно разнести еще целую кучу подарков, ты должен помочь ему в этом не легком деле !', 588, 750, 'devochkam,detyam,priklyucheniya,rozhdestvo', 'dlya_devochek,priklyucheniya,kvesty', 'http://static.apitech.ru/BB1792E2D11C4652AC8D683AA7DD425ERU', 0.01, 1, 118, 1354478400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(119, 1364, 'Переполох на кухне', 'perepolokh_na_kukhne', 'На кухне случился переполох, свежие продукты перемешались с пропавшими. Теперь повар нуждается в твоей помощи!', 588, 750, 'arkady,vremya,gotovka,devochkam,eda,sobiralki', 'arkady,dlya_devochek', 'http://static.apitech.ru/E8688774C0EB4E1D95F55F0D8F8C7752RU', 0.01, 1, 119, 1353528000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(120, 1363, 'Тип Топ', 'tip_top', 'Монеты, монстры, платформы и храбрый герой - все что нужно для отличной игры!', 668, 734, 'arkady,devochkam,logicheskie,priklyucheniya', 'arkady,dlya_devochek,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/76FDEA062947475684979BD3051A24C5RU', 0.01, 1, 120, 1353441600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(121, 1360, 'Тридцать три', 'thirty_three', 'Играй с 33 как с друзьями во дворе.  Набери 33 очка кидая мяч с трех позиций. ', 668, 750, 'basketbol,sportivnye', 'logicheskie,sportivnye', 'http://static.apitech.ru/1859BD44B7DF4E5F9D1EE6369F9C7B06RU', 0.01, 1, 121, 1352404800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(122, 1359, 'Мумии атакуют!', 'mummy_blaster', 'Тебе предстоит пробраться к несметным сокровищам спрятанным в недрах древних пещер. Но это не так просто, ведь пещеры заполнены злобными мумиями! Используй бомбы и динамит, чтобы избавиться от этих тварей и расчистить себе путь к богатству. ', 688, 810, 'arkady,bomby,logicheskie,priklyucheniya,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/483BB9948844493BA5174B6B208EF586RU', 0.01, 1, 122, 1352232000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(123, 1358, 'Разбей Робота!: Больше Взрывов', 'crash_the_robot_explosive_edition', 'Используй бомбы и другие механизмы, чтобы решить очередную головоломку и уничтожить робота. Если понадобится подсказка, воспользуйся прохождением.', 668, 750, 'arkady,voennye,logicheskie,prepyatstviya,priklyucheniya,unichtozheniya', 'arkady,voennye,logicheskie', 'http://static.apitech.ru/2C6C6B01403C4C8CA94E0FFCD54F5702RU', 0.01, 1, 123, 1352145600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(124, 1352, 'В движении', 'wonderway', 'Весь мир в движении и вы должны идти в ногу с ним. Постарайтесь выжить как можно дольше и набрать максимум очков. Получите все достижения, чтобы улучшить ваш результат. Различные игровые бонусы помогут вам в вашем приключении. Так чего же вы ждете? Вперед, к победе!', 668, 750, 'arkady,devochkam,letalki,mario,prepyatstviya,reaktsiya,padenie', 'arkady,dlya_devochek,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/40A863F41B164815A8DAFFCCE59D5AEBRU', 0.01, 1, 124, 1351108800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(125, 1350, 'Пришелец Джо', 'joe_the_alien', 'Участвуйте в космической одиссее пришельца Джо - исследуйте пространство, собирайте бонусы и соревнуйтесь с друзьями!', 775, 580, 'arkady,balans,logicheskie,priklyucheniya,prisheltsy,inoplyanetyane', 'arkady,logicheskie,priklyucheniya', 'http://static.apitech.ru/4A0681BE912F495E8E46EE0457407B93RU', 0.01, 1, 125, 1350936000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(126, 1348, 'Легкий Путь', 'EasyWayEng', 'В этой логической игре, выполненной в "бумажном" стиле, Вам нужно провести персонажа к его цели. Сделайте это как максимально быстро и за минимальное количество ходов, чтобы получить больше очков. Звучит просто, не так ли?', 708, 590, 'vremya,detyam,logicheskie,prepyatstviya', 'logicheskie,kvesty', 'http://static.apitech.ru/9BA59B56F87744B191B7AA2846B8FDA3RU', 0.01, 1, 126, 1350936000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(127, 1337, 'Прыгун: Школьная Тема', 'prygun_shkolnaya_tema', 'Прыгун попал в школу и прыгает там по учебникам, стараясь собрать как можно больше оценок.', 668, 750, 'arkady,detyam,reaktsiya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/721A4AAB34524ED69ABE0901BD409BF7RU', 0.01, 1, 127, 1349121600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(128, 1335, 'Счастливые звёзды', 'schastlivye_zvyozdy', 'Соберите как можно больше звёзд!', 668, 750, 'volshebstvo,vremya,detyam,kosmicheskie', 'arkady', 'http://static.apitech.ru/ECA3717319124BB68184B213C83A793FRU', 0.01, 1, 128, 1348689600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(129, 1333, 'Томи Голд', 'tomi_gold', 'Томи по прозвищу "Голд", обронил свой кошелек в водосточный люк. Пройди 20 уровней, помоги Томи собрать монеты с помощью трости.', 668, 750, 'arkady,vodnye,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/348F6D18064245529A41DA4962D01755RU', 0.01, 1, 129, 1348689600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(130, 1320, 'Сверкающая шахта', 'shining_mine', 'Быстрая игра в жанре "матч-3" где нужно собрать как можно больше драгоценных камней пока не взорвется бомба', 668, 750, 'arkady,krasota,logicheskie', 'logicheskie', 'http://static.apitech.ru/E0096BD4B5D44A84A93E06D3D7A40EC2RU', 0.01, 1, 130, 1347912000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(131, 1319, 'Спринтер 2', 'sprinter_2', 'Проведите своего спринтера как можно дальше, по волшебному тетрадному миру. Собирайте множество монет и звезд, зарабатывайте высокие звания  и остерегайтесь коварных шипов!', 668, 750, 'arkady,navyki,prepyatstviya,razvlecheniya,sobiralki', 'arkady', 'http://static.apitech.ru/60F1595D1BBC41598B3570D633F0AA6ARU', 0.01, 1, 131, 1347825600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(132, 1318, 'Сокровища Мистического моря', 'treasures_of_the_mystic_sea', 'Увлекательное приключение в жанре игр «Мач-3». Путешествие по Мистическому морю зачарует Вас своими загадками и тайнами. \nНайди легендарные сокровища пиратов. \nПолучи уникальные награды за подвиги и достижения. \nПроведи весело время на берегах Мистического моря.', 788, 910, 'arkady,vremya,unichtozheniya,sokrovischa', 'arkady,logicheskie', 'http://static.apitech.ru/3BB67F375786405FB1301665D326A30BRU', 0.01, 1, 132, 1347912000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(133, 1309, 'Резня Монстров', 'reznya_monstrov', 'Играя за лучника убивайте орды монстров. Покупайте  луки и стрелы и оборудование в магазине. Зарабатывайте достижения и улучшайте свои способности.', 668, 750, 'arkady,armiya,voennye,unichtozheniya', 'arkady,voennye,draki,strelyalki', 'http://static.apitech.ru/FB749EBB395A48E98ED7AFAA4F55B271RU', 0.01, 1, 133, 1349035200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(134, 1308, 'Разрушитель', 'razrushitel', 'Играем в Разрушитель. Щелкай мышью, размещая бомбы и динамит на очередном здании, а затем нажми кнопку ВЗРЫВ, чтобы подорвать заряды. Для прохождения уровня все обломки здания должны оказаться ниже пунктирной красной линии.', 688, 860, 'arkady,bomby', 'arkady,logicheskie', 'http://static.apitech.ru/29199E453CBB4C6AB828195327F32325RU', 0.01, 1, 134, 1347307200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(135, 1304, 'Магический колодец', 'magic_well', 'Забавная смешная игра с физикой воды. Оберегайте колодец от ужасных чудовищ.', 788, 830, 'arkady,volshebstvo,magiya,unichtozheniya', 'logicheskie', 'http://static.apitech.ru/C1A7D21E8B554025B386CA2409A8FAD1RU', 0.01, 1, 135, 1347912000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(136, 1302, 'Пушка Да Винчи 2', 'pushka_da_vinchi_2', 'Разрушай замки хитроумным изобретением великого Да Винчи !!! Ни один враг не устоит перед этим оружием !', 668, 750, 'bomby,unichtozheniya', 'arkady,voennye,fizicheskie_igry', 'http://static.apitech.ru/6FABBF277A514152BC288BCA4DE5508ARU', 0.01, 1, 136, 1347307200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(137, 1296, 'Урожай', 'urozhai', 'Собери урожай яблок. Расставь планки с помощью мышки, направляя яблоки в корзину. Можно собирать только хорошие яблоки, а гнилые собирать нельзя.', 668, 750, 'logicheskie,sobiralki,frukty,padenie', 'arkady,logicheskie', 'http://static.apitech.ru/83475C00D22D4B72A1BCCC3E2928266CRU', 0.01, 1, 137, 1346788800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(138, 1286, 'В штрафной', '11_meters_attack', 'Вы вошли в штрафную площадь, остается забить гол!', 588, 660, 'myach,navyki,reaktsiya,schet', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/CB1CC17C5DE54C76ACC75CF8106C0173RU', 0.01, 1, 138, 1347220800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(139, 1285, 'Случайная встреча', 'a_sudden_meeting', 'Это маленькая история про мальчика и случайную встречу. В этой игре нет монстров, взрывов и оружия. Это история с счастливым концом.', 588, 750, 'veliki,krasota,ravnovesie', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/29C9925539B046059A89CF2629481FCDRU', 0.01, 1, 139, 1374609600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(140, 1280, 'Шериф', 'shariff', 'Убей всех  бандитов. Используй рикошет пуль и падение предметов. остерегайся падающих предметов. Управление мышкой.', 668, 750, 'oruzhie,strategii,strelyalki,unichtozheniya', 'logicheskie,strelyalki', 'http://static.apitech.ru/B82EA2ED709048C49374087CB051B21ARU', 0.01, 1, 140, 1346616000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(141, 1277, 'Воздушный Дракон 2', 'vozdushnyi_drakon_2', 'Вторая часть разноцветного мира воздушных драконов.\nПоявились бомбы, звезды, новая стильная графика и драйвовая музыка.\nСтарайтесь не врезаться в летящие блоки и набирайте как можно больше очков.', 668, 750, 'drakony,prepyatstviya,fentezi,reaktsiya,pogonya', 'arkady,priklyucheniya', 'http://static.apitech.ru/C49D047FBD48438E96499EB41534599FRU', 0.01, 1, 141, 1345752000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(142, 1273, 'Безумные лучники', 'crazy_archers', 'Попробуйте выжить в соревновании безумных лучников. Используйте свои навыки стрельбы, чтобы победить врагов.', 668, 750, 'voennye,oruzhie,strelyalki', 'voennye,priklyucheniya,strelyalki', 'http://static.apitech.ru/3C14001BED064A4D9403B7E7C54E7714RU', 0.01, 1, 142, 1345406400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(143, 1270, 'Цветные войны', 'tsvetnye_voiny', 'Защитите межпланетную границу от вторжения цветного врага!', 668, 750, 'strelyalki,reaktsiya,vnimanie', 'voennye,strelyalki', 'http://static.apitech.ru/CE94842C589C4378AF4D397C5ED15E6FRU', 0.01, 1, 143, 1345060800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(144, 1256, 'Колобок 2012', 'kolobok_2012', 'Приключения Колобка в лесу 21-го века.', 538, 810, 'draki,oruzhie,priklyucheniya,krov', 'draki,priklyucheniya', 'http://static.apitech.ru/31D15E33FB5A487CBD5CE9686B8643ECRU', 0.01, 1, 144, 1346270400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(145, 1255, 'Чипочес', 'chipoches', 'Разместите фишки в указанном порядке. Это не так просто, как может показаться на первый взгляд. Движение фишек ограничено.', 668, 750, 'arkady,vremya,logicheskie', 'logicheskie', 'http://static.apitech.ru/9E94B56FC01F40119EE3A8758A272A62RU', 0.01, 1, 145, 1345060800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(146, 1252, 'Одень модель 2', 'oden_model_2', 'Новая модель ждет тебя, чтобы примерить новую коллекцию одежды.', 668, 750, 'malchik,odevalki,odezhda', 'podbor_odezhdy', 'http://static.apitech.ru/2C773331E0CA463B92EBD6BC8914B3F0RU', 0.01, 1, 146, 1344283200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(147, 1245, 'Пикап Мастер', 'pikap_master', 'Попробуй себя в роли настоящего пикап-мастера в этом абстрактном аркадном симуляторе! ', 658, 580, 'arkady,obolschenie,razvlecheniya,reaktsiya,vnimanie', 'arkady', 'http://static.apitech.ru/8F3134396F034001885CAD0DE51CB8FDRU', 0.01, 1, 147, 1342728000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(148, 1244, 'СтрипТир', 'striptir', 'Cбей одежду с красоток меткими выстрелами.', 668, 750, 'arkady,krasota,obolschenie,razvlecheniya,strelyalki,shutery,reaktsiya,odezhda', 'arkady,strelyalki', 'http://static.apitech.ru/7AE94B6D67DF461E9544ED67DC832088RU', 0.01, 1, 148, 1342468800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(149, 1243, 'Опасные машины 2', 'opasnye_mashiny_2', 'Садись в машину и круши своих соперников!!!', 668, 750, 'arkady,gonki,mashiny,prepyatstviya,razvlecheniya,ulichnye,unichtozheniya', 'arkady,gonki', 'http://static.apitech.ru/F88FD56B43A74E50BBF95483E1E9994DRU', 0.01, 1, 149, 1342123200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(150, 1241, 'Битва за небо', 'bitva_za_nebo', 'Винт, кабина, два крыла... Что ещё надо крутому асу? Садись в самолёт и мочи фашистов! Тебя ждут увлекательные полёты, 10 заданий по уничтожению наземных, воздушных и морских целей, групповые бои и многое другое!', 788, 910, 'arkady,armiya,voennye,letalki,razvlecheniya,samolety,strelyalki,unichtozheniya', 'arkady,voennye,priklyucheniya,strelyalki', 'http://static.apitech.ru/0E6CCD812D65464CA25ADF279F3091F0RU', 0.01, 1, 150, 1341950400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(151, 1235, 'Мьюзикбол', 'myuzikbol', 'Физический симулятор с музыкальным уклоном. Направляйте шарики в воронку, используя музыкальные инструменты. И музыка зазвучит в облаках. Почувствуйте себя композитором.', 668, 750, 'arkady,volshebstvo,devochkam,detyam,krasota,logicheskie,razvlecheniya', 'arkady,dlya_devochek,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/61C4B40CB51F4098AAF18828F937BFC2RU', 0.01, 1, 151, 1341864000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(152, 1234, 'Мечты Люси', 'mechty_lyusi', 'Никогда не переставать мечтать, идти вперед, бороться до последнего. \nДаже если ты маленькая девочка, а вокруг тебя полный опасностей мир...', 668, 750, 'arkady,volshebstvo,logicheskie,prepyatstviya,priklyucheniya,razvlecheniya,sobiralki,fentezi', 'arkady,logicheskie,priklyucheniya,fizicheskie_igry,brodilki,kvesty', 'http://static.apitech.ru/E03D40D7E4484D25BDC2A3E763CF27F1RU', 0.01, 1, 152, 1341950400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(153, 1232, 'БабблБум!', 'babblbum', 'Порви их всех!Лопай пузыри и зарабатывай очки!', 668, 750, 'arkady,detyam,razvlecheniya,strelyalki,unichtozheniya,shariki', 'arkady,strelyalki', 'http://static.apitech.ru/93ED13C12ECD48B0B436F0B5D3C6C3F6RU', 0.01, 1, 153, 1341518400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(154, 1225, 'Бузлики в космосе', 'buzliki_v_kosmose', 'Бузлики отправились исследовать космос, помоги им в этом нелегком деле!', 588, 710, 'arkady,detyam,kosmicheskie,monstry,prepyatstviya,priklyucheniya,razvlecheniya,zvezdy,inoplyanetyane', 'arkady,priklyucheniya', 'http://static.apitech.ru/5A252F0AE4A749E486F17A66BD3F9E18RU', 0.01, 1, 154, 1340654400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(155, 1222, 'Веселый Джонг', 'veselyi_dzhong', 'Веселый маджонг-пасьянс с гравитацией. Ваша цель — находить пары одинаковых фишек и удалять их с поля как можно быстрее. При этом фишки будут обваливаться под собственным весом, а сверху падать все новые и новые. Бонусы помогут растянуть минуту и собрать больше очков!', 668, 750, 'vremya,devochkam,logicheskie,naiti,nastolnye,razvlecheniya,unichtozheniya', 'dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/6123F703FCB842078EBCDCB40B8E69F5RU', 0.01, 1, 155, 1340654400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(156, 1219, 'Прыгун 2', 'prygun_2', 'Встречайте вторую часть знаменитой игры! Теперь еще больше драйва, монет, бонусов и веселья!', 668, 750, 'arkady,balans,navyki,prepyatstviya,razvlecheniya,sobiralki,reaktsiya', 'arkady', 'http://static.apitech.ru/F6135C2FFD8F49A1A94DD65A12C7296ERU', 0.01, 1, 156, 1340654400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(157, 1218, 'Космический Жук', 'kosmicheskii_zhuk', 'Уничтожайте вражеские корабли с помощью космического жука!', 728, 750, 'arkady,korabli,kosmicheskie,navyki,prepyatstviya,priklyucheniya,razvlecheniya,unichtozheniya', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/0F160937DA4A446983D79AFF5A4F6640RU', 0.01, 1, 157, 1340654400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(158, 1217, 'Прыгунок', 'prygunok', 'Помогите прыгунку покорить высоту! С помощью компьютерной "мыши" Вы сможете перемещать платформу, от которой прыгунок будет отталкиваться и подниматься всё выше и выше. Бонусы можно собирать, "кликнув" по ним. Чтобы нейтрализовать крейзи-летуна, просто щёлкните по нему мышью', 668, 750, 'arkady,detyam,monstry,prepyatstviya,priklyucheniya,razvlecheniya,unichtozheniya', 'arkady,priklyucheniya', 'http://static.apitech.ru/C56D7523B75A4BC0AA00D2A990B47752RU', 0.01, 1, 158, 1340654400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(159, 1215, 'Маджонг - Долина в горах', 'madzhong_-_dolina_v_gorakh', 'Китайская долина в горах и классический китайский пазл Маджонг. Играйте в игру, и вы почувствуете вкус путешествия в Китай!', 764, 865, 'vremya,logicheskie,naiti,nastolnye,razvlecheniya,unichtozheniya,vnimanie', 'dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/D798F7B0A464425BB69E4294321BCCDARU', 0.01, 1, 159, 1340654400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(160, 1206, 'Поймай Животных', 'poimai_zhivotnykh', 'В этой веселой игре вы должны собирать животных в группы и потом ловить. Будьте внимательны, некоторые животные хорошие, но есть и плохие!', 764, 865, 'arkady,zhivotnye,razvlecheniya,unichtozheniya,shutery,reaktsiya', 'arkady', 'http://static.apitech.ru/A37F1AE098EE4315B80130E21CB8AEFFRU', 0.01, 1, 160, 1339704000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(161, 1205, 'Времена года', 'vremena_goda', 'Красивый арканоид времен года. Приятная музыка позволит почувствовать себя на природе. Разбивая блоки, получайте специальный эффект, соответствующий времени года: падающие снежинки, разлетающийся пух одуванчика, падающие листья, взрыв тыквы и др. В каждом сезоне звуки, соответствующие времени года. В общей сложности 20 уровней по 5 на сезон.', 668, 750, 'arkady,devochkam,detyam,razvlecheniya,unichtozheniya,arkanoid', 'arkady,dlya_devochek,fizicheskie_igry', 'http://static.apitech.ru/D2C62F9B00824EEC99ECC88173A93DABRU', 0.01, 1, 161, 1341172800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(162, 1204, 'Бузлики', 'buzliki', 'Помоги Бузликам защитить их родную планету, Бузлию!', 588, 710, 'arkady,zaschita,monstry,navyki,priklyucheniya,razvlecheniya,strelyalki,unichtozheniya', 'arkady,priklyucheniya,strelyalki,ekshn', 'http://static.apitech.ru/3676A4426DF349DDBDF4CF36D0981838RU', 0.01, 1, 162, 1339704000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(163, 1203, 'Погоня 2', 'pogonya_2', 'Гоните на полицейской машине, отстреливайте бандитов, уклоняйтесь от бомб!', 775, 580, 'gonki,mashiny,prepyatstviya,razvlecheniya,strelyalki', 'gonki,strelyalki', 'http://static.apitech.ru/77CF438EEAF44CFD8AA78ABCFE885BDERU', 0.01, 1, 163, 1339704000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(164, 1202, 'Спринтер', 'sprinter', 'Помогите спринтеру пробежать как можно дальше в опасном тетрадном мире. Чтобы набрать больше очков - собирайте монеты, а чтобы остаться дольше в живых, избегайте острых шипов!', 668, 750, 'arkady,navyki,prepyatstviya,razvlecheniya,sobiralki,reaktsiya,beg', 'arkady', 'http://static.apitech.ru/78CD8FC4BF8D4A78888E7251CDFDB7BARU', 0.01, 1, 164, 1339099200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(165, 1201, 'Сумасшедший Водила', 'sumsshedshii_vodila', 'Помоги сумасшедшему водиле проехать как можно дальше, пока его машина не развалилась на части!', 762, 580, 'arkady,mashiny,navyki,prepyatstviya,priklyucheniya,razvlecheniya,reaktsiya', 'arkady', 'http://static.apitech.ru/D4F43F832A6E4B21BB574A0EA34AE42CRU', 0.01, 1, 165, 1338840000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(166, 1200, 'Воришка на колесах', 'vorishka_na_kolesakh', 'Помогите воришке на колесах как можно скорее собрать все алмазы. При этом не попадайтесь полицейским и объезжайте дорожные конусы.', 668, 750, 'arkady,vremya,mashiny,prepyatstviya,priklyucheniya,razvlecheniya,sobiralki', 'arkady,priklyucheniya', 'http://static.apitech.ru/501769A6686C489D9BC47A1893C11CADRU', 0.01, 1, 166, 1338753600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(167, 1199, 'Бегун 3', 'begun_3', 'Пробеги как можно дальше в новой части игры "Бегун" !', 588, 660, 'arkady,navyki,prepyatstviya,razvlecheniya,beg', 'arkady', 'http://static.apitech.ru/FAA69A480F594B78B4ED29D380C849F8RU', 0.01, 1, 167, 1338753600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(168, 1195, 'Подземелье Зла', 'podzemele_zla', 'Создай героя и отправляйся исследовать подземелье. Развивай своего героя, улучшай экипировку, уничтожай монстров, находи сокровища и артефакты! ', 588, 750, 'arkady,navyki,naiti,priklyucheniya,razvlecheniya,rolevye,sobiralki,fentezi,sokrovischa', 'arkady,priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/A3ACF90941C44795B62E9A885AB188D5RU', 0.01, 1, 168, 1338408000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(169, 1188, 'Опасные машины', 'opasnye_mashiny', 'Садись в машину и круши своих соперников!!!', 668, 750, 'arkady,detyam,mashiny,navyki,prepyatstviya,razvlecheniya,unichtozheniya', 'arkady', 'http://static.apitech.ru/FC94A9F71F7E4933BAB3855FE3E974EARU', 0.01, 1, 169, 1338148800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(170, 1184, 'Покемон карточки', 'pokemon_kartochki', 'Игра для детей, в которой нужно находить одинаковые карточки с покемонами. Запоминайте, какой где находится, и пройдите все 10 уровней.', 688, 810, 'arkady,detyam,naiti,razvlecheniya,ugadaiki,vnimanie,pokemony', 'anime,arkady,multiki', 'http://static.apitech.ru/01CEB652F22C455384E27E6568EA04AARU', 0.01, 1, 170, 1338148800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(171, 1183, 'Одень модель', 'oden_model', 'Одень модель по своему вкусу и сделай ее фото. Улучшай навык дизайнера, подбирая комплекты одежды по заданным образцам.\n', 668, 750, 'devochkam,moda,odevalki', 'dlya_devochek,podbor_odezhdy', 'http://static.apitech.ru/F9B545C9A607410FB02C1C149CE85C45RU', 0.01, 1, 171, 1337976000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(172, 1182, 'Робот Шпион', 'robot_shpion', 'Возьми под свое управление робота шпиона и собирай чипы с секретной информацией, уворачивайся от лазеров и не забывай следить за своим запасом энергии и здоровья.', 688, 710, 'arkady,prepyatstviya,roboty', 'arkady', 'http://static.apitech.ru/46E5D93017DE40BFABFB894B2DCA7416RU', 0.01, 1, 172, 1337976000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(173, 1179, 'Открытый Космос', 'otkrytyi_kosmos', 'Вы - одинокий космонавт летящий сквозь открытый космос полный враждебных монстров и астероидов.\nВаша цель - собрать как можно больше разноцветных минералов и набрать максимум очков.', 668, 750, 'arkady,balans,kosmicheskie,navyki,prepyatstviya,priklyucheniya,razvlecheniya,reaktsiya', 'arkady,priklyucheniya', 'http://static.apitech.ru/1F8980B51293449EA8D5F2E994D0BED8RU', 0.01, 1, 173, 1337716800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(174, 1178, 'Фруктовый День 2', 'fruit_day_2', 'Помоги человечку собрать как можно больше фруктов!', 588, 710, 'arkady,detyam,priklyucheniya,razvlecheniya,sobiralki,frukty,reaktsiya', 'arkady,priklyucheniya', 'http://static.apitech.ru/5401ECEA47F24BF39842D0B34CDB9EF0RU', 0.01, 1, 174, 1337716800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(175, 1177, 'Зомби Прыгун', 'zombie_jump', 'Помоги зомби выбраться из могилы. Остерегайся острых предметов, они могут навредить зомби. Собирай мозги! Зомби любит мозги!', 788, 660, 'arkady,zombi,monstry,navyki,prepyatstviya,razvlecheniya,reaktsiya', 'arkady', 'http://static.apitech.ru/8040473F89B54D18885AB9CAFA83ACC4RU', 0.01, 1, 175, 1337630400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(176, 1174, 'В поисках пиратских сокровищ', 'v_poiskakh_piratskikh_sokrovisch', 'Динамическая головоломка, основывающаяся на простых правилах игры "Пятнашки". С помощью смекалки и ловкости необходимо отобрать у пиратов все сокровища, хранящиеся на далеких тропических островах.\n', 668, 750, 'arkady,vodnye,korabli,logicheskie,navyki,razvlecheniya,piraty,sokrovischa', 'arkady,logicheskie', 'http://static.apitech.ru/35D22FB2686A4F6AA4CD91123962EA7ERU', 0.01, 1, 176, 1337630400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(177, 1172, 'Быстрая Гонка', 'bystraya_gonka', 'Постарайтесь продержаться хотя бы 3 круга на трассе, в этой быстрой гонке. И не забывайте по дороге собирать мешки с деньгами - они приносят очки.', 668, 750, 'arkady,gonki,mashiny,navyki,razvlecheniya,reaktsiya', 'arkady,gonki', 'http://static.apitech.ru/C11D8305BDF24DCE87B85AF9CBB4E499RU', 0.01, 1, 177, 1337198400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(178, 1161, 'Прыгун', 'prygun', 'Допрыгайте как можно дальше по нарисованным в тетради платформам. По пути собирайте зеленые монеты и старайтесь не попасть на красные платформы с шипами.', 668, 750, 'arkady,navyki,prepyatstviya,razvlecheniya,beg', 'arkady', 'http://static.apitech.ru/6E7DF4FDE2614A74B17FB45CE85FE284RU', 0.01, 1, 178, 1336939200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(179, 1152, 'Анаконда', 'anakonda', 'Собирайте фрукты и разноцветные точки, набирайте как можно больше очков и старайтесь не врезаться в стены или собственный хвост.', 668, 750, 'arkady,vremya,devochkam,navyki,razvlecheniya,frukty,reaktsiya,zmeika', 'arkady', 'http://static.apitech.ru/F0861861EE2E449B930EC4A29050C649RU', 0.01, 1, 179, 1336507200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(180, 1149, 'Крестовый поход 2', 'krestovyi_pokhod_2', 'Спаси землю от вторжения кровожадных монстров!!!\nТолько твоя мега-пушка может сделать это!', 668, 750, 'voennye,zaschita,kosmicheskie,strelyalki,pushki,inoplyanetyane,vtorzhenie', 'arkady,voennye,fizicheskie_igry', 'http://static.apitech.ru/DF5D3B8977314C3CA8D843AA2DF28A78RU', 0.01, 1, 180, 1336507200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(181, 1148, 'Бегун 2', 'begun_2', 'Добеги как можно дальше, уклоняясь от блоков.', 588, 660, 'arkady,navyki,prepyatstviya,razvlecheniya,beg', 'arkady', 'http://static.apitech.ru/C8FB14F20249466391D260C7B4502098RU', 0.01, 1, 181, 1336248000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(182, 1138, 'Покемоны - стратегия Башенки', 'pokemony_-_strategiya_bashenki', 'Загадочный Покемон спящий глубоко под землей - обладает огромной гипнотической силой. Он решил навести свой порядок в мире Покемонов. Это стратегия в стиле Башенки (Tower Defense) с любимыми героями франчайза Покемон. 95 покемонов использовано в игре! 9 уникальных по дизайну уровней, и 6 типов башенок.', 668, 750, 'arkady,bashni,zaschita,logicheskie,multiki,navyki,razvlecheniya,strategii,unichtozheniya,pokemony', 'anime,arkady,logicheskie,strategii', 'http://static.apitech.ru/42288C8598314944A8AA0B84BE5ED8D2RU', 0.01, 1, 182, 1336161600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(183, 1137, 'Тайна старого Дома', 'taina_starogo_doma', 'Помогите своему старому другу, снимите заклинанье с его семейного поместья. Найдите все скрытые предметы и части амулета, собранный амулет поможет снять заклятье.', 764, 865, 'arkady,vremya,naiti,razvlecheniya,vnimanie,taina', 'arkady,poisk_predmetov,kvesty', 'http://static.apitech.ru/B0DCFF94944D4112B34CA8C4DF00B8F7RU', 0.01, 1, 183, 1336075200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(184, 1136, 'На пределе', 'rctest2', 'Уничтожай разноцветные шарики в этой яркой и захватывающей игре! Стреляй в группы из двух и более шариков, собирай полезные бонусы и набирай как можно больше очков!', 588, 610, 'arkady,devochkam,zaschita,logicheskie,puzyri,razvlecheniya,strelyalki,unichtozheniya,shariki,shutery', 'arkady,logicheskie,strelyalki', 'http://static.apitech.ru/54966CF93092454DB4089A53BE06BAC8RU', 0.01, 1, 184, 1338753600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(185, 1134, 'Воздушный Дракон', 'vozdushnyi_drakon', 'Летите в разноцветном мире воздушных драконов и собирайте волшебные пилюли. Старайтесь не врезаться в летящие блоки и набирайте как можно больше очков.', 668, 750, 'devochkam,drakony,prepyatstviya,fentezi,pogonya', 'arkady,dlya_devochek,priklyucheniya', 'http://static.apitech.ru/A7E9706444B841298D5DA1CA324EFA05RU', 0.01, 1, 185, 1335988800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(186, 1131, 'Огненный дождь', 'fire_rain', 'Метеоритный поток грозит стереть с лица земли несколько крупных городов. Единственный шанс на спасение — система противометеоритной защиты, управление которой поручено вам.', 668, 750, 'arkady,zaschita,kosmicheskie,navyki,razvlecheniya,spasatelnye,unichtozheniya,shutery,ataka,reaktsiya', 'arkady,priklyucheniya,strelyalki', 'http://static.apitech.ru/D95E6DDBB44148F5998A32FC2AB9A166RU', 0.01, 1, 186, 1335902400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(187, 1130, 'Пиксель-апокалипсис: Защитник', 'piksel-apokalipsis_zaschitnik', 'Защити своих от красных. Не дай им пройти.\nУправление - стрелки вверх и вниз. Огонь ведётся автоматически.', 488, 710, 'arkady,voennye,mashiny,strelyalki', 'arkady,priklyucheniya,strelyalki', 'http://static.apitech.ru/2BB77BC3AD07415EAFECEDF433F5A96BRU', 0.01, 1, 187, 1335988800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(188, 1122, 'Робин Гуд - бой против зомби', 'robin_gud_-_boi_protiv_zombi', 'Помогите отличному солдату - Робин Гуду взять в плен всех зомби! Посадите их всех в клетки, для этого используйте уникальные фичи на уровнях.', 764, 865, 'arkady,zombi,logicheskie,navyki,priklyucheniya,razvlecheniya,strely', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/57327AFD39BA496198F6F56AF835B2DBRU', 0.01, 1, 188, 1335384000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(189, 1121, 'Инь и Янь - Слияние', 'in_i_yan_-_sliyanie', 'В этой забавной игре на физику вы должны соединить две противоположности - Инь и Янь. Удаляйте предметы так, чтоб черное и белое соединилось.', 764, 865, 'arkady,bomby,logicheskie,navyki,prepyatstviya,razvlecheniya', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/B473D7D3F9EB4714BADA9D43A094702FRU', 0.01, 1, 189, 1335211200, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(190, 1120, 'Битый Пиксель', 'bityi_piksel', 'Смотрите, чтобы вам не достался плохой монитор, ищите и убирайте на нем битые пиксели. Это не так просто как кажется!', 668, 750, 'arkady,logicheskie,navyki,naiti,razvlecheniya,vnimanie', 'arkady,logicheskie', 'http://static.apitech.ru/F9AE857B0854417686B27E331C94F05ERU', 0.01, 1, 190, 1335124800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(191, 1119, 'Вирусы - Защита Больницы', 'virusy_-_zaschita_bolnitsy', 'Множество вирусов объединились в атаке на больницу. Они хотят инфицировать всех людей которые находятся внутри.\nСтройте защитные башни и предовратите вирусную атаку.', 764, 865, 'arkady,bashni,detyam,zaschita,logicheskie,razvlecheniya,strategii,strelyalki,unichtozheniya,shutery,eksheny,bolnitsa', 'arkady,logicheskie,strategii,kvesty', 'http://static.apitech.ru/8A35344F25444D9F964491DEEA540DABRU', 0.01, 1, 191, 1334865600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(192, 1118, 'Ферма Мечты', 'ferma_mechty', 'Веселая игра, в которой у вы будете строить и развивать свою ферму. Зарабатывайте деньги с помощью популярной механики матч3 с множеством фич.\nОбустраивайте свою ферму и увеличивайте уровень комфорта.', 764, 865, 'arkady,vremya,devochkam,zhivotnye,logicheskie,naiti,razvlecheniya,unichtozheniya,ferma', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/B771ACE8D05848838AACF2C44384C4FDRU', 0.01, 1, 192, 1334865600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(193, 1117, 'Каракули в Космосе', 'karakuli_v_kosmose', 'Собирайте звезды и бонусы, попутно уничтожая встречные астероиды и НЛО, в нарисованном в тетради космосе.', 668, 750, 'arkady,vremya,korabli,kosmicheskie,letalki,navyki,prepyatstviya,razvlecheniya,unichtozheniya,zvezdy,nlo', 'arkady', 'http://static.apitech.ru/3E4945D05E8540AB8997511F707AC8A5RU', 0.01, 1, 193, 1334865600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(194, 1116, 'Морской бой', 'morskoi_boi', 'Отбивайся от вражеского флота!', 588, 660, 'arkady,vodnye,zamki,zaschita,korabli,navyki,razvlecheniya,unichtozheniya,pushki', 'arkady', 'http://static.apitech.ru/862C1B0F95234491A9E1764AA6F8A87CRU', 0.01, 1, 194, 1334865600, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(195, 1111, 'Пиратский сундук', 'greedy_pirates', '"Пиратский сундук" – физический пазл пиратской тематики. Помогите пиратам собрать все свое золото обратно в сундук! Решайте различные головоломки и старайтесь это сделать как можно быстрее,чтобы получить бонусные очки. Йо-хо-хо и бутылка рома!', 688, 810, 'arkady,vremya,korabli,logicheskie,prepyatstviya,priklyucheniya,razvlecheniya,sokrovischa', 'arkady,priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/1F478418902F46A2A7FE189BDF99B7F6RU', 0.01, 1, 195, 1341086400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(196, 1109, 'Веселые тачки 2', 'veselye_tachki_2', 'В этой увлекательной игре вы должны припарковать машину. Будьте внимательны, не сбейте пешехода или проезжающую машину.\nТеперь вам нужно освободить выезд для своей машины с парковки, смело расталкивайте машины которые вам мешают.\nВ игре вас ждет множество фич, таких как смена времен года с погодными условиями, двигающиеся пешеходы и машины, две разные механики, магазин в котором вы сможете тюнинговать свою машину.', 764, 865, 'arkady,logicheskie,mashiny,navyki,parkovka,prepyatstviya,razvlecheniya', 'arkady', 'http://static.apitech.ru/2C2C0C45DB65490E8159FC8D6D6DBF11RU', 0.01, 1, 196, 1335902400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(197, 1103, 'Падение Алисы', 'alice_fall', 'Алиса падает в волшебную нору, помогите ей пролететь как можно дольше. Зелья делают вас меньше, а пирожки больше. Остерегайтесь злых черепов. Вперед, в кроличью нору!', 788, 910, 'arkady,detyam,navyki,prepyatstviya,razvlecheniya,sobiralki,reaktsiya,padenie,alisa', 'arkady', 'http://static.apitech.ru/B53C42CCA00847498B99F576D584AEC4RU', 0.01, 1, 197, 1334692800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(198, 1101, 'Звездный катер 2', 'zvezdnyi_kater_2', 'Собирай звезды, старайся объезжать бомбы. Время не ждет!', 588, 660, 'arkady,bomby,vodnye,vremya,navyki,razvlecheniya,reaktsiya,kater,zvezdy', 'arkady', 'http://static.apitech.ru/0DFC22DCBFCA45C3BCA95458B98D92B9RU', 0.01, 1, 198, 1334692800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(199, 1095, 'Закрытая Дорога', 'closedroad', 'Эта дорога— серьёзное испытания даже для опытного гонщика. Ни одна машина не переживёт столкновение с бочками полными горючего.', 668, 750, 'arkady,mashiny,navyki,prepyatstviya,razvlecheniya,reaktsiya', 'arkady,gonki', 'http://static.apitech.ru/64AA0E1334BB4157BF130B429812792DRU', 0.01, 1, 199, 1334692800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(200, 1094, 'Гонки', 'gonki', 'Объезжай машины и мчи на полной скорости!', 588, 660, 'arkady,gonki,mashiny,prepyatstviya,razvlecheniya,simulyatory,reaktsiya', 'arkady,gonki', 'http://static.apitech.ru/D529E5D3F2284B87ABE506DE1AB33B03RU', 0.01, 1, 200, 1334692800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(201, 1093, 'Стрелы 2', 'strely_2', 'Отбивай летящие со всех сторон стрелы щитом!', 588, 740, 'arkady,zaschita,navyki,razvlecheniya,reaktsiya,strely', 'arkady', 'http://static.apitech.ru/D7721598874E448AABC622BD60C93ED5RU', 0.01, 1, 201, 1334692800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(202, 1090, 'Ворон', 'voron', 'Лети по небу, над лугами и дорогами, уклоняйся от орлов и собирай звезды.', 588, 660, 'arkady,letalki,navyki,razvlecheniya,sobiralki,reaktsiya,ptitsy,zvezdy', 'arkady', 'http://static.apitech.ru/87F1DDB5C40341F8B641451CE3DBD84ARU', 0.01, 1, 202, 1334692800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(203, 1089, 'Псы ниндзя', 'psy_nindzya', 'Игра в стиле Angry Birds! Помоги псам ниндзя спасти старого Мастера. Запускай их из пушки, используй супер-удары и разрушай строения злобных котов! Красочные уровни и увлекательный игровой процесс!', 713, 810, 'arkady,zhivotnye,koshki,letalki,logicheskie,navyki,prepyatstviya,priklyucheniya,razvlecheniya,sobaka,unichtozheniya', 'arkady,logicheskie,priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/E4A665945EF745DFA942D344AF2E5CB1RU', 0.01, 1, 203, 1334260800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(204, 1088, 'Погоня', 'pogonya', 'Ты - коп, и твоя задача - расстреливать машины бандитов.', 775, 580, 'arkady,bomby,mashiny,navyki,prepyatstviya,razvlecheniya,ulichnye,pogonya', 'arkady', 'http://static.apitech.ru/B38D485971D1499EADC1D7F5947990D9RU', 0.01, 1, 204, 1334260800, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(205, 1086, 'Коты - три в ряд', 'koty_-_tri_v_ryad', 'Собирай котов по три и больше в ряд для того, чтобы убежали с крыши. Выполняй определенные задания, чтобы перейти на следующий уровень.', 588, 660, 'arkady,vremya,zhivotnye,koshki,navyki,naiti,razvlecheniya,unichtozheniya', 'arkady', 'http://static.apitech.ru/36E263BB36B04604AD82448B96A51137RU', 0.01, 1, 205, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(206, 1081, 'Бегун', 'begun', 'Беги, уклоняясь от блоков. Пробеги как можно дальше!', 588, 660, 'arkady,navyki,prepyatstviya,razvlecheniya,reaktsiya,beg', 'arkady', 'http://static.apitech.ru/627EB63917F844DA904BE68DE177B185RU', 0.01, 1, 206, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(207, 1077, 'Король Пузырей', 'korol_puzyrei', 'Станьте королем в разноцветном мире пузырей!', 668, 750, 'arkady,vodnye,detyam,navyki,puzyri,razvlecheniya,sobiralki', 'arkady', 'http://static.apitech.ru/97AC199DF2D74F7C8525E729EA6F021CRU', 0.01, 1, 207, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(208, 1076, 'Пьяный тир', 'pyanyi_tir', 'Немного перебрав, постарайся попасть в как можно большее число банок.', 588, 660, 'arkady,vremya,navyki,oruzhie,razvlecheniya,strelyalki,unichtozheniya', 'arkady,strategii', 'http://static.apitech.ru/208FD64AC61245D7BC7F46BEA891FC9ARU', 0.01, 1, 208, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(209, 1072, 'Звездный катер', 'zvezdnaya_lodka', 'Собирай звезды в открытом море на катере!', 588, 660, 'arkady,vodnye,vremya,korabli,navyki,razvlecheniya,kater,zvezdy', 'arkady', 'http://static.apitech.ru/4FDD989E98544C5EA4BB2637282044F0RU', 0.01, 1, 209, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(210, 1071, 'Пробуждение тотемов', 'totems_awakening', 'Племя ацтеков в беде! Их боги заточены в каменных тотемах, расположенных по всему острову. Помоги ацтекам добросить до тотема кокос и разбудить древних богов!', 688, 810, 'arkady,logicheskie,razvlecheniya,atsteki,totemy', 'arkady,logicheskie,fizicheskie_igry,kvesty', 'http://static.apitech.ru/250AB1F878A145CBA17E960C16D5437CRU', 0.01, 1, 210, 1352232000, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(211, 1066, 'Грозовая туча', 'grozovaya_tucha', 'Толпы зомби пытаются проникнуть сквозь оборонительное сооружение. Новая разработка военных - оружие из грозовой тучи, бьющее молниями. Не дай зомби сломать стену.', 588, 660, 'arkady,zaschita,zombi,navyki,razvlecheniya,unichtozheniya,reaktsiya', 'arkady', 'http://static.apitech.ru/89EF44DA378B46BFB8D71E2A8EEDCF13RU', 0.01, 1, 211, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(212, 1065, 'Титаник 2D', 'titanik', 'Спаси корабль от неминуемой гибели! Уклоняйся от айсбергов.', 588, 660, 'arkady,vodnye,korabli,led,navyki,prepyatstviya,priklyucheniya,razvlecheniya,spasatelnye', 'arkady,priklyucheniya', 'http://static.apitech.ru/878AE923FE59404C99DD405FAB13DC8ARU', 0.01, 1, 212, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(213, 1061, 'Воздушный Лабиринт 3', 'vozdushnyi_labirint_3', 'Помогите человеку на  воздушных шарах пройти лабиринт! Для победы вам нужно собрать все монеты, и постараться не задеть пушки, птиц и всякую остальную мелочь, и так все уровни. Вы тоже можете стрелять', 648, 800, 'arkady,balans,detyam,letalki,navyki,prepyatstviya,priklyucheniya,razvlecheniya,reaktsiya', 'arkady,logicheskie,ekshn,brodilki,kvesty', 'http://static.apitech.ru/11770D747C34478A8FF0DE8A96DCB599RU', 0.01, 1, 213, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
