(218, 1056, 'Быстрый и мёртвый', 'bystryi_i_myortvyi', 'Ты зашел не в то время и не в тот бар. Большая Мама за что-то обозлилась на тебя, и теперь предстоит выяснить, кто из вас быстрый, а кто - мертвый.', 638, 710, 'arkady,navyki,oruzhie,razvlecheniya,strelyalki,unichtozheniya,shutery,reaktsiya', 'arkady', 'http://static.apitech.ru/A3FEAA251D5640859A5ADC857211ACC0RU', 0.01, 1, 218, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(219, 1055, 'Злые осы', 'zlye_osy', 'На ферму надвигается большая туча опасных ос! Не дай им пробраться ближе к ферме.', 588, 660, 'arkady,vremya,zaschita,navyki,razvlecheniya,strelyalki,shutery,ataka,nasekomye', 'arkady', 'http://static.apitech.ru/03227FF2CAB549B8BDC644551DB26BACRU', 0.01, 1, 219, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
