(221, 1051, 'Летящий мужик', 'letyaschii_muzhik', 'Супермен в одних трусах попал в передрягу: перед ним миллионы кактусов.\nСможешь ли ты помочь облететь их всех? Поговаривают 10000 очков могут набрать лишь около 3% человечества.', 588, 660, 'arkady,bomby,letalki,prepyatstviya', 'arkady', 'http://static.apitech.ru/390DAEF7A8C041F2B280C93CBFF75E62RU', 0.01, 1, 221, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
