(226, 1046, 'Капли', 'kapli', 'Увлекательная логическая игра, в которой вам необходимо очистить поле от капель. При переполнении капля взрывается и разлетается в четыре стороны.', 588, 660, 'arkady,logicheskie,razvlecheniya,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/9484147007AB4EAEA04037D531D82D65RU', 0.01, 1, 226, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(227, 1045, 'Фрукты - три в ряд', 'frukty_-_tri_v_ryad', 'Собирай фрукты по три и больше в ряд для того, чтобы засунуть их в соковыжималку. Выполняй определенные задания чтобы перейти на следующий уровень.', 588, 660, 'arkady,eda,logicheskie,naiti,razvlecheniya,unichtozheniya,frukty', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/EAF296758F394785B467EE413FFED531RU', 0.01, 1, 227, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
