(237, 1033, 'Русский медведь Борис: атака овец-камикадзе', 'russkii_medved_boris_ataka_ovets-kamikadze', 'Как-то ранним утром медведь Борис проснулся от странного шума. Выглянув в окно, он увидел армаду летающих овец и коров, скидывающих бомбы на его огород. Борис схватил первый подвернувшийся под руку предмет (а им оказалось ведро с болтами) и помчался защищать свое имущество...', 588, 660, 'arkady,bomby,zhivotnye,zaschita,razvlecheniya,strelyalki', 'arkady', 'http://static.apitech.ru/E5290BB76A6B41379F2D7D834D647ED4RU', 0.01, 1, 237, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(238, 1031, 'Бегущий от стихии', 'beguschii_ot_stikhii', 'Вам нужно продержаться как можно дольше, убегая от огромной волны воды, потока лавы и цунами из слизи, пущенной инопланетными жуками.', 588, 910, 'arkady,navyki,pobeg,prepyatstviya,priklyucheniya,razvlecheniya,sobiralki,eksheny', 'arkady,priklyucheniya', 'http://static.apitech.ru/4B4294884446437283F146FE2CC35FC8RU', 0.01, 1, 238, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
