(241, 1025, 'Самосвал', 'samosval', 'Цель игры - нагрузить самосвал кирпичами и вовремя доставить их на стройку!\nСамые успешные водители самосвалов получат награды за свои достижения и увидят 3D модель самосвала прямо на своем столе (требуется веб-камера)!\n\nУправление: стрелки клавиатуры.', 614, 750, 'arkady,vremya,gruzoviki,mashiny,razvlecheniya,simulyatory', 'arkady', 'http://static.apitech.ru/7F23F498C68D4DD4A397BE28280555CARU', 0.01, 1, 241, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(242, 1024, 'Лось-викинг Геннадий: добраться до Вальгаллы', 'los-viking_gennadii', 'Свежеубитый в бою Лось-викинг Геннадий отправился прямиком в Вальгаллу, но вот незадача: мясо для вечного пира подошло к концу! Восполнять запасы, как обычно, посылают новеньких... Отстреливай птиц и собирай их тушки, уворачивайся от вонючего помета, кирпичей и наковален! Лишь пройдя через восемь непростых уровней ты будешь достоин занять место за пиршественным столом Вальгаллы!', 638, 710, 'arkady,vremya,eda,zhivotnye,navyki,razvlecheniya,strelyalki', 'arkady,strelyalki', 'http://static.apitech.ru/FDA1799FED73493EB2486E3476D9A154RU', 0.01, 1, 242, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(243, 1023, 'Коммандос', 'kommandos', 'Необходимо отбить нападение врагов на ваши города. Командуй и защищай!', 700, 750, 'bashni,voennye,zaschita,logicheskie,priklyucheniya,strategii,strelyalki,unichtozheniya,shutery,eksheny', 'voennye,logicheskie,strategii,strelyalki,ekshn', 'http://static.apitech.ru/8A6CAE22533046ED802806A621A903EFRU', 0.01, 1, 243, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
