(248, 1016, 'Ноев ковчег', 'noahs_ark', '    В незапамятные, древние, допотопные времена, Бог повелел праведному человеку - Ною - построить ковчег и взять в него по паре животных и птиц всех видов, что жили тогда на земле. А некоторых животных и птиц, которые особенно нравились Богу, Ной должен был взять с собой по семь. Таких созданий Бог назвал «чистыми».\n    Помогите Ною собрать в ковчег животных, которых ему повелел взять с собой Бог.', 688, 710, 'arkady,zhivotnye,naiti,razvlecheniya', 'arkady', 'http://static.apitech.ru/B1714DDDD30F4FBABF1F9D318C93B893RU', 0.01, 1, 248, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
