(251, 1013, 'Яйца Гомера', 'yaitsa_gomera', 'Кидайте Гомера в яйца и спасайте птиц! Всё просто :)', 668, 750, 'logicheskie,pushki,simpsony,gomer', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/7CEEBAA8DD7E4879836C811280A136A9RU', 0.01, 1, 251, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(252, 1012, 'Взорви их!', 'vzorvi_ikh', 'Что может пойти не так, если гулять возле зданий, которые сносятся при помощи взрывчатки? Куча смертей, вот что! Взрывайте здания таким образом, чтобы убить максимальное число людишек. \n', 668, 750, 'arkady,bomby,logicheskie,razvlecheniya', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/89B923B2B601424995B9E566D7AEC08CRU', 0.01, 1, 252, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(253, 1010, 'Зачистка', 'zachistka', 'Увлекательный кровавый шутер, в котором тебе предстоит очистить улицы города от зомби. Захватывай стратегически важные объекты, покупай оружие и прокачивай своего персонажа для того, чтобы выжить! ', 688, 710, 'arkady,zaschita,zombi,navyki,oruzhie,prepyatstviya,razvlecheniya,sobiralki,strelyalki,ulichnye,unichtozheniya,shutery,eksheny,krov', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki,kvesty', 'http://static.apitech.ru/8F0FBA4BE46B46FB8D0C5DF789A9B70ARU', 0.01, 1, 253, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(254, 1006, 'Соедини колобков!', 'soedini_kolobkov!', 'Вам предстоит стреляя из пушки колобками соединить их с себеподобными по цвету, 30 уровней веселой стрельбы разноцветными колобками из пушки, с реалистичной физикой - не заставят вас скучать!', 713, 810, 'arkady,detyam,razvlecheniya,pushki', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/B7F4196D329F47EABD6F6F43A044B98DRU', 0.01, 1, 254, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(255, 1005, 'Пасхальная переправа', 'paskhalnaya_pereprava', 'Помоги милым и пушистым пасхальным кроликам переправиться через реку!', 638, 830, 'arkady,devochkam,zhivotnye,razvlecheniya,kroliki', 'arkady,dlya_devochek', 'http://static.apitech.ru/BB0FDFE9EA984DC5845F46DA1A176CD7RU', 0.01, 1, 255, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(256, 1004, 'Взорви шары!', 'vzorvi_shary!', 'Стреляйте из пушки куклой по шарам,\nвы должны взорвать их все!\n30 уровней безумного веселья!', 713, 810, 'arkady,logicheskie,razvlecheniya,unichtozheniya,shariki', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/04011D7A3D0C428FBD083FDF51987BB4RU', 0.01, 1, 256, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(257, 1003, 'Колобок и лиса 2', 'kolobok_i_lisa_2', 'Странный Колобок мечтает попасть к Лисе! Давайте поможем чудаку...', 713, 810, 'arkady,detyam,zhivotnye,logicheskie,prepyatstviya', 'arkady,logicheskie,multiki,fizicheskie_igry', 'http://static.apitech.ru/7D098A9CB0F84C6CA4FCE0FC2866C3B7RU', 0.01, 1, 257, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(258, 1002, 'Губка Боб: Сумасшедший полёт!', 'gubka_bob__sumasshedshii_polyot!', 'Новые пушки, бонусы и сюрпризы! Улети как можно дальше', 588, 660, 'arkady,gubka_bob,detyam,eda,led,multiki,razvlecheniya,sneg,sobiralki,spanch_bob', 'arkady,multiki', 'http://static.apitech.ru/1BAAC309F0D1444396612216F5043E25RU', 0.01, 1, 258, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(259, 1001, 'Кровавая Мамба - первая кровь', 'krovavaya_mamba_-_pervaya_krov', 'Спасите пленников из африканского племени от кровожадных демонов. Постарайтесь чтоб люди из племени Мамба не погибли.', 764, 865, 'arkady,armiya,razvlecheniya,krov', 'arkady', 'http://static.apitech.ru/C75F069AB56147FD94C66B3119E7E00BRU', 0.01, 1, 259, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(260, 1000, 'Романтическая погоня', 'romanticheskaya_pogonya', 'Помогите прекрасному Пегасу догнать его возлюбленную. Собирайте бонусы, избегайте столкновений и стреляйте в хищные растения.', 764, 865, 'prepyatstviya,priklyucheniya,edinorogi', 'dlya_devochek,priklyucheniya', 'http://static.apitech.ru/B14D4DB0DB674C9EA27C518D93C5DDBDRU', 0.01, 1, 260, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(261, 998, 'Атака драконов в Китае', 'ataka_drakonov_v_kitae', 'Вы должны убрать с игрового поля все головы драконов, иначе они вас задавят. Вы сможете отбить атаку Драконов.', 764, 865, 'arkady,vremya,drakony,unichtozheniya,kitai,ataka', 'arkady,dlya_devochek', 'http://static.apitech.ru/0F962843C07041A9B3D395AB020EB665RU', 0.01, 1, 261, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(262, 997, 'Ледниковый период', 'Ice_age', 'Помоги белке собрать все орехи в новой, захватывающей, приключенческой игре - Ледниковый период!', 588, 660, 'arkady,zhivotnye,led,letalki,razvlecheniya', 'arkady,multiki', 'http://static.apitech.ru/CA19B9750A194B248D9968592112B261RU', 0.01, 1, 262, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(263, 995, 'Сердце Купидона 3', 'serdtse_kupidona_3', 'Помоги Купидону поразить сердце из лука !!! Логическая аркада.', 668, 750, 'arkady,logicheskie,lyubov,razvlecheniya', 'arkady,dlya_devochek,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/3E65548BBEA64A90851B7DBB295F1E9BRU', 0.01, 1, 263, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(264, 993, 'Сказка о феях', 'fairy_arkanoid', 'Злые гномы захватили добрых фей! Ваша задача - разрушить темницы из глыб и освободить фей! И пусть удача сопутствует Вам!', 788, 910, 'arkady,volshebstvo,devochkam,unichtozheniya,fei,fentezi,arkanoid', 'arkady,dlya_devochek', 'http://static.apitech.ru/144EF1AF3E8648F7AEE79C680F69ADE3RU', 0.01, 1, 264, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(265, 987, 'Зов Джунглей', 'monkeys_tower', 'Помогите мартышкам составить банки с фруктами в устойчивые башни!', 788, 910, 'arkady,bashni,zhivotnye,logicheskie,obezyany,razvlecheniya', 'arkady', 'http://static.apitech.ru/689E95BC0E604F98AB5DDE07505B515ERU', 0.01, 1, 265, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(266, 986, 'Виселицы 3', 'viselitsy_3', 'Ваша цель - спасти подвешенных человечков, разрубая веревки с помощью лука и стрел. Но при этом надо быть осторожным: не попасть в самих человечков, иначе они могут умереть.\n\nУправление: мышь. Зажимаете левую клавишу мыши, оттягиваете тетиву и целитесь, затем отпускаете клавишу мыши.', 668, 750, 'arkady,logicheskie,razvlecheniya', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/411E956C33604BE5A417758EA0A45736RU', 0.01, 1, 266, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(267, 968, 'И-моушен', 'i-moushen', 'К вашему вниманию  сложная игрушка «И-моушен»! Смысл прост, а вот выполнение требует поднапрячься. Вам необходимо сдвигать предметы таким образом, чтобы бежевый треугольник оказался на бежевой линии.', 713, 810, 'arkady,detyam,logicheskie', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/D024823DE295409A9ACAF4C72876592ERU', 0.01, 1, 267, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(268, 967, 'Пни Билана', 'pni_bilana', 'Очень весёлая игрушка «Пни Билана»! Необходимо убрать мусор – закинуть голову в мусорное ведро с помощью удара ноги. Нажимая на мышку, вы выбираете траекторию полёта, а удерживая кнопку – силу удара.', 668, 750, 'arkady,draki,smeshnye', 'arkady,draki', 'http://static.apitech.ru/5C38B93327E6440F95FA8E5F67E1D18ARU', 0.01, 1, 268, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(269, 966, 'Пушистики', 'pushistiki', 'Игрушка «Пушистики» специально для девочек! Помогите им попасть в свои гнёзда. Каждому пушистику соответствует гнездо такого же цвета, как и он сам! Успейте спасти их, пока это не сделал за Вас паук!', 668, 750, 'arkady,devochkam,detyam,multiki,prepyatstviya,priklyucheniya,spasatelnye', 'arkady,dlya_devochek,multiki,priklyucheniya,brodilki', 'http://static.apitech.ru/7822AD7A1A7B4F6895827159CC637C57RU', 0.01, 1, 269, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(270, 961, 'Модные Штучки', 'fashion_story', 'Откройте собственное Агентство Моды и помогите каждой героине найти свой стиль!', 788, 910, 'devochkam,moda,strategii,ugadaiki', 'dlya_devochek,strategii', 'http://static.apitech.ru/D0612A03CBD2408396586872806EE270RU', 0.01, 1, 270, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(271, 960, 'Книжные истории', 'book_stories', 'В этой игре Вам будет предложено поле с хаотично разбросанными буквами. И в этих буквах Вам необходимо найти определённый список слов. Вы можете выбирать различные уровни и размеры полей с буквами!)', 788, 910, 'arkady,devochkam,detyam,logicheskie,naiti', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/7BA6A319B121418EA1CDCD5F7F40D51CRU', 0.01, 1, 271, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(272, 959, 'Спаси Цезаря', 'spasi_tsezarya', 'Спасите цезаря! Это логическая игрушка! Вам необходимо придумать такой вариант комбинированных действий, чтобы монетки оказались закрытыми от любой внешней угрозы, в данной игре посыпания камнем!', 713, 810, 'arkady,detyam,logicheskie', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/723C14AB3C5743AD9A3347A2B83BC1EBRU', 0.01, 1, 272, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(273, 958, 'Сбей Тролля', 'sbei_trollya', 'Сбей тролля шаром! Выбери правильную траекторию и избавься от него или них! Постепенно задача будет сложнее, а количество троллей и возможности шариков увеличивается! Так что дерзайте и не бойтесь их!', 713, 810, 'detyam,logicheskie,smeshnye', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/A515F34BA0094895B4955AC89E7A1C05RU', 0.01, 1, 273, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(274, 957, 'Doodle Jump - Сумерки', 'dudl_dzhamp-sumerki', 'Любите Дудл джамп и Сумерки? Встречайте! 2 в 1ом!:)\nНеобычная версия известной всеми игры! ', 588, 660, 'arkady,detyam,prepyatstviya', 'arkady,dlya_devochek', 'http://static.apitech.ru/A8A6313BA85B4E15A27D9994B121B8BCRU', 0.01, 1, 274, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(275, 952, 'Зомбокалипсис', 'zombokalipsis', 'Убивай зомби и получай очки! Огромный выбор оружия! Для передвижения используй кнопки влево и вправо на клавиатуре, для смены оружия стрелку вниз, а также, чтобы атаковать зомби используй пробел!!', 588, 810, 'zombi,monstry,oruzhie,priklyucheniya,strelyalki,uzhastiki,unichtozheniya,shutery,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/444EBC143F104213BF2D5785B5B1C968RU', 0.01, 1, 275, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(276, 942, 'Зомбимет', 'zombimet', 'Стреляй зомбями и собирай апельсины! Это их любимое лакомство:)', 668, 750, 'zombi,smeshnye,shutery', 'fizicheskie_igry', 'http://static.apitech.ru/B179FA0FD59440FDB2657FAD89F36769RU', 0.01, 1, 276, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(277, 941, 'Маша и Медведь: давай полетаем', 'masha_i_medved__davai_poletaem', 'Отправляй несносную Машеньку в полёт за подарками. Для ускорения используйте пробел, а для управления Машей стрелки вправо и влево. Только для ускорения Вам необходимо приобрести бензин и ускоритель!', 588, 660, 'arkady,devochkam,detyam,zhivotnye,letalki,masha,multiki,navyki,priklyucheniya', 'arkady,dlya_devochek,multiki,priklyucheniya,brodilki', 'http://static.apitech.ru/D8A2099F48AE41E0BE614A4CEC8B556BRU', 0.01, 1, 277, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(278, 939, 'Странствующий рыцарь', 'Knight-errant', 'Эта игра – прекрасный симулятор средневековой жизни. Здесь вам предстоит выступить в роли странствующего рыцаря.  Принимайте участие в средневековых турнирах,  добейтесь расположения дамы сердца и т.д', 688, 710, 'armiya,voennye,draki,zamki,zaschita,lyubov,navyki,oruzhie,prepyatstviya,priklyucheniya,rytsari,simulyatory,eksheny', 'voennye,draki,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/CA736A667D934C34AD9454B8B37EDEEFRU', 0.01, 1, 278, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(279, 937, 'Космогонщик', 'kosmogonschik', 'Теперь ты не обычный землянин, а капитан самого настоящего космического корабля! Уворачивайся от летящих астероидов, чтобы не повредить корабль. Собирай бонусы, минералы и дополнительные очки.', 668, 750, 'arkady,vremya,gonki,detyam,kosmicheskie,letalki,prepyatstviya,sobiralki', 'arkady,gonki', 'http://static.apitech.ru/A1E486FB168544BE9B5700E4496ACB9CRU', 0.01, 1, 279, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(280, 936, 'Красная угроза', 'krasnaya_ugroza', 'Логическая игрушка! Постарайся любым способом сделать так, чтобы красный треугольник оказался на платформе! Количество очков будет зависеть от скорости выполнения задания! В игре очень много уровней!', 713, 810, 'arkady,vremya,logicheskie,razvlecheniya', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/5AB0410C89EE4B3685709952C914FA3ARU', 0.01, 1, 280, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(281, 935, 'Охотник на динозавров', 'okhotnik_na_dinozavrov', 'Помоги охотнику выжить, спасаясь от динозавров! Собирай патроны, которые разбросаны по дороге и пытайся отстреливать динозавров! Для их смерти достаточно 3 выстрелов! Будь осторожен и не попадись им!', 668, 830, 'arkady,detyam,drakony,zhivotnye,zaschita,oruzhie,pobeg,prepyatstviya,priklyucheniya,sobiralki,spasatelnye,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/2E1E1F152D604F87AE90AFF48D763651RU', 0.01, 1, 281, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(282, 933, 'Колобок и лиса 1', 'kolobok_i_lisa', 'Колобок очень устал, он хочет покончить с собой отдавшись на обед Лисе!\nПомоги ему оставить этот грешный мир!', 713, 810, 'arkady,detyam,zhivotnye,logicheskie,prepyatstviya', 'arkady,logicheskie', 'http://static.apitech.ru/FA619274CBEC4EB4A5FDA2E52B804BB5RU', 0.01, 1, 282, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(283, 931, 'Герой', 'Hero', 'Стань великим и славным героем королевства в новой ролевой игре - "Герой".', 588, 660, 'draki,drakony,zamki,magiya,navyki,naiti,oruzhie,prepyatstviya,priklyucheniya,fentezi,eksheny', 'draki,priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/7854BAD606A24925A87AB426E14114F1RU', 0.01, 1, 283, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(284, 930, 'Мышонок Вася', 'myshonok_vasya', 'Накорми ненасытного летучего мышонка Васю!\n ', 588, 660, 'arkady,detyam,eda,zhivotnye,letalki,spasatelnye', 'arkady,dlya_devochek', 'http://static.apitech.ru/8CC8985CCA6C45B7A44AD21CAC362249RU', 0.01, 1, 284, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(285, 928, 'Зубастое веселье', 'zubastoe_vesele', 'Веселись, помогая квадратам обрести их дом!', 713, 810, 'arkady,detyam,logicheskie,spasatelnye', 'arkady,logicheskie', 'http://static.apitech.ru/017D565F87864D74B5047A10B04F1542RU', 0.01, 1, 285, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(286, 926, 'Путешествие в Китай', 'puteshestvie_v_kitai', 'Соверши путешествие в Китай! Смысл игры прост: Вам необходимо набрать 300 очков на первом уровне за 5 минут. Вы сможете это сделать, составляя фигурки по три или более в один ряд. Время уменьшается.', 764, 865, 'arkady,detyam,logicheskie,naiti,unichtozheniya', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/5EC7B500538B45C2A47DBE39E052B389RU', 0.01, 1, 286, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(287, 925, 'Печенько - Лесная прогулка', 'pechenko_-_lesnaya_progulka', 'Увлекательная езда печеньки на скейте! Не проходите мимо игры «Печенько - Лесная прогулка»! Собирайте очки по лесной дороге, и старайтесь не спотыкаться о различные препятствия (брёвна, животные)!', 764, 865, 'arkady,detyam,zhivotnye,pobeg,prepyatstviya,priklyucheniya,skeitbordy,sobiralki,strelyalki,shutery,eksheny', 'arkady,dlya_devochek,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/E8D644E7F4314248B75747D970BD60D4RU', 0.01, 1, 287, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(288, 923, 'Футбол Теннис - Золотой Мастер', 'futbol_tennis_-_zolotoi_master', 'Испытайте свои силы в оригинальной игре, которая обьединяет теннис и футбол. Вас ждет хорошая игра, магазин с предметами которые увеличат характеристики вашего персонажа. Три разных игровых поля. Выиграйте все Лиги и Плей-оффы, станьте чемпионом Футбол Тенниса.', 684, 760, 'myach,navyki,sportivnye', 'sportivnye', 'http://static.apitech.ru/A553C8808052439EB8C24F418D1BFBAERU', 0.01, 1, 288, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(289, 922, 'Шарики Химический Эксперимент', 'shariki_khimicheskii_eksperiment', 'Выступите в роли лаборанта сумасшедшего профессора. Помогите ему смешать разный ингредиенты в правильном порядке. Для этого вам всего лишь нужно под правильным углом выстрелить из теннисной пушки.\n', 764, 865, 'arkady,logicheskie,shariki,shutery', 'arkady,logicheskie', 'http://static.apitech.ru/691CC19905B04FE39F731157D84F63ECRU', 0.01, 1, 289, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(290, 921, 'Танковая Атака - Разрушение', 'tankovaya_ataka_-_razrushenie', 'Докажи всем и себе, что человеческие ресурсы всё ещё необходимы! Смысл прост – управляй танком и уничтожай искусственный интеллект! Тем самым Вы должны подорвать мощь роботов и понизить их репутацию!', 764, 865, 'arkady,voennye,zaschita,mashiny,priklyucheniya,roboty,strategii,strelyalki,tanki,unichtozheniya,shutery,eksheny', 'arkady,voennye,priklyucheniya,strategii,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/306EB9EA05FF42728457E8406776838DRU', 0.01, 1, 290, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(291, 919, 'Кейт - управляющая СТО', 'keit_-_upravlyayuschaya_sto', 'Убедись, что женщина способна на многое ради интересной работы! Смысл игрушки очень прост: успей обслужить всех клиентов, пока их терпение не закончится. С каждым уровнем клиентов всё больше и больше!', 764, 865, 'devochkam,detyam,logicheskie,mashiny,navyki,rolevye,simulyatory,strategii', 'dlya_devochek,logicheskie,ekonomicheskie,strategii', 'http://static.apitech.ru/41DBA732F3F240FFA112D086FFB337EERU', 0.01, 1, 291, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(292, 918, 'Веселый Хэллоуин', 'veselyi_khellouin_', 'Эта игра полностью о принадлежностях Хэллоуина, которые Вы должны будете матчить, чтоб зарабатывать очки. В каждом раунде игры Вам дадут цель, которую Вы должны достигнуть и определенное количество времени, чтобы достигнуть цели. С прохождением, время будет уменьшатся в цель увеличиватся. Приготовьтесь и сконцентрируйтесь на поисках удачных комбинаций.', 764, 865, 'arkady,vremya,detyam,logicheskie,prizraki,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/57E3A731564740B7AC1AD30865D84B03RU', 0.01, 1, 292, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(293, 917, 'Хэллоуин - Тыквенная атака', 'khellouin_-_tykvennaya_ataka', 'Спасите мир от разноцветных тыкв! Стреляйте таким образом, чтобы она летела к своему цвету. Таким образом, необходимо убрать ряды с одним цветом. Чем быстрее избавитесь от тыкв, тем больше будет очков', 764, 865, 'arkady,vremya,detyam,logicheskie,prizraki,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/47B119C6178E4362B367827166575C4ARU', 0.01, 1, 293, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(294, 909, 'Египетские Кристаллы', 'egipetskie_kristally', 'Соберите все кристаллы. Желательно 3 и более одинаковых фишек в ряд. В течение 5 минут нужно будет набрать 300 очков в первом раунде! Постепенно время будет уменьшаться, а число фишек увеличиваться.', 764, 865, 'arkady,vremya,detyam,logicheskie,naiti,unichtozheniya', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/DD308D2EB5BD41A88D94E6ACC0C07C44RU', 0.01, 1, 294, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(295, 908, 'Пираты - защита сокровищ', 'piraty_-_zaschita_sokrovisch', 'Защитите себя от нашествия пиратских кораблей! Для успешной атаки собери комбинации из 3 и более одинаковых фишек! Чем быстрее у тебя получится найти данные комбинации – тем больше гарантии на победу!', 764, 865, 'arkady,detyam,dragotsennosti,zaschita,korabli,logicheskie,naiti,priklyucheniya,unichtozheniya', 'arkady,logicheskie,priklyucheniya,brodilki,kvesty', 'http://static.apitech.ru/9825AAE2B4354FDE9CC3278843214B80RU', 0.01, 1, 295, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(296, 907, 'Привидения - ночной замок', 'privideniya_-_nochnoi_zamok', 'Избавь замок от страшных привидений! Стреляй в них из лука огненными стрелами! Чтобы выстрелить сильно, натяни тетиву, передвинув курсор мышки ближе к приведениям! При этом есть ограничение во времени', 764, 865, 'arkady,detyam,logicheskie,monstry,prepyatstviya,prizraki,simulyatory,strelyalki,unichtozheniya,shutery', 'arkady,logicheskie,strelyalki', 'http://static.apitech.ru/E8A6D4C4595F4EB395162C2BC72FEDBERU', 0.01, 1, 296, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(297, 878, 'Капитан Крыс', 'kapitan_krys', 'Помоги маленькому мышонку осуществить свою мечту !!! ', 668, 750, 'arkady,detyam,zhivotnye,letalki,prepyatstviya,sobiralki', 'arkady', 'http://static.apitech.ru/485ACBBE10D146699552D6807159AADERU', 0.01, 1, 297, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(298, 877, 'Зона Войны', 'zoneofwar', 'Защити свою базу от вражеских наступлений! Отстреливайся на протяжении 14 вражеских волн-наступлений! Достаточно нажать на мышку? и ты будешь стрелять без перерыва! Для паузы можно нажать кнопку esc.', 738, 750, 'arkady,bashni,voennye,zaschita,navyki,oruzhie,strelyalki,tanki,unichtozheniya,shutery,eksheny', 'arkady,voennye,strelyalki,ekshn', 'http://static.apitech.ru/82F413CE357A40E0B153B555C3BB8B11RU', 0.01, 1, 298, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(299, 874, 'Воздушный Лабиринт 2', 'vozdushnyi_labirint_2', 'Помогите человеку на  воздушных шарах пройти лабиринт! Для победы вам нужно собрать все монеты, и постараться не задеть пушки, птиц и всякую остальную мелочь, и так все уровни. Вы тоже можете стрелять', 648, 800, 'arkady,detyam,letalki,logicheskie,mario,naiti,prepyatstviya,priklyucheniya,puzyri,sobiralki', 'arkady,logicheskie,priklyucheniya,brodilki,kvesty', 'http://static.apitech.ru/793B328A883246BBA3B25ED70E3B8B14RU', 0.01, 1, 299, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(300, 873, 'Дрифтовые Гонки', 'driftovye_gonki', 'Только для профессиональных дрифтеров!', 713, 810, 'gonki,detyam,mashiny,navyki', 'gonki,tryuki', 'http://static.apitech.ru/5A1CDCAEC0E54E51A8B3AE4426EC75D0RU', 0.01, 1, 300, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(301, 872, 'Защита Территории', 'zaschita_territorii', 'Защитите планеты от вторжения!', 668, 750, 'bashni,voennye,zaschita,kosmicheskie,logicheskie,priklyucheniya,prisheltsy,roboty,strategii,strelyalki,unichtozheniya,shutery,eksheny', 'voennye,logicheskie,priklyucheniya,strategii,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/0E3929F0C89C49F4A1511C6F643F16ABRU', 0.01, 1, 301, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(302, 870, 'Полёт', 'polyot', 'Вспомните детство, как вы запускали бумажные самолётики в небо! Здесь в принципе тот же самый принцип, только за длину дистанции, которую пролетит Ваш самолётик, Вы собираете определённую сумму баллов', 668, 830, 'arkady,volshebstvo,detyam,letalki,multiki,navyki,samolety', 'arkady', 'http://static.apitech.ru/C1EC526CC3F74F1194D690158132BEDFRU', 0.01, 1, 302, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(303, 869, 'Космобой', 'kosmoboi', 'Вам нужно спасти галактику от захватчиков. Для этого истребляйте все, что попадется вам на пути. Различные противники дают различное оружие. В конце каждого уровня сражайтесь с боссами. ', 688, 660, 'arkady,detyam,zaschita,kosmicheskie,letalki,navyki,priklyucheniya,prisheltsy,samolety,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/07A4BFCBD2D04348BADAA3C17837DB05RU', 0.01, 1, 303, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(304, 868, 'Прыжки на грузовике', 'pryzhki_na_gruzovike', 'Здесь вам нужно набрать скорость, указанную в начале уровня, и хорошенько разогнаться. Постарайтесь перепрыгнуть через машины, поставленные в ряд,  в конце не разбиться о гору покрышек.', 588, 665, 'arkady,gruzoviki,detyam,mashiny,prepyatstviya,razvlecheniya,simulyatory,sportivnye,tryuki', 'arkady,sportivnye,tryuki', 'http://static.apitech.ru/3ACCA4E4A7A449C3B173EE7D994C6472RU', 0.01, 1, 304, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(305, 867, 'Алхимический маджонг', 'alchemy_mahjong', 'Добро пожаловать в волшебную страну Алхимического маджонга! Игра подарит нескончаемое удовольствие любителям головоломок!', 788, 910, 'arkady,vremya,logicheskie,naiti,nastolnye,razvlecheniya,unichtozheniya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/F12483F9307441839BA1C6A067ACD335RU', 0.01, 1, 305, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(306, 866, 'Губка Боб - Сноубординг', 'gubka_bob_-_snoubording', 'Губка Боб собирает запасы бургеров', 638, 760, 'arkady,gubka_bob,detyam,eda,led,multiki,razvlecheniya,sneg,sobiralki,spanch_bob', 'arkady,multiki', 'http://static.apitech.ru/FE0CD42C60D94EDBA60CDCC16FFEC69BRU', 0.01, 1, 306, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(307, 865, 'Мышиные гонки', 'myshinye_gonki', 'Кольцевые гонки на мышах.', 588, 660, 'arkady,balans,gonki,detyam,zhivotnye', 'arkady,gonki,fizicheskie_igry', 'http://static.apitech.ru/176C606D315847E1AD3343B53D001162RU', 0.01, 1, 307, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(308, 864, 'Защита пляжа', 'zaschita_plyazha', 'Защитите мирных отдыхающих пляжа от беспредела.', 588, 710, 'arkady,vodnye,zaschita,prepyatstviya,priklyucheniya,sobiralki,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/531B3BF69CE44D7B87C8821E06C53EAFRU', 0.01, 1, 308, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(309, 863, 'КРЕСТОВЫЙ ПОХОД', 'vk_crusade', 'Спаси землю от вторжения кровожадных монстров!!!\nТолько твоя мега-пушка может сделать это!', 668, 750, 'arkady,voennye,detyam,logicheskie,monstry,oruzhie,rytsari,simulyatory,strelyalki,unichtozheniya,shutery', 'arkady,voennye,logicheskie,strelyalki', 'http://static.apitech.ru/8C627C0C2173488CAAF8C8C5D743EBDFRU', 0.01, 1, 309, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(310, 862, 'Рыбалочка', 'rybalochka', 'Просто расслабьтесь за ловлей рыбок.', 668, 750, 'arkady,rybalka', 'arkady', 'http://static.apitech.ru/3A77FAB23FD64833BB3FE74CB20AD77BRU', 0.01, 1, 310, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(311, 860, 'Гиперкуб', 'giperkub', 'Соедините все пары цветных клеток линиями в соответствии с цветами. Вы можете переходить между гранями, но по диагонали чертить никак нельзя.  Черные клетки заблокированы. Желаем успехов в игре!', 713, 710, 'logicheskie', 'logicheskie', 'http://static.apitech.ru/06EAFAAEF8CD45F5BA2101760823F114RU', 0.01, 1, 311, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(312, 859, 'Взрыватель: миссия Огород', 'vzryvatel__missiya_ogorod', 'Здесь вам предстоит борьба с монстрами в собственном огороде! Вооружись бомбами и отбивайся от монстров по мере необходимости. Завладей ключом, чтобы открыть себе путь на следующий уровень!', 638, 635, 'arkady,bomby,detyam,logicheskie,monstry,naiti,prepyatstviya,priklyucheniya,sobiralki,unichtozheniya,eksheny', 'arkady,logicheskie,priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/521461DF54394914A16A58C28CCDFDC4RU', 0.01, 1, 312, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(313, 858, 'Командуй и защищай', 'komandui_i_zaschischai', 'Старый вояка-генерал до последнего защищает свою военную базу от атак вражеских войск. Для начала отстреливайся вручную, а потом меняй оружие на более современное. Убей всех врагов!', 668, 750, 'arkady,armiya,voennye,detyam,zaschita,navyki,oruzhie,rolevye,sobiralki,strategii,strelyalki,tanki,unichtozheniya,shutery,eksheny', 'arkady,voennye,strategii,strelyalki,ekshn', 'http://static.apitech.ru/BE25DC2C764941A8A06448490FEEA0A2RU', 0.01, 1, 313, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(314, 855, 'Робин Гуд и сокровища', 'robin_gud_i_sokrovischa', 'Робин Гуд нашёл несметные сокровища, но их просто так не взять, а надо увезти с собой. Помогите Робину Гуду попасть стрелой в мешок с сокровищами, чтобы тот свалился в телегу. Дальше - дело за лошадью', 764, 865, 'arkady,vremya,dragotsennosti,logicheskie,navyki,prepyatstviya,simulyatory,sobiralki', 'arkady,logicheskie', 'http://static.apitech.ru/EC6518FAA61E4759BA6428EEEEB26EEFRU', 0.01, 1, 314, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(315, 854, 'Корнемания', 'root', 'Пришла весна, а цветочки и почки на деревьях ещё не распустились? Разберись в корневищах. Соединяй корни таким образом, чтобы они составили единую систему растений. Только тогда придёт настоящая весна', 788, 910, 'arkady,vremya,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/D17A22E16E0C484389F1F1985A05EE0CRU', 0.01, 1, 315, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(316, 853, 'Судоку Микс', 'sudoku_miks', 'Разгадывание головоломок для тебя не проблема, а отдых. Решай судоку – подпитывай свои мозги. Вставляй цифры от 1 до 9 в клеточки, избегая их повторений по вертикали и по горизонтали. Пройди уровень!', 764, 865, 'vremya,logicheskie,naiti,nastolnye', 'dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/4FA1E36F3303413090BEF4563526A6A1RU', 0.01, 1, 316, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(317, 851, 'Автопогрузчик 2', 'avtopogruzchik_2', 'Большое количество товаров ожидают своей отправки в магазины, но первый конвейер погрузки не справляется. Запускаем второй. Погружай товары в машину согласно всем опознавательным наклейкам на упаковке', 668, 750, 'arkady,gruzoviki,detyam,logicheskie,mashiny,navyki,naiti,prepyatstviya,simulyatory', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/662E74C2E29E4DB6880D1D82B122408DRU', 0.01, 1, 317, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(318, 850, 'Змейка - охота на жуков', 'zmeika_-_okhota_na_zhukov', 'Противные жуки не дают спокойно уснуть змейке в своей норе. Съешь всех их. Управляй змейкой, поедай жучков, как обычных, так и волшебных, и переходи на следующие уровни. Смотри, не укуси себя за хвост', 764, 865, 'arkady,vremya,detyam,eda,zhivotnye,logicheskie,naiti,prepyatstviya,razvlecheniya,sobiralki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/BCE585576D8A4DD6B347AC1F30B9D076RU', 0.01, 1, 318, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(319, 849, 'Властелин Жемчуга', 'vlastelin_zhemchuga', 'В этой игре вам предлагаются жемчужины как награда за пройденный уровень. Чтобы их заработать, вам нужно менять местами ракушки, камни и кораллы местами до тех пор, пока они не образуют комбинацию.', 764, 865, 'arkady,balans,vodnye,vremya,detyam,dragotsennosti,logicheskie,naiti,unichtozheniya', 'arkady,dlya_devochek,logicheskie,fizicheskie_igry,kvesty', 'http://static.apitech.ru/302ABB935D804011862BD1D6E1D6339CRU', 0.01, 1, 319, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(320, 848, 'Массажный Рай', 'massazhnyi_rai', 'Хочешь расслабиться? Посети массажный рай! Здесь тысячи кресел-массажёров на любой вкус и цвет. Тебе осталось выбрать своё. Находи одинаковые пары массажных кресел, убирай их с экрана и получай очки.', 764, 865, 'arkady,vremya,naiti,unichtozheniya', 'arkady,kvesty', 'http://static.apitech.ru/88641555006746988AD692A1D3F874E8RU', 0.01, 1, 320, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(321, 847, 'Защитник птиц', 'zaschitnik_ptits', 'Здесь тебе предстоит побыть и добытчиком пищи, и папой для птенцов, и защитником своих любимцев. Корми, люби и заботься о тех, кого ты приручил. В этой игре требуется доказать, что ты заботливый отец!', 764, 865, 'arkady,vremya,detyam,eda,zhivotnye,zaschita,simulyatory,smeshnye,sobiralki,spasatelnye,strelyalki,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/34B4A8DD07204E829452DF972FB58AA0RU', 0.01, 1, 321, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(322, 846, 'Веселый клоун против Шариков', 'veselyi_kloun_protiv_sharikov', 'Вы попали в сумасшедший цирк!!! Тут вам предстоит показать, насколько вы метко стреляете из лука. Задача простая, проколоть все шарики. Но не все так просто… вам предстоит найти способ проколоть шарики за наименьшее количество выстрелов и как можно быстрее.', 764, 865, 'arkady,vremya,detyam,navyki,razvlecheniya,simulyatory,strelyalki,unichtozheniya,shariki,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/D6E910292235477DA59EF773DB0AA3CDRU', 0.01, 1, 322, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(323, 845, 'Пузыри - смайлы', 'puzyri_-_smaily', 'Пузыри-смайлы собрались в кучу. Но кто-то веселится, а кто-то грустит. Найди соединения из трёх и более одинаковых пузырей, щёлкни по ним, и получи весёлое настроение. Больше соединение - больше бонус!', 764, 865, 'arkady,detyam,logicheskie,naiti,unichtozheniya', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/F439BD5019B44B878706353D74588287RU', 0.01, 1, 323, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(324, 844, 'Звездный мяч', 'zvezdnyi_myach', 'Игра с увлекательной механикой Collapse, и стильными фишками. Вы должны искать группы из трех и более фишек одного цвета. Ваша цель - спустить с игрового поля фишки со звездой.', 764, 865, 'arkady,detyam,logicheskie,myach,naiti,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/5DDAAB59293E4A5B95CB70E685AC42FBRU', 0.01, 1, 324, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(325, 843, 'Шейкер микс', 'sheiker_miks', 'Делать коктейли с помощью шейкера может каждый. Для начала отсортируйте фрукты по разным шейкерам.', 764, 865, 'arkady,gotovka,logicheskie,navyki,razvlecheniya,simulyatory,sobiralki,frukty', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/7E3E86ABE6094A59AC1387BCD77905C9RU', 0.01, 1, 325, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(326, 842, 'Пекинский Маджонг', 'pekinskii_madzhong', 'Игра на внимательность и сообразительность «Маджонг» в китайском варианте. Отличие «Пекинского маджонга» игры от предыдущих версий в обновлённом списке бонусов за открытие новых костяшек с узорами.', 764, 865, 'logicheskie,naiti,nastolnye,razvlecheniya,unichtozheniya', 'dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/3503C7C668E946E4ACF6216C69A465B2RU', 0.01, 1, 326, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(327, 841, 'Оранжерея - Золотая распродажа', 'oranzhereya_-_zolotaya_rasprodazha', 'Пришла пора любви, и надо же приятно удивить свою девушку. Цветы – отличный подарок! Но самое надёжное место их приобретения – оранжерейная. Обстраивайте оранжерейную и делайте свой цветочный бизнес!', 764, 865, 'devochkam,detyam,krasota,moda,razukrashki,rolevye,simulyatory', 'dlya_devochek', 'http://static.apitech.ru/CF64843E3AC147F3A8EDD9406AAC3176RU', 0.01, 1, 327, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(328, 840, 'Джими Джим', 'dzhimi_dzhim', 'Злюка похитила щенят и отдаёт их ужасным способом. Она их бросает, не глядя куда! Не допусти, чтоб щенок упал на землю, иначе ему будет больно. Передвигай змейку с пружиной, чтобы щенки попали в трубу', 764, 865, 'arkady,balans,detyam,zhivotnye,myach,sobaka,spasatelnye', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/C462DD4D22D44F7CB470A489BE7909CCRU', 0.01, 1, 328, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(329, 839, 'В Поиске Бриллиантов', 'v_poiske_brilliantov', 'В данной игре жанра match3, Вам предстоиту увидеть множество уникальных бриллиантов. Удаляя группы из трех и больше одинаковых бриллиантов, Вы будете продвигатся дальше по игре, в этом Вам помогут заработанные поверапы. Находите драгоценности в разных странах мира.', 764, 865, 'arkady,detyam,dragotsennosti,logicheskie,naiti,unichtozheniya', 'arkady,dlya_devochek,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/8D86BF32AD9945108EEA9DD899389E67RU', 0.01, 1, 329, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(330, 838, 'Веселый зоопарк', 'veselyi_zoopark', 'В этой игре Вы должны накормить бегемота. Подбивайте фрукты, которые бросает слон, чтоб они попали в пасть бегемота.', 764, 865, 'arkady,balans,detyam,zhivotnye,navyki,razvlecheniya,spasatelnye', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/624C4D14CD2B4820A0B950AFF308D2BBRU', 0.01, 1, 330, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(331, 837, 'Кунг-Фу Кролик', 'kung-fu_krolik', 'Эта игра сделана по мотивам популярного мультфильма "Кунг Фу Кролик - 3Д". Вы в роли кролика который владеет тайнами кунг-фу. Победите всех врагов и займите первое место в рейтинге бойцов.', 764, 865, 'detyam,draki,zhivotnye,kino,multiki,smeshnye,fentezi', 'draki,multiki', 'http://static.apitech.ru/D1493B947ED34DE6A16EF630B87F354ARU', 0.01, 1, 331, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(332, 836, 'Забавный Тир', 'zabavnyi_tir', 'Забавный тир продолжает Вас радовать Вашей меткостью! Прицеливайтесь и стреляйте по всевозможным мишеням: начиная от обычных дисков и заканчивая животными. Чем выше важность цели, тем больше очков!', 764, 865, 'arkady,detyam,zhivotnye,navyki,naiti,oruzhie,razvlecheniya,simulyatory,smeshnye,snaiper,strelyalki,shutery', 'arkady,strelyalki,kvesty', 'http://static.apitech.ru/6F7359C70EAA4A06B237C8F41429BD95RU', 0.01, 1, 332, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(333, 835, 'Безумная Белка', 'bezumnaya_belka', 'Когда белка увидела как орехи катятся по веткам дерева, она обезумела, схватила корзину и начала их ловить. Вы должны помочь безумной белке поймать все орехи, шишки и листья. Избегайте камней.', 764, 865, 'arkady,detyam,zhivotnye,multiki,navyki,smeshnye,sobiralki,spasatelnye', 'arkady,multiki', 'http://static.apitech.ru/CC0463C7F976438B958BFD294D826FC5RU', 0.01, 1, 333, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(334, 834, 'Мото Драйв', 'motodrive', 'Одна из популярнейших мобильных игр теперь и в компьютерном варианте! «Мото Драйв» - управляйте мотоциклистом, преодолевайте различные местности. Здесь важно всё: от скорости до наклона мотоцикла.', 668, 750, 'vremya,gonki,detyam,mototsikly,navyki,prepyatstviya,razvlecheniya,simulyatory,sportivnye,eksheny', 'gonki,sportivnye,ekshn', 'http://static.apitech.ru/73C074D58A4E427E9B4529E690CFE16BRU', 0.01, 1, 334, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(335, 833, 'Веселый Покер', 'veselyi_poker', 'Сыграем в покер? Не бойся, всё просто! Выстраивай из предложенных карт комбинации в таком порядке, чтобы они соответствовали основным правилам игры, и сохраняй свой результат, нажатием на кнопку.', 764, 865, 'arkady,karty,logicheskie,naiti,simulyatory', 'arkady,logicheskie,kartochnye,kvesty', 'http://static.apitech.ru/49E84FD5D4834C8182BD5531A94A7FEARU', 0.01, 1, 335, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(336, 830, 'Пузатики', 'puzatiki', 'Игривые пузатики решили поиграться и убежали из своих домов. Как молодой вождь Вы должны собрать их в своих лагерях.', 638, 710, 'vremya,detyam,naiti,priklyucheniya,rolevye,spasatelnye,fentezi,eksheny', 'priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/1DDF39624BD7406687952FBA86C467B9RU', 0.01, 1, 336, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(337, 826, 'Бункер', 'bunker', 'Перед тобой поставлена цель – продержаться в бункере до прихода подмоги. Используй всевозможные орудия, чтобы защититься от врагов. Получай деньги, убивая противников, и обновляй себя и своё оружие.', 788, 710, 'arkady,bashni,bomby,voennye,detyam,zaschita,oruzhie,priklyucheniya,roboty,strelyalki,unichtozheniya,fentezi,shutery,eksheny', 'arkady,voennye,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/4FE738E20449473C99F15EA42747AB4DRU', 0.01, 1, 337, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(338, 824, 'Воришка Боб', 'vorishka_bob', 'Воришка Боб отправляется в крестовый поход против мафии и коррумпированных чиновников! Ему нужно обчистить целый квартал в поисках улик и пары мешков баксов.', 668, 750, 'arkady,detyam,dragotsennosti,logicheskie,mario,naiti,prepyatstviya,priklyucheniya,rolevye,smeshnye,sobiralki,eksheny', 'arkady,logicheskie,poisk_predmetov,priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/25F4DE0D6185471B82B113400A53311BRU', 0.01, 1, 338, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(339, 822, 'Человек Ракета', 'chelovek_raketa', 'Запускайте Человека Ракету.\nСобирайте кристалы  и бонусы для ускорения.\nУклоняйтесь от препятствий.', 788, 610, 'arkady,detyam,kosmicheskie,letalki,prepyatstviya,sobiralki', 'arkady', 'http://static.apitech.ru/28CEC5E8C1DF48AEA1098D0E1FAB5E4ERU', 0.01, 1, 339, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(340, 819, 'Грузовой порт', 'gruzovoi_port', 'Поступил крупный заказ на товары, и они в порту. Помоги переместить грузы с доков на корабль для дальнейшей их отправки. И будь осторожен: грузы имеют разный вес и могут перевесить корабль на один бок', 668, 750, 'arkady,balans,gruzoviki,detyam,korabli,logicheskie,navyki,prepyatstviya,simulyatory,smeshnye', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/9401319E1CCB408D98975273804B0DB0RU', 0.01, 1, 340, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(341, 810, 'Яйцелов', 'Yaitselov', 'В обычном деревенском курятнике проходит обычный утренний сбор яиц. Бабушка с корзинкой бегает, не жалея ног и сил, чтобы поймать куриные яйца, летящие с насестов. Поймай столько яиц, сколько сможешь.', 668, 750, 'arkady,detyam,kuritsa,smeshnye,sobiralki', 'arkady', 'http://static.apitech.ru/8FE89A60AF93432280CB6C7283DBB2ECRU', 0.01, 1, 341, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(342, 808, 'Дудл Джамп — РэББиТ 2', 'rabbit_2', 'DoodleJump окончательно превратился в кролика. Теперь его ни что не остановит. Поставь рекорд в игре - стань лучшим!', 668, 750, 'arkady,detyam,zhivotnye,navyki,naiti,smeshnye', 'arkady,dlya_devochek,kvesty', 'http://static.apitech.ru/B0B008434167457DACAC4886AFEEC6B6RU', 0.01, 1, 342, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(343, 807, 'Дудл Джамп - Рэббит', 'rabbit', 'Doodle Jump - Rabbit, старый Дудл в новом формате! Кролик-Дудл лучший прыгун! Запрыгни как можно выше.', 668, 750, 'arkady,detyam,zhivotnye,navyki,naiti,smeshnye', 'arkady,dlya_devochek,kvesty', 'http://static.apitech.ru/5B4F2B3537C143FAAE5D8C38CC80347FRU', 0.01, 1, 343, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(344, 806, 'Индиан Джамп', 'indian', 'Продолжение легендарного Doodle Jump! Теперь вы управляете новым героем в новой графике. Ставьте рекорды - соревнуйтесь с друзьями.', 668, 750, 'arkady,devochkam,detyam,navyki,naiti', 'arkady,dlya_devochek,kvesty', 'http://static.apitech.ru/3C77F194B09446E9B55EC22235D919EERU', 0.01, 1, 344, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(345, 805, 'Мышиные бега', 'myshinye_bega', 'Преодолевайте сложнейшие препятствия, управляя мышью мышкой, от старта до самого финиша. Проходите через движущиеся двери, злых голодных кошек и иные препятствия, которые встретятся на вашем пути.', 688, 710, 'arkady,gonki,zhivotnye,logicheskie,naiti,prepyatstviya', 'arkady,gonki,logicheskie,kvesty', 'http://static.apitech.ru/E7905FF75D884E2E8F6F1F9AA1FB609ERU', 0.01, 1, 345, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(346, 804, 'Я хочу есть', 'ya_khochu_est', 'Покормите мини-робота светодиодами, которые разбросаны по игровому полю. Управляйте им, направляя на светодиоды. Чем больше диодов съедите, тем больше утолите голод робота и больше наберёте очков.', 688, 610, 'arkady,vremya,detyam,eda,logicheskie,prepyatstviya,razvlecheniya,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/FC2D6ECBD1BD47B3AE3B0A2A9AAB6E31RU', 0.01, 1, 346, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(347, 803, 'Гонки Без_Правил', 'gonki_bez_pravil', 'Сумасшедшие гонки без правил!', 668, 750, 'gonki,mashiny,razvlecheniya,simulyatory,ulichnye,unichtozheniya,eksheny', 'gonki,ekshn', 'http://static.apitech.ru/1E2752246B304A9C97EBAA46D3714046RU', 0.01, 1, 347, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(348, 802, 'Взрывной волейбол', 'vzryvnoi_voleibol', 'В волейболе надо уметь подбивать мяч в воздухе. Давай тебя проверим на это умение. Подбивай мяч в воздухе как можно больше, при этом лопай летающие рядом мыльные пузыри. Установи рекорд среди друзей!', 668, 750, 'arkady,balans,myach,navyki,puzyri,sportivnye,unichtozheniya', 'arkady,sportivnye,fizicheskie_igry', 'http://static.apitech.ru/F601A69DC2D04A61AA4BE336173098E4RU', 0.01, 1, 348, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(349, 801, 'Побег Тарзана', 'pobeg_tarzana', 'Помоги Тарзану сбежать от преследователей. Он уже добрался до реки, но что дальше? Для продолжения пути тебе необходимо прыгать по черепам, которые всплывают. Главное – допрыгнуть, но не перепрыгнуть!', 588, 710, 'arkady,detyam,logicheskie,pobeg,prepyatstviya,priklyucheniya,razvlecheniya,spasatelnye', 'arkady,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/1656C9354B514367977A639671E203D2RU', 0.01, 1, 349, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(350, 800, 'Спасайся кто может!', 'spasaisya_kto_mozhet!', 'Тебе предстоит пройти камнепад!', 668, 750, 'arkady,pobeg,prepyatstviya,spasatelnye,ugadaiki', 'arkady', 'http://static.apitech.ru/4CE3AA59A0E248FBA3407FFB9EFDCAC0RU', 0.01, 1, 350, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(351, 799, 'Найди_отличия', 'naidi_otlichiya', 'Иногда они совсем незаметные... Дерзай!', 668, 750, 'arkady,vremya,detyam,logicheskie,naiti,pamyat,ugadaiki', 'arkady,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/8C4C2C33A8154429A46A84CA24A5F6F6RU', 0.01, 1, 351, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(352, 796, 'Атака Кротов', 'ataka_krotov', 'Ты только запланировал посадить в саду цветы, а кроты уже начинают в нём хозяйничать? Возьми кувалду и вперёд! Как только крот появится на поверхности, сразу бей его по башке, чтобы было ему неповадно', 638, 710, 'arkady,detyam,zhivotnye,naiti,razvlecheniya,smeshnye,ugadaiki,unichtozheniya', 'arkady,kvesty', 'http://static.apitech.ru/AA216A35AD5744F7967D5B3B3984B361RU', 0.01, 1, 352, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(353, 794, 'Смайлы Близнецы', 'smaily_bliznetsy', 'Они такие разные, но все-таки они вместе! Веселые смайлы-близнецы!', 668, 750, 'vremya,detyam,naiti,pamyat,razvlecheniya,smeshnye,ugadaiki,unichtozheniya', 'dlya_devochek,poisk_predmetov,kvesty', 'http://static.apitech.ru/536C4ACBED8D42A590647BBE5E83E398RU', 0.01, 1, 353, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(354, 793, 'Чукотский покер: больше – меньше', 'chukotskii_poker', 'Вы и не подозревали, какой на Чукотке покер :) Попробуйте — вам понравится!', 668, 750, 'karty,nastolnye,ugadaiki', 'kartochnye', 'http://static.apitech.ru/33213095510442D583A41FC03F39D6BBRU', 0.01, 1, 354, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(355, 792, 'Звезда Бейсбола', 'zvezda_beisbola', 'Докажи, что ты лучший в бейсболе и твоё звание – звезда бейсбола. Ударь битой по мячу так, чтобы он улетел как можно дальше. Но смотри, не промахивайся. Количество бейсбольных мячей ограничено десятью', 628, 710, 'arkady,beisbol,myach,navyki,sportivnye', 'arkady,sportivnye', 'http://static.apitech.ru/99241F56BD2A4D14ACAEC1A2DAEFE8F2RU', 0.01, 1, 355, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(356, 791, 'Вторжение Пришельцев', 'vtorzhenie_prisheltsev', 'Пришельцы пытаются захватить нашу планету! Не дай им осуществить этот коварный план, защите родную Землю. Используя космический корабль, атакуй инопланетян. Но берегись их пуль, иначе проиграешь!', 638, 710, 'arkady,kosmicheskie,letalki,oruzhie,priklyucheniya,prisheltsy,spasatelnye,strelyalki,ulichnye,unichtozheniya,fentezi,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/FFFF9E2260E8427B87CFA21E6DF1D213RU', 0.01, 1, 356, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(357, 790, 'Весёлый МЕГА ТИР', 'vesyolyi_mega_tir', 'Приглашаем Вас в весёлый мегатир! Здесь Вы можете закидать свои мишени яйцами, что доставит Вам немало удовольствия. Мишеней много, но за попадание в часть из них очки вычитаются. Будьте внимательны!', 653, 750, 'arkady,detyam,navyki,naiti,oruzhie,prepyatstviya,razvlecheniya,simulyatory,snaiper,strelyalki,unichtozheniya,shutery', 'arkady,strelyalki,kvesty', 'http://static.apitech.ru/B1B323AEED6B43BD9AD1DB0B770449D2RU', 0.01, 1, 357, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(358, 789, 'Кубокрафт', 'kubokraft', 'Сочетаем физику и кликоманию и получаем «Кубокрафт»! Помимо того, что надо найти ряды из трёх и более одноцветных кубиков, так надо и вращать стакан, в котором они находятся. Смотри все варианты!', 638, 710, 'arkady,balans,logicheskie,prepyatstviya,razvlecheniya,simulyatory,sobiralki,unichtozheniya', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/5771BDD099A14C8495ED534CEE0E2A47RU', 0.01, 1, 358, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(359, 788, 'Футбольный клуб: Чеканка', 'futbolnyi_klub_chekanka', 'Именно в этом спортивном лагере проходят тренировку будущие футбольные звёзды. Подбей мяч как можно больше раз, но старайся, чтобы он не упал на траву. Сравни себя с друзьями и выявите звезду футбола.', 668, 750, 'arkady,balans,vremya,myach,navyki,razvlecheniya,simulyatory,futbol', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/074B1D7B0FF3432883F8D3FE5D05308FRU', 0.01, 1, 359, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(360, 787, 'Бешеные Томаты!', 'beshenye_tomaty!', 'Помидоры не хотят быть нарезанными для вкусного салата! Помоги им устроить побег с кухни туда, где их хозяйка не найдёт никогда. Подставляйте досочку под овощи, чтобы они перебрались в другое место.', 638, 710, 'arkady,balans,detyam,eda,razvlecheniya,spasatelnye', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/973704C7435540A0803CF7C50B4D6A3ARU', 0.01, 1, 360, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(361, 786, 'Нано-Евгеника', 'nano-evgenika', 'Оплодотворяйте клетки и убегайте, иначе будете съедены. Кто умеет пользоваться клавиатурой – для того это не проблема. С каждым оплодотворением клеток на экране становится всё больше. Так что дерзай!', 668, 750, 'arkady,prepyatstviya,priklyucheniya,simulyatory,smeshnye', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/12D176316EAF439EB0AB17E8941AE446RU', 0.01, 1, 361, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(362, 782, 'Автопогрузчик', 'avtopogruzchik', 'Помоги небольшому роботу-автопогрузчику с магнитной рукой загрузить ящики в машину. ', 668, 810, 'arkady,gruzoviki,detyam,logicheskie,mashiny,navyki,prepyatstviya,roboty', 'arkady,logicheskie', 'http://static.apitech.ru/AA9AC33651D9414A9E18900BD178E547RU', 0.01, 1, 362, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
