(382, 762, 'Атака Астероидов', 'ataka_asteroidov', 'Атака Астероидов', 588, 710, 'arkady,kosmicheskie', 'arkady', 'http://static.apitech.ru/AFDE9BB8095F45F2A736247F480A1AA1RU', 0.01, 1, 382, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(383, 761, 'Астероиды II', 'asteroidy_ii', 'ААааа... Астероиды снова наступают! Уворачивайся и побеждай друзей!', 668, 750, 'arkady,balans,detyam,kosmicheskie,letalki,prepyatstviya,samolety', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/38157EBED29F4F31B9CEF116FD3458FBRU', 0.01, 1, 383, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(384, 754, 'Инсектонатор: Зомби мод', 'insektonator__zombi_mod', 'Зомби наступают? Бояться здесь нечего, так как здесь появляется инсектонатор режима «зомби». Защищай людей и защищайся сам от нашествия зомби посредством специального оружия. Выживи и не стань зомби.', 588, 710, 'arkady,darts,zombi,naiti,priklyucheniya,razvlecheniya,smeshnye,snaiper,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,kvesty', 'http://static.apitech.ru/EC9010BFD7494CC39155DF68C14B8996RU', 0.01, 1, 384, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(385, 743, 'Дудл Джамп - Классик', 'doodlejump_-_classic', 'Doodle Jump is here! Встречаем замечательную «прыговую» игру Дудл Джамп, где необходимо добраться до 100 этажа, неба и того, что выше неба. Направляй героя на ступеньки. Смотри, не оступись и не упади!', 668, 750, 'arkady,detyam,logicheskie,navyki,prepyatstviya,priklyucheniya', 'arkady,dlya_devochek,brodilki', 'http://static.apitech.ru/16345500F9924F8BA1ED7A08CF3A7654RU', 0.01, 1, 385, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(386, 742, 'Дудл Джамп - Новый Год', 'doodle_jump_-_novyi_god', 'Прыгающие Человечки - аналог Doodle Jump. Хит для iPhone теперь в соц сети ВКонтакте.', 668, 750, 'arkady,detyam,logicheskie,navyki,prepyatstviya,priklyucheniya,rozhdestvo', 'arkady,brodilki', 'http://static.apitech.ru/78F75C4008C6464C9D276E5B10504789RU', 0.01, 1, 386, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(387, 741, 'Дудл Джамп - Джунгли', 'doodle_jump_-_dzhungli', 'Прыгающие Человечки - аналог Doodle Jump. Хит для iPhone теперь в соц сети ВКонтакте.', 668, 750, 'arkady,detyam,zhivotnye,logicheskie,navyki,prepyatstviya,priklyucheniya', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/9596E2393E274E3384292B4341E79B31RU', 0.01, 1, 387, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(388, 740, 'Дудл Джамп - Хэллоуин', 'doodle_jump_-_khellouin', 'Прыгающие Человечки - аналог Doodle Jump. Хит для iPhone теперь в соц сети ВКонтакте.', 668, 750, 'arkady,volshebstvo,detyam,logicheskie,navyki,prepyatstviya,prizraki,priklyucheniya', 'arkady,brodilki', 'http://static.apitech.ru/67E04EC442F54B2AB59E109C34B51867RU', 0.01, 1, 388, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
