(390, 738, 'Дудл Джамп - Футбол', 'doodle_jump_-_futbol', 'Прыгающие Человечки - аналог Doodle Jump. Хит для iPhone теперь в соц сети ВКонтакте.', 668, 750, 'arkady,detyam,logicheskie,navyki,prepyatstviya,priklyucheniya,futbol', 'arkady,brodilki', 'http://static.apitech.ru/32E2264246D14EE9AA64070E8BA457A6RU', 0.01, 1, 390, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(391, 737, 'Дудл Джамп - Космос', 'doodle_jump_-_kosmos', 'Небеса – это не предел для героя из Doodle Jump. Наша новая точка достижения – космос. Управляй героем, который добрался уже до космоса. Перепрыгивай по космическим платформам и добирайся до вершин!', 668, 750, 'arkady,detyam,kosmicheskie,logicheskie,navyki,prepyatstviya,priklyucheniya,smeshnye,fentezi', 'arkady,brodilki', 'http://static.apitech.ru/E9112288BD2E419F81378BB69D1767A9RU', 0.01, 1, 391, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(392, 730, 'Самурай', 'samurai', 'Побудь истинным самураем. Здесь необходимо и защищать себя и граждан от преступников, и быть вежливыми с простыми жителями, как того требует Кодекс самураев. Докажи верность своему Императору и народу', 572, 622, 'arkady,draki,zhivotnye,mario,priklyucheniya,rolevye,samurai,eksheny', 'arkady,draki,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/611B989E5A714A25878CFD824EF6ADFDRU', 0.01, 1, 392, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(393, 729, 'Лопалка', 'lopalka', 'подружитесь с веселой лягушкой', 668, 750, 'arkady,vodnye,vremya,detyam,zhivotnye,logicheskie,naiti,puzyri,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/209B1F4358A747AEBF2228E156EB1B95RU', 0.01, 1, 393, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(394, 727, 'Кликз!', 'clickz!', 'головоломка в жанре коллапс', 788, 910, 'arkady,detyam,logicheskie,naiti,razvlecheniya,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/F217300B4D3646EFA5A02A0EE448987ERU', 0.01, 1, 394, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(395, 710, 'Морские Разбойники', 'morskie_razboiniki', 'Морские разбойники держать тебя взаперти, но готовы отпустить, если победишь в их игре. Кидай монетки так, чтобы 4 монетки составили ряд. Не забудь следить за метками. Их 4 штуки в ряд - и ты проиграл', 788, 910, 'arkady,detyam,dragotsennosti,logicheskie,naiti,razvlecheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/414E501EC6D041E787D4979DAB32A0CDRU', 0.01, 1, 395, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(396, 709, 'Загадки Тысячелетий', 'zagadki_tysyacheletii', 'Загадки тысячелетий – одна из известных головоломок. Выбирайте сферу, по которой будете приводить разгадки, и приступайте к самому процессу. Только самым умным дастся эта игра. Докажи, что ты их числа', 790, 910, 'arkady,volshebstvo,vremya,detyam,logicheskie,naiti,razvlecheniya,ugadaiki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/2817D42B1DE643F5802AF6F1797FC8C3RU', 0.01, 1, 396, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(397, 708, 'Королевский Судоку', 'korolevskii_sudoku', 'Оригинальная интерпретация любимой головоломки!', 788, 910, 'arkady,logicheskie,nastolnye', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/CCC864832ADF445D81DA569DD3BCC8E9RU', 0.01, 1, 397, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(398, 707, 'На Удачу', 'na_udachu', 'Игра «На удачу» - именно та, с помощью которой можно проверить Вас на интуицию. Делаем ставку и тянем спичку. Если спичка меченая, то забираете двойную ставку. Если нет – распрощайтесь с ней. Удачи!', 638, 910, 'arkady,logicheskie,razvlecheniya,ugadaiki', 'arkady,logicheskie', 'http://static.apitech.ru/543DB70098A744388C239A9CEBE95C2DRU', 0.01, 1, 398, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(399, 706, 'Опытный Повар', 'opytnyi_povar', 'Опытный повар всегда знает, как сделать вкусное блюдо. Сегодня Вам предстоит сделать замечательные фруктовые напитки, отправляя в блендер 3 или более одинаковых фрукта. Удиви своих гостей соками!', 668, 750, 'arkady,gotovka,detyam,eda,logicheskie,naiti,unichtozheniya,frukty', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/F9E0E42D5F6148979D1CC98D889DFF4CRU', 0.01, 1, 399, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(400, 705, 'Взрыватель Девайсов', 'vzryvatel_devaisov', 'Предотвратите восстание сверхсильных роботов! Что будет, если их не остановить?', 788, 910, 'arkady,bomby,vremya,detyam,roboty,sobiralki,fentezi,eksheny', 'arkady,ekshn', 'http://static.apitech.ru/080AEDFD959E4303B2265AE94A19B956RU', 0.01, 1, 400, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(401, 704, 'Металлолом', 'metallolom', 'Нужен металлолом, но не знаешь, где его раздобыть? Воспользуйся робофермой. С помощью управляемого магнита доставай роботов и складывай у себя. Время ограничено! А потом – делай с ними, что хочешь.', 788, 910, 'arkady,vremya,detyam,roboty,sobiralki,fentezi,eksheny', 'arkady,ekshn', 'http://static.apitech.ru/6035067F10B54DDF975E70D82AC4692DRU', 0.01, 1, 401, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(402, 703, 'Карточный Домик', 'kartochnyi_domik', 'Займитесь интересным делом: постройте виртуальный карточный домик. Считайте очки сопоставленных ниже карт и старайтесь, чтобы сумма очков сверху была меньше, иначе дом разрушится, и Вы начнёте заново.', 788, 910, 'arkady,balans,detyam,zamki,karty,logicheskie,navyki,nastolnye,razvlecheniya,simulyatory', 'arkady,logicheskie,fizicheskie_igry,kartochnye', 'http://static.apitech.ru/5C0F28B684C84EF89B1A960C73BF29E2RU', 0.01, 1, 402, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(403, 702, 'Элитный Маджонг', 'elitnyi_madzhong', 'Одна из самых известных игр в мире «Маджонг» в колоритном оформлении у нас на сайте! Если желаете напрячь свой мозг, то от этой игры он получит максимальную подзарядку. Включи голову – сыграй в игру.', 788, 910, 'vremya,logicheskie,naiti,nastolnye,razvlecheniya,unichtozheniya', 'dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/2E62C70AC6D845EC9042123969469510RU', 0.01, 1, 403, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(404, 699, 'Приключения пасхального кролика', 'priklyucheniya_paskhalnogo_krolika', 'Скоро праздник Пасхи, и пасхальный кролик уже в пути. Но пока перед ним стоит задача – собрать очень много праздничных яиц. Собирай яйца в корзинку, преодолевай препятствия, приноси радость верующим.', 588, 660, 'arkady,detyam,zhivotnye,mario,prepyatstviya,sobiralki', 'arkady,dlya_devochek,brodilki', 'http://static.apitech.ru/23F30E67CA8F41C48C700D463E495AF5RU', 0.01, 1, 404, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(405, 698, 'Завоеватель', 'zavoevatel_-_otvoyui_svoyu_territoriyu', 'Завоёвывай территорию у своих противников! Просто отсекай вражескую территорию, которая автоматически перейдёт в твоё распоряжение. Но остерегайся соприкосновения с врагом. Это будет стоить тебе жизни', 638, 660, 'arkady,logicheskie,myach,naiti,prepyatstviya,unichtozheniya,shariki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/FE3423AD7736462CA68E9303E4F2B4DCRU', 0.01, 1, 405, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(406, 681, 'Король льдинок', 'Korol_ldinok', 'Эта игра точно не даст вам заскучать! Сама по себе она очень проста: вам нужно вставить фигуру определенной формы в углубление такой же формы на движущихся лентах. Веселые цвета улучшат ваш настрой!', 713, 785, 'arkady,vremya,detyam,led,logicheskie', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/32E23E80FA96468AA64A8317C083097BRU', 0.01, 1, 406, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(407, 680, 'Инсектонатор: Убийца насекомых', 'Ubiitsa_nasekomykh', 'Мир погряз в жутких насекомых. Избавься от них', 588, 710, 'arkady,vremya,zhivotnye,monstry,naiti,unichtozheniya,shutery', 'arkady,kvesty', 'http://static.apitech.ru/070ACD7E87B54516A2D08FB44E748D60RU', 0.01, 1, 407, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(408, 679, 'Кабан пастух', 'Kaban_pastukh', 'Овцы нуждаются в хорошем пастухе.Загони овец в загон', 588, 660, 'arkady,vremya,detyam,zhivotnye,razvlecheniya,smeshnye', 'arkady', 'http://static.apitech.ru/A0A736D972E6419FAF53FF27F7A84B48RU', 0.01, 1, 408, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(409, 678, '3D Шар', '3d_ball', 'Соберите все шарики на площадке за отведённое в данном уровне время! Для передвижения по площадке используйте кнопки-стрелки на клавиатуре! За границы выпасть нереально, так что не бойтесь разгоняться', 668, 750, 'arkady,vremya,myach,naiti,sobiralki', 'arkady,kvesty', 'http://static.apitech.ru/F6B7E28115514C5C9F559A8C5DD0F9F9RU', 0.01, 1, 409, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(410, 677, 'Рыболов', 'Rybolov', 'Если Вы заядлый рыбак или просто любите расслабиться на берегу реки с удочкой, играйте в Рыболов! ', 588, 660, 'arkady,detyam,zhivotnye,navyki,razvlecheniya,rybalka', 'arkady', 'http://static.apitech.ru/028DCE8E2C6047BDAF1F6949564F1CEDRU', 0.01, 1, 410, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(411, 676, 'Пуговки', 'Pugovki', 'Играйте и шейте вместе с разноцветными пуговицами! К тому же, эти пуговицы волшебные, они помогут раскрасить досуг, сделав его ярче!', 788, 910, 'arkady,detyam,letalki,moda,naiti,razvlecheniya', 'arkady,dlya_devochek,kvesty', 'http://static.apitech.ru/B0AFC7557B75485C84DAC19B2DC14729RU', 0.01, 1, 411, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(412, 675, 'Пул девятка', 'Pul_devyatka', 'Пул Девятка - это то, что Вам нужно, если Вы хотите сыграть партию-другую в бильярд!', 638, 760, 'bilyard,razvlecheniya,sportivnye', 'sportivnye', 'http://static.apitech.ru/6A5C0F492EEA4F509327866451CC7C97RU', 0.01, 1, 412, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(413, 674, 'Суперстройка', 'Superstroika', 'Сначала выберите цвет, который Вам больше всего нравится, а затем доставьте ведра с краской маляру, не пролив при этом ни капли!', 788, 910, 'arkady,detyam,prepyatstviya,razukrashki', 'arkady', 'http://static.apitech.ru/8A40E09A93B14803A7E217AFE2078709RU', 0.01, 1, 413, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(414, 673, 'Суперблоки', 'Superbloki', 'Играйте в игру «Суперблоки»! Ваша задача убирать блоки по мере их наступления. Есть несколько вариантов этой игры. То есть блоки могут появляться и сверху и снизу, но не с двух сторон одновременно.', 788, 910, 'arkady,detyam,logicheskie,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/CC089DD5E2534063B4C7815D60FE0974RU', 0.01, 1, 414, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(415, 672, 'Башнестроитель', 'Bashnestroitel', 'Постройте себе башню! Каждый блок пронумерован, поэтому постройте таким образом, чтобы блоки стояли в порядке возрастания (сверху вниз)!  При последовательном построении блоков Вы получаете бонусы!', 788, 910, 'arkady,bashni,detyam,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/AC650DB14F1E4560AE53F80E42B9C50ERU', 0.01, 1, 415, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(416, 669, 'Поймай рыжиков', 'Poimai_ryzhikov', 'Строй свои невообразимые ловушки для рыжиков', 668, 830, 'arkady,vremya,detyam,logicheskie,prepyatstviya,sobiralki,ugadaiki', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/AA6C887DE55E406FA03AFAE0C89A5A81RU', 0.01, 1, 416, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(417, 668, 'Кабан-спринтер', 'Kaban-sprinter', 'Помогите кабану пробежать очень заставленную препятствиями дистанцию аккуратно! Пользуйтесь мышью, чтобы управлять кабаном. Нажимайте на левую кнопку, чтобы он прыгнул. Помните, что он не бессмертный!', 588, 710, 'arkady,gonki,detyam,zhivotnye,prepyatstviya,razvlecheniya,smeshnye', 'arkady,gonki', 'http://static.apitech.ru/00A8340C9E3F42A3B4341129A5A30A99RU', 0.01, 1, 417, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(418, 667, 'Рыбки', 'Rybki', 'Самая лучшая и добрая рыбалка! ', 638, 710, 'arkady,detyam,zhivotnye,navyki,razvlecheniya,rybalka', 'arkady,dlya_devochek', 'http://static.apitech.ru/D11CD228003744A1A14B705BD7772BC7RU', 0.01, 1, 418, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(419, 666, 'Бомбардир', 'Bombardir', 'Когда птичка вас бомбардирует - это на счастье! Теперь ты в роли птички!', 638, 710, 'arkady,bomby,detyam,zhivotnye,letalki,prepyatstviya,razvlecheniya,simulyatory,smeshnye,shutery', 'arkady', 'http://static.apitech.ru/4BA62CDEA7FF4D2E92BDA7DB38A6BD6ERU', 0.01, 1, 419, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(420, 665, 'Летающий Бак', 'Letayuschii_bak', 'Довези мусорный бак до трамплина, не рассыпав его содержимое на землю. А также затем направляй его, чтобы бак пролетел как можно большое расстояние. Чем больше пролетишь – тем больше очков получишь!', 588, 785, 'arkady,detyam,letalki,navyki,razvlecheniya,simulyatory,tryuki', 'arkady,tryuki', 'http://static.apitech.ru/40A3B1C5E18F4A94AA778FF26A1DB584RU', 0.01, 1, 420, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(421, 664, 'Взрыв Фургона', 'Vzryv_furgona', 'Любишь различные взрывы, тогда эта игра для тебя! Выбери угол, мощность и положение фургона таким образом, чтобы, когда он будет отскакивать задел как можно больше проезжающих машин и стоящих фонарей!', 648, 780, 'arkady,bomby,logicheskie,mashiny,razvlecheniya,simulyatory,smeshnye,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/5D5113DF2C6F48249D01E4135B67E5D3RU', 0.01, 1, 421, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(422, 663, 'Запуск Прицепа', 'Zapusk_pritsepa', 'Запусти прицеп высоко в небо и получи большое количество очков! С помощью стрелок на клавиатуре выбери угол выстрела, а с помощью пробела – стреляй! Чем больше пролетишь – тем больше очков получишь!)', 588, 710, 'arkady,letalki,mashiny,razvlecheniya', 'arkady', 'http://static.apitech.ru/325823EB0FEB44988F1116F6F60C7C74RU', 0.01, 1, 422, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(423, 661, 'Online: Камень-Ножницы-Бумага', 'Online__kamen-nozhnitsy-bumaga', 'Найди себе соперника, чтобы играть в «Камень-ножницы-бумага». Вспомни, как в детстве игрался в школе и получал огромное удовольствие, когда выигрывал, здесь примерно то же самое, только в комп-режиме!', 588, 710, 'arkady,logicheskie,multipleer,navyki,nastolnye,razvlecheniya,reaktsiya', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/D7AECE37944A4FB3887B690E3FA53FAFRU', 0.01, 1, 423, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(424, 659, 'Online: Шахматы', 'Online__shakhmaty', 'Собери своих друзей, и играйте в шахматы! Это увлекательная игра затянет Вас надолго. Тем самым Вы будете довольны проведённым временем с друзьями и интересной игрой! Приятного время препровождения!', 588, 710, 'arkady,logicheskie,multipleer,nastolnye,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/FD370EDC79534C6BB39A4560A50A6A6CRU', 0.01, 1, 424, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(425, 658, 'Online: Безумные Нарды', 'Online__bezumnye_nardy', 'Играй в безумные нарды онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,nastolnye,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/7DDC91E67DB345B6B7805138EAE64940RU', 0.01, 1, 425, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(426, 657, 'Online: Двенадцать Линий', 'Online__dvenadtsat_linii', 'Играй в двенадцать линий онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,navyki,vnimanie', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/CA02730924484139ACC4C5AEA7DE8924RU', 0.01, 1, 426, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(427, 656, 'Online: Точки', 'Online__tochki', 'Играй в точки онлайн. Реальные соперники!', 588, 710, 'arkady,logicheskie,multipleer,navyki,reaktsiya,vnimanie', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/4EADDC90D33A402AB02024038A9E32F4RU', 0.01, 1, 427, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(428, 655, 'Online: Го', 'Online__go', 'Играй в го  онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/683F8E8A43CC459B89CAB1142A680A72RU', 0.01, 1, 428, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(429, 654, 'Online: Канаста', 'Online__kanasta', 'Играй в канаста онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,navyki,nastolnye,razvlecheniya', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/9D53280183614A0B8CBCCCCD35A1A152RU', 0.01, 1, 429, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
