(433, 650, 'Online: Джин Рамми', 'Online__dzhin_rammi', 'Играй в увлекательную игру онлайн. Реальные соперники!', 588, 710, 'arkady,logicheskie,multipleer,navyki,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/E42E63FD4EAE46EA87E30941C3BE1BE2RU', 0.01, 1, 433, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
