(435, 648, 'Online: Пять В Ряд', 'Online__pyat_v_ryad', 'Играй в увлекательную игру онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/C9DD788CFA08415BA5725EF6C3740733RU', 0.01, 1, 435, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(436, 647, 'Online: Манкала', 'Online__mankala', 'Играй в манкалу онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/5D7E23E35F6046468E3161FBEF10D116RU', 0.01, 1, 436, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(437, 646, 'Online: Морской Бой', 'Online__morskoi_boi', 'Играй в морской бой онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,razvlecheniya', 'logicheskie,strategii', 'http://static.apitech.ru/88F0D401B1DB4FB78761E3B4A3D7F54ARU', 0.01, 1, 437, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(438, 645, 'Online: Четыре Вместе', 'Online__chetyre_vmeste', 'Играй в карты онлайн. Реальные соперники', 588, 710, 'arkady,logicheskie,multipleer,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/5B0BDABDEB474F4DAFC38CA6E0AAA32ERU', 0.01, 1, 438, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(439, 642, 'Online: Шашки', 'Online__shashki', 'Съешь все шашки противника. Шашка может перемещаться вперед по диагонали на один шаг. Если есть возможность съесть шашку, то сделай это. Дойдя до края доски, шашка становится дамкой.', 588, 710, 'arkady,logicheskie,multipleer,navyki,nastolnye,razvlecheniya,vnimanie', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/43E7B6AABD8F48D89FB41356F74420C2RU', 0.01, 1, 439, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(440, 641, 'Online: Соревнование Сапёров', 'Online__sorevnovanie_sapyorov', 'Если вы любите адреналин и умеете быстро принимать решения, то эта игра для вас! Открывай поле, только не наступи на мину, а то потеряешь бесценное время и скорее всего проиграешь!', 588, 710, 'arkady,vremya,logicheskie,multipleer,navyki,naiti,razvlecheniya', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/419634085EF9408E86C9C2437912825ARU', 0.01, 1, 440, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(441, 640, 'Online: Китайские Шашки', 'Online__kitaiskie_shashki', 'Почувствуй себя настоящим китайским мудрецом! Все твои соперники абсолютно реальны и тоже мечтают о победе. Цель игры: вывести с поля все шарики, причем так чтобы ни одного не осталось. Стань лучшим!', 588, 710, 'arkady,logicheskie,multipleer,navyki,nastolnye,razvlecheniya,shariki', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/B4AFC2673D094088B644F8B3F79E045BRU', 0.01, 1, 441, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(442, 639, 'Online: Крестики-Нолики', 'Online__krestiki-noliki', 'Эта игра нам все знакома с детства. Смысл тот же: нужно обыграть соперника, поставив свои значки в линию из трех штук.  Если тебе повезет, то он даже не поймет, как именно ты победил J', 588, 710, 'arkady,multipleer,nastolnye,razvlecheniya', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/BB92587701C14F94994F81C0D8923592RU', 0.01, 1, 442, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(443, 634, 'Online: Нарды', 'Online__nardy', 'Правила игры очень просты: кидая кубики, вы должны ваши шашки провести по всему полю против часовой стрелки и свести их количество к минимуму прежде, чем это сделает ваш соперник. Кинь кубик и победи!', 588, 710, 'arkady,logicheskie,multipleer,navyki,razvlecheniya', 'logicheskie,strategii', 'http://static.apitech.ru/C98A7C09C5AE4226B338D41B63DB545CRU', 0.01, 1, 443, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(444, 628, 'Плиточки', 'Plitochki', 'Заполни экран одинаковыми плиточками!', 668, 750, 'arkady,logicheskie,razvlecheniya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/DECE38E6201E468892F5CF180C3FE4DBRU', 0.01, 1, 444, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(445, 627, 'Последний крылатый единорог', 'Poslednii_krilatii_edinorog', ' Маленький единорог заблудился и попал в незнакомые места. Выведи его оттуда, прыгая по островкам и собирая ацтекские тотемы, только не дай единорогу упасть в пропасть, ведь он же все-таки последний!', 764, 865, 'arkady,detyam,zhivotnye,prepyatstviya,priklyucheniya,fentezi', 'arkady,dlya_devochek,priklyucheniya,brodilki', 'http://static.apitech.ru/F25AFA7E6F5E49B0B8EE50771C044DAARU', 0.01, 1, 445, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(446, 626, 'Фабрика игрушек в Джунглях', 'Fabrika_igrushek_v_djunglyah', 'Если ты давно хотел иметь свою фабрику игрушек, то теперь твоя мечта сбылась! Собери игрушки забавных животных, пока они еще на конвейере. А после перемести в ящик. Главное ничего не перепутай!', 764, 865, 'arkady,gotovka,detyam,zhivotnye,logicheskie,naiti,simulyatory,sobiralki', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/491C9561D45847379B6AE866163126C9RU', 0.01, 1, 446, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(447, 625, 'Веселый машинки', 'Veselie_mashinki', 'Интересная и полезная игрушка для тех, кто желает или учится водить машину. Нужно припарковать свою машинку, не задев при этом другие. Ну правда же это не так просто, как кажется на первый взгляд? J', 764, 865, 'arkady,detyam,logicheskie,mashiny,navyki,parkovka', 'arkady,logicheskie', 'http://static.apitech.ru/CAE76A1962E941E08CD9C06C936CEAEERU', 0.01, 1, 447, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(448, 624, 'Спасение африканского племени', 'Spasenie_afrikanskogo_plemeni', 'Веселая игрушка на меткость. Внизу бегает маленький человечек, которого нужно очень метко кинуть вверх, чтобы он спас друга из своего племени. Задачу усложняют движущиеся блоки, сбивающие траекторию. ', 764, 865, 'arkady,detyam,logicheskie,prepyatstviya,smeshnye,spasatelnye', 'arkady,logicheskie', 'http://static.apitech.ru/B8D627365E8A4D389D4B4C6B367C70B5RU', 0.01, 1, 448, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(449, 623, 'Подводные сокровища', 'Podvodnie_sokrovisha', 'Если вы любите игру в «шарики», то тогда эта игрушка вам точно понравится! Играй за подводную ракушку, делай группы из шариков одного цвета и разбивай их метким выстрелом. Помни, на кону сокровища!', 764, 865, 'arkady,vodnye,detyam,dragotsennosti,logicheskie,razvlecheniya,unichtozheniya,shariki,shutery', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/C7CA5C605BE44B4287338BCE97001F2DRU', 0.01, 1, 449, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(450, 622, 'Шустрый художник 2', 'Shustrii_hudognik_2', 'Стань великим художником.Твори чудо', 668, 750, 'detyam,letalki,logicheskie,myach,prepyatstviya,simulyatory,spasatelnye,fentezi,shariki', 'dlya_devochek,logicheskie', 'http://static.apitech.ru/9201973FCF824E70B9F99BE81879FB78RU', 0.01, 1, 450, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(451, 621, 'Лопай пупырышки!', 'Lopai_pupirishki', 'Эта игра – удобный шанс для вас сбросить напряжение и заняться любимым делом, ведь лопать пупырышки любят все! А тут ты за это можешь получить призовые очки! Выясни у друзей, кто в этом деле лучший!', 800, 720, 'vremya,puzyri,razvlecheniya,simulyatory,unichtozheniya', 'arkady', 'http://static.apitech.ru/5534A2D64FDE47FAA5A982BA6175084CRU', 0.01, 1, 451, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(452, 617, 'Online Гонки Самолётов', 'Online_gonki_samolyotov', 'Мало кто в детстве не мечтай быть пилотом и иметь свой собственный самолет. Мечты сбываются! Бери в игру друзей и выясни, кто из вас первоклассный летчик! Новые модели самолетов вам в этом помогут.', 588, 710, 'arkady,gonki,letalki,multipleer,razvlecheniya,samolety', 'arkady,gonki', 'http://static.apitech.ru/6B6D0700DC7E4E19A8D5B34D66B2EEF3RU', 0.01, 1, 452, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(453, 616, 'Online Бильярд', 'Online_bilyard', 'Веселая и увлекательная игра.', 588, 710, 'bilyard,multipleer,simulyatory,sportivnye', 'sportivnye', 'http://static.apitech.ru/8C9B5ACFE8154337A2BCDE95D45780DERU', 0.01, 1, 453, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(454, 614, 'Баскетбол', 'Basketbol', 'Замечательный симулятор любимой игры! Забрось мяч в корзину, кликая по нему мышкой.  Набери как можно больше очков, не давая вылететь мячу с поля.  Забрасывай мячи и знай: Майкл Джордан гордится тобой', 788, 710, 'arkady,basketbol,detyam,logicheskie,myach,navyki,razvlecheniya,simulyatory,sportivnye', 'arkady,logicheskie,sportivnye', 'http://static.apitech.ru/BB2BE1A6E2394A11A18215B937F1E27BRU', 0.01, 1, 454, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(455, 613, 'Паника на Хеллоуин', 'Panika_na_khellouin', 'ААА!!! ААА!!! Привидения! Тыквы! Это Хэллоуин, дружок :)', 688, 810, 'arkady,volshebstvo,detyam,letalki,logicheskie,monstry,prepyatstviya,prizraki,sobiralki,uzhastiki,fentezi', 'arkady,logicheskie', 'http://static.apitech.ru/4DB5DCA5E5834CDDB86A54EBD95D7B43RU', 0.01, 1, 455, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(456, 612, 'Смышленый лягушонок — логическая игра', 'Smyshlenyi_lyagushonok_-_logicheskaya_igra', 'Как хорошо, что есть такие добрые и отзывчивые люди как вы! Проведите лягушонка через болото, прыгая по листикам кувшинки. Как только лягушонок перепрыгнул на следующий лист, то пути обратно нет.', 588, 710, 'arkady,detyam,zhivotnye,logicheskie,naiti,prepyatstviya', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/FB76AF8AEA8C49189B75D109F9D06397RU', 0.01, 1, 456, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(457, 611, 'Дикий-дикий запад', 'Dikii-dikii_zapad', 'Проверь себя на точность вместе с Метким Джо! Сбей бутылку выстрелом из револьвера и получи заслуженную награду! Количество  пуль неограниченно.  У тебя есть все шансы стать настоящим ковбоем!', 544, 810, 'arkady,razvlecheniya,simulyatory,strelyalki,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/82B35F69CB21476695BE601BC31F7490RU', 0.01, 1, 457, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(458, 610, 'Убей зомби — спаси кладбище', 'Ubei_zombi_-_spasi_kladbische', 'ЗОМБИ нападают! Защищайся!', 788, 710, 'arkady,vremya,zombi,monstry,razvlecheniya,smeshnye,unichtozheniya', 'arkady', 'http://static.apitech.ru/6A5892F05EDA44DE91AC6D1C6ABC34DARU', 0.01, 1, 458, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(459, 609, 'Поймай крота — спаси ферму', 'Poimai_krota_-_spasi_fermu', 'Не дай КРОТАМ съесть твой УРОЖАЙ!', 788, 710, 'arkady,vremya,detyam,zhivotnye,razvlecheniya,smeshnye,unichtozheniya', 'arkady', 'http://static.apitech.ru/75E12F98A9F040A98901A054B9A0400BRU', 0.01, 1, 459, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(460, 608, 'Дриблинг — от штанги к штанге', 'Dribling_-_ot_shtangi_k_shtange', 'Твоя задача – набрать максимальное количество очков, набивая мячик. Дополнительные сложности: у тебя всего одна жизнь и мячик не должен вылетать за пределы поля. Справишься?', 588, 710, 'arkady,balans,detyam,myach,navyki,razvlecheniya,simulyatory,sportivnye,futbol', 'arkady,sportivnye,fizicheskie_igry', 'http://static.apitech.ru/1CDDB94A4FFB4EFDAE1D196E317B0B64RU', 0.01, 1, 460, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(461, 607, 'Расхититель гробниц', 'Raskhititel_grobnits', 'Смелый искатель приключений Индиана Джонс вновь нашел их на свою голову.  На этот раз Джонс попал в египетскую гробницу в поисках сокровищ. Собери все монетки и убереги его от ужасных мумий!', 668, 750, 'arkady,detyam,dragotsennosti,kino,naiti,prepyatstviya,priklyucheniya,sobiralki', 'arkady,priklyucheniya,brodilki,kvesty', 'http://static.apitech.ru/5B5AF942395C420FA5E65D21683722A1RU', 0.01, 1, 461, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(462, 606, 'Переполох на ферме', 'Perepolokh_na_ferme', 'Вакансия ВОЛК. Задача — Воровать Яйца', 668, 750, 'arkady,detyam,zhivotnye,kuritsa,multiki,smeshnye,sobiralki', 'arkady,dlya_devochek,multiki', 'http://static.apitech.ru/4FF8B8756A5649C6BB9FA12BE6FEF5A7RU', 0.01, 1, 462, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(463, 605, 'Истребитель жуков', 'Istrebitel_zhukov', 'Эта игра подойдет всем любителям стратегий и стрелялок.  Убивай жуков-мутантов, собирай выпавшие предметы и деньги и покупай апгрейды.  Спаси Землю от нашествия монстров!', 668, 750, 'arkady,drobovik,zhivotnye,zaschita,monstry,oruzhie,priklyucheniya,sobiralki,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/974357E87BAD496DA9DE09BF2FB335C5RU', 0.01, 1, 463, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(464, 604, 'Дрифт 2', 'Drift_2', 'Мастер класс дрифта', 638, 660, 'gonki,detyam,mashiny,navyki', 'gonki', 'http://static.apitech.ru/EBCA1E8571694641AA6D1DFC90A861CARU', 0.01, 1, 464, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(465, 603, 'Акулий мяч', 'Akulii_myach', ' Увлекательная игра в стиле рикошет. Разрушьте все блоки отбивая мячи акулой. Узнайте силу акульего мяча...', 764, 865, 'arkady,vodnye,detyam,zhivotnye,myach,sobiralki,unichtozheniya', 'arkady', 'http://static.apitech.ru/7AED355B7D10483DB73192A4EC70DD51RU', 0.01, 1, 465, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(466, 602, 'Завоевание Защита башен', 'Zavoevanie_zaschita_bashen', 'Не допустите завоевание вашего королевства. Стройте башни и защищайте ваши земли от врагов.', 764, 865, 'bashni,voennye,zamki,zaschita,logicheskie,oruzhie,prepyatstviya,strategii,unichtozheniya,eksheny', 'voennye,logicheskie,strategii,ekshn', 'http://static.apitech.ru/7EC32D209C6C4AFBA6C65DDD7F6DA62ERU', 0.01, 1, 466, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(467, 601, 'Неандерталец и еда', 'Neandertalets_i_eda', 'Помогите неандертальцу собрать всю еду. Не дайте ему умереть с голода..', 764, 865, 'arkady,detyam,eda,razvlecheniya,smeshnye,sobiralki', 'arkady', 'http://static.apitech.ru/B54FD6F18CBF4BE0937E36F597F531C0RU', 0.01, 1, 467, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(468, 600, 'Защита форта', 'Zaschita_forta', 'Вражеские пиратские корабли пытаются разрушить ваш форт! Найдите такую удачную комбинацию бомб, чтобы в одночасье разрушить все атакующие вас корабли. Лучше вы их убьете, чем они вас.', 764, 865, 'arkady,voennye,detyam,zaschita,korabli,logicheskie,naiti,priklyucheniya,unichtozheniya', 'arkady,voennye,logicheskie,priklyucheniya,brodilki,kvesty', 'http://static.apitech.ru/F7C6A52DE6874CCB8AD8D27B60AAB6DFRU', 0.01, 1, 468, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(469, 599, 'Толстый повар', 'Tolstyi_povar', 'Помогите похудеть повару, который набрал лишний вес. Для этого вам нужно убирать с игрового поля продукты и ловить только полезные...', 764, 865, 'arkady,gotovka,detyam,eda,razvlecheniya,sobiralki,unichtozheniya', 'arkady', 'http://static.apitech.ru/8C05993A7A934EFC900D140AFE668F1DRU', 0.01, 1, 469, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(470, 598, 'Замороженные блоки', 'Zamorozhennye_bloki', 'Увлекательная игра в стиле тетриса с кусками разноцветного льда. Пройти эту игру вам помогут множество бонусов.', 764, 865, 'arkady,detyam,logicheskie,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/03F00AE0F56F47EE98D261509790E534RU', 0.01, 1, 470, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(471, 597, 'Чемпионат мира по баскетболу', 'Chempionat_mira_po_basketbolu', 'Станьте чемпионов мира по баскетболу. Выиграйте все турниры и прокачайте по максимуму вашего персонажа.', 668, 750, 'basketbol,detyam,myach,razvlecheniya,sportivnye', 'sportivnye', 'http://static.apitech.ru/CFE8750CF3F347E693FEBEF0A1EA2A8ARU', 0.01, 1, 471, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(472, 596, 'Плёнка с Пупырышками', 'Plyonka_s_pupyryshkami', 'Супер увлекательное  и расслабляющее занятие после тяжелого трудового дня! Лопни столько пупырышек, на сколько хватит времени! Только не нажимай на уже лопнувшие пупырышки, за это списываются очки.', 788, 710, 'vremya,puzyri,razvlecheniya,simulyatory,unichtozheniya', 'arkady', 'http://static.apitech.ru/7FBD8585D0F24165A68883FF6A0E3076RU', 0.01, 1, 472, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(473, 595, 'Ангел', 'Angel', 'Помоги Ангелу освободить все души, уворачиваясь от коварных препятствий.', 689, 580, 'arkady,letalki,prepyatstviya,sobiralki', 'arkady', 'http://static.apitech.ru/78FEE3D5303B4D2F9274F9D9503C7511RU', 0.01, 1, 473, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(474, 594, 'Приключения Деда Мороза', 'Priklyucheniya_deda_moroza', 'Помоги Деду Морозу собрать подарки для малышей. Нарисуй ему кратчайший маршрут, по которому он будет собирать рассыпанные подарки, и не позволяй ему встречаться со злыми снеговиками.', 668, 750, 'arkady,vremya,detyam,logicheskie,prepyatstviya,priklyucheniya', 'arkady,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/63040B6FB8374AA7A76E10AD2D5A0714RU', 0.01, 1, 474, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(475, 593, 'Губка Боб Пузыри', 'Gubka_bob_puzyri', 'Увлекательная игра про Губку Боба', 588, 710, 'arkady,vodnye,vremya,gubka_bob,detyam,multiki,puzyri,razvlecheniya,spanch_bob,unichtozheniya', 'arkady,multiki', 'http://static.apitech.ru/1D2E2AE99DFA4E0EB3928BF08023A8B2RU', 0.01, 1, 475, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(476, 592, 'Гарфилд Футбол', 'Garfild_futbol', 'Кто бы мог подумать, что тот ленивый кот, которого мы все знаем по фильму, умеет играть в футбол! Тебе нужно обвести футбольный мяч по всему миру, нужно просто правильно выбрать угол и силу удара.', 588, 660, 'arkady,detyam,zhivotnye,kino,koshki,logicheskie,myach,navyki,prepyatstviya,razvlecheniya,sportivnye,futbol', 'arkady,logicheskie,sportivnye', 'http://static.apitech.ru/5DA5A72014304647BA509501451D39CCRU', 0.01, 1, 476, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(477, 591, 'Пни ботаника', 'Pni_botanika', 'Тебя раздражают ботаны и заучки? Чешутся руки, чтобы в школе спустить их с лестницы? Мы нашли выход! В нашей игре тебе удастся это сделать. Просто столкни ботаника с лестницы и наслаждайся его полетом', 668, 750, 'arkady,razvlecheniya,smeshnye', 'arkady', 'http://static.apitech.ru/B6764B784A1741E88A5095A92A4F6907RU', 0.01, 1, 477, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(478, 588, 'Ракетный удар', 'Helirocket', 'Уничтожь базу своих противников метким попаданием ракеты. Ну и конечно же защищай свою базу, иначе ты на веки вечные будешь заклеймен позором. Согласись, не хотелось бы? Тогда прицелься и… пли!', 668, 750, 'arkady,bomby,detyam,logicheskie,mashiny,oruzhie,razvlecheniya,simulyatory,smeshnye,unichtozheniya,shutery,eksheny', 'arkady,logicheskie,ekshn', 'http://static.apitech.ru/55A57FAD65C6494D9D65F2D23E3856CARU', 0.01, 1, 478, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(479, 587, 'Игра В Снежки', 'Igra_v_snezhki', 'Зима уже прошла, но хочется повеселиться и покидаться снежками? Тебе сюда. Расстреливай прохожих и снежных людей снежками, остерегаясь попадания их снежков в тебя. Покажи, какой ты снежный снайпер!', 638, 710, 'arkady,detyam,malchik,navyki,prepyatstviya,razvlecheniya,simulyatory,smeshnye,sneg,strelyalki,ulichnye,unichtozheniya,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/01EA1783E23648AA82BC1A5F98922FE4RU', 0.01, 1, 479, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(480, 586, 'Маски Майя', 'Maski_maiya', 'Маски Майя разделились по цветам, чтобы закрыть тебе доступ к загадочной пещере с сокровищами. Кликай по соединению масок одного цвета для того, чтобы они исчезли с экрана. Уровень за уровнем к победе', 588, 660, 'arkady,logicheskie,naiti,unichtozheniya,fentezi', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/548436C42FE94D9780464E901605BC86RU', 0.01, 1, 480, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(481, 585, 'Сортируем Фрукты', 'Sortiruem_frukty', 'Всё смешалось в одной корзине? Незадача. Давайте попробуем рассортировать фрукты: вишни кладём в одну корзину, яблоки – в другую и т.д. Составляйте ряды из одинаковых фруктов, тем самым сортируя их.', 708, 750, 'arkady,vremya,detyam,eda,logicheskie,naiti,razvlecheniya,unichtozheniya,frukty', 'arkady,dlya_devochek,logicheskie,kvesty', 'http://static.apitech.ru/C1030DE4E0B34B47BD90184155CE10A7RU', 0.01, 1, 481, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(482, 584, 'Динояйца', 'Dinoyaitsa', 'Кто сказал, что все динозавры вымерли? У нас сохранилось несколько сотен их яиц, но нам требуется Ваша помощь. Составляйте ряды из 3 и более одноцветных шаров: позвольте дракончикам появиться на свет.', 708, 750, 'arkady,vremya,detyam,drakony,zhivotnye,logicheskie,naiti,razvlecheniya,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/205B0C5B5D5942C795C8F273CEFCCE94RU', 0.01, 1, 482, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(483, 583, 'Бампер Джек', 'Bumper_jack', 'Игра «Очко» в новой интерпретации и в новом оформлении! Смотрите на экран, считайте очки по картам и старайтесь набрать 21. Чем быстрее и правильнее Вы это сделаете, тем больше получится Ваш выигрыш!', 668, 750, 'arkady,vremya,karty,logicheskie,simulyatory', 'arkady,logicheskie,kartochnye', 'http://static.apitech.ru/17C932EEE61444F894F09296A7B52F52RU', 0.01, 1, 483, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(484, 582, 'Вишнёвые Бомбы', 'Vishnyovye_bomby', 'Почти самые безопасные бомбочки из вишни', 763, 760, 'arkady,bomby,detyam,eda,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/0695E2D15FB942F1824C2DC0BCE6B393RU', 0.01, 1, 484, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(485, 581, 'Лови Подарки', 'Lovi_podarki', 'Лови подарки от Деда Мороза в трубу', 588, 660, 'arkady,detyam,razvlecheniya,rozhdestvo,smeshnye,sobiralki', 'arkady,dlya_devochek', 'http://static.apitech.ru/16D88DAB2CBB40308CEB6765FDBE1036RU', 0.01, 1, 485, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(486, 580, 'Пузырь С Букашками', 'Puzyr_s_bukashkami', 'Лови букашек в мыльные пузыри, надувая их', 668, 750, 'arkady,detyam,zhivotnye,puzyri,razvlecheniya,simulyatory,sobiralki', 'arkady', 'http://static.apitech.ru/395BE98A8B9C4D7498C831810558C536RU', 0.01, 1, 486, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(487, 579, 'Сложение', 'Slozhenie', 'А у тебя с математикой всё в порядке? Давай проверим! Смотри на поставленное арифметическое уравнение и выбирай слагаемые из приведённой таблицы. Чем быстрее сосчитаешь, тем для тебя будет лучше.', 638, 710, 'vremya,logicheskie,unichtozheniya', 'logicheskie,ekonomicheskie', 'http://static.apitech.ru/D461051E098D43F390BD67646B6DFBFDRU', 0.01, 1, 487, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(488, 578, 'Яблоки Раздора', 'Yabloki_razdora', 'Не хотите ли скушать полезное яблочко? Вот и я хочу. Но там есть червивые, поэтому что-то... Ну, вы поняли) Надкусывай яблоки, смотри на подсказки и определяй испорченные яблоки. Им место - в мусорке!', 638, 710, 'arkady,detyam,eda,zhivotnye,logicheskie,naiti,razvlecheniya,ugadaiki', 'arkady,logicheskie,ekonomicheskie,kvesty', 'http://static.apitech.ru/279646E85405401BB3CF36364AD11A00RU', 0.01, 1, 488, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(489, 577, 'Гипер Скорость', 'Giper_skorost', 'Почувствуй себя гонщиком  формулы-1 с наворотами', 638, 710, 'gonki,detyam,mashiny,navyki,prepyatstviya,simulyatory', 'gonki', 'http://static.apitech.ru/023AD862717E4D5DB76219D2D482FE5BRU', 0.01, 1, 489, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(490, 576, 'Меткий стрелок', 'Metkii_strelok', 'Твоя цель – попасть по мишеням и пролетающим птицам. Причем чем дальше находятся мишени, тем большее количество очков ты зарабатываешь. Кроме птиц еще стреляй в часы, чтобы увеличить запас времени.', 763, 810, 'arkady,vremya,detyam,razvlecheniya,simulyatory,unichtozheniya,shutery', 'arkady', 'http://static.apitech.ru/33E707768F684CE3BDE973044FF2E5E3RU', 0.01, 1, 490, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(491, 575, 'Краштест', 'Krashtest', 'Проверь тачку на прочность!', 668, 710, 'arkady,detyam,mashiny,razvlecheniya,simulyatory,unichtozheniya', 'arkady', 'http://static.apitech.ru/C3780A39CBF94807AA4E7708927B53B8RU', 0.01, 1, 491, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(492, 574, 'Чужие', 'Chuzhie', 'На планету напали пришельцы, пока главный герой сидел в бункере, приговоренный к смерти. На счастье, ему удалось выжить, но, видимо, ненадолго. Помоги ему отбиться от монстров и спасти Землю.', 738, 810, 'drobovik,zaschita,monstry,naiti,oruzhie,strelyalki,uzhastiki,unichtozheniya,shutery,eksheny', 'strelyalki,ekshn,kvesty', 'http://static.apitech.ru/1443C62856084AF99A1C0A18B2AE32E9RU', 0.01, 1, 492, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(493, 573, 'Убить Кенни', 'Ubit_kenni', 'У тебя появилась замечательная возможность хоть раз спасти Кенни от смерти. Правда зная его карму, мальчика это не спасет. Помоги Кенни выбраться из под града ножей.  А не то Кайл будет ругаться J', 638, 660, 'arkady,multiki,prepyatstviya,razvlecheniya,simulyatory,smeshnye,unichtozheniya', 'arkady,multiki', 'http://static.apitech.ru/CC68EABB0B4340ECA2A6544D364577F9RU', 0.01, 1, 493, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(494, 572, 'Гирлянды', 'Girlyandy', 'Сделай правильную связку гирлянд', 668, 750, 'arkady,detyam,logicheskie,razvlecheniya,rozhdestvo,sneg,ukrashenie', 'arkady,logicheskie', 'http://static.apitech.ru/2277978E0B264E9395B4E8735F6284CARU', 0.01, 1, 494, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(495, 571, 'Скуби Ду Ужасный замок', 'Skubi_du_uzhasnyi_zamok', 'Друзья Скуби Ду попали в ловушку в ужасном замке, где водятся привидения. Помоги псу освободить друзей, сражаясь с призраком при помощи различных подручных предметов.', 547, 580, 'arkady,volshebstvo,detyam,zhivotnye,zamki,multiki,naiti,pobeg,prepyatstviya,prizraki,priklyucheniya,skubi,smeshnye,sobaka,spasatelnye,uzhastiki,fentezi,eksheny', 'arkady,multiki,priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/E1C3328D9578458698DC8B5F4C0547EARU', 0.01, 1, 495, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(496, 570, 'Скуби Ду Гонка с Монстрами', 'Skubi_du_gonka_s_monstrami', 'Скуби участвует в соревновании по бегу и его противником является призрак. Как вы уже догадались, Скуби надо победить.  Управление осуществляется при помощи клавиатуры. В общем, ноги в руки и бегом!', 563, 610, '', 'arkady,gonki,multiki,fizicheskie_igry', 'http://static.apitech.ru/1FE9BDF5940D43B3944445794A5D62FCRU', 0.01, 1, 496, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(497, 569, 'Симпсоны Война Снежками', 'Simpsony_voina_snezhkami', 'Сыграй в снежки с незабываемой семейкой Симпсонов! Закидывай всех, кого видишь, попадай в снеговика, чтобы получить дополнительные снежки. Следи за Нельсоном. Уклоняйся от снежков и атакуй в ответ.', 688, 810, 'arkady,detyam,multiki,razvlecheniya,smeshnye,sneg', 'arkady,multiki', 'http://static.apitech.ru/417C2F42DD884B3B8AFAA52ABA174248RU', 0.01, 1, 497, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(498, 568, 'Губка Боб Спасти Праздник', 'Gubka_bob_spasti_prazdnik', 'В Бикини Боттом пришла зима, настало время катания с горы. Но Планктон решил испортить всем праздник и при помощи своей адской машины обрушил на гору ужасную лавину. Помоги Спанчу спасти праздник!', 488, 710, 'arkady,gonki,gubka_bob,detyam,multiki,navyki,pobeg,prepyatstviya,rozhdestvo,smeshnye,sneg,sobiralki,spanch_bob', 'arkady,gonki,multiki', 'http://static.apitech.ru/45404EB10ED84964B597746A60BB41E1RU', 0.01, 1, 498, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(499, 567, 'Губка Боб Снежные Штаны', 'Gubka_bob_snezhnye_shtany', 'Самый большой в мире снежный ком', 488, 710, 'arkady,gubka_bob,detyam,logicheskie,multiki,navyki,prepyatstviya,razvlecheniya,simulyatory,smeshnye,sneg,sobiralki,spanch_bob', 'arkady,logicheskie,multiki', 'http://static.apitech.ru/37872B8D8C1443C394B7A58A354455FERU', 0.01, 1, 499, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(500, 566, 'Губка Боб Летучий Голландец', 'Gubka_bob_letuchii_gollandets', 'В ловушке на Летучем Голландце', 488, 710, 'gubka_bob,detyam,monstry,multiki,naiti,pobeg,prepyatstviya,prizraki,priklyucheniya,smeshnye,sobiralki,spanch_bob,spasatelnye,uzhastiki,eksheny', 'multiki,priklyucheniya,ekshn,brodilki,kvesty', 'http://static.apitech.ru/6F4E613AA8C74A2EB7A23CF2A63653A7RU', 0.01, 1, 500, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(501, 565, 'Губка Боб Карате', 'Gubka_bob_karate', 'Спанч Боб решил попробовать себя в боях без правил. Чтобы стать чемпионом, ему необходимо выиграть три боя. У Спанча существуют различные комбинации ударов, но ведь и соперники тоже не лыком шиты.', 563, 610, 'gubka_bob,detyam,draki,multiki,spanch_bob,eksheny', 'draki,multiki,ekshn', 'http://static.apitech.ru/EE0CEC3D3B52410B8668A6BDA60A0C2BRU', 0.01, 1, 501, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(502, 564, 'Metal hell bike', 'Metal_hell_bike', 'Мотоциклист-скелет решил устроить себе поездку по Аду. К сожалению, еще никто не додумался там построить нормальные дороги, поэтому путь, по которому будет ездить байкер, вам придется сделать самим.', 668, 710, 'arkady,kosmicheskie,letalki,logicheskie,mototsikly,priklyucheniya,razvlecheniya', 'arkady,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/DAEFE7E40A424C9D976C545B40021753RU', 0.01, 1, 502, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(503, 563, 'Рембо Первая Кровь', 'Rembo_pervaya_krov', 'Вы будете играть за легендарного Джона Рембо. Никто не любит, когда на него нападают, особенно с ножами, и Джон не исключение.  Поэтому берите автомат и убивайте обидчиков. Войди в режим берсерка!', 668, 750, 'arkady,voennye,zaschita,kino,parodii,smeshnye,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,voennye,strelyalki,ekshn', 'http://static.apitech.ru/31A47806B1884BD1ABD7AFB634EF1E89RU', 0.01, 1, 503, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(504, 562, 'Веселый автобус', 'Hippy_bus', 'Хиповый автобус нуждается в помощи', 668, 710, 'arkady,detyam,letalki,logicheskie,mashiny', 'arkady,logicheskie', 'http://static.apitech.ru/179304799E3B4A70872502E345083156RU', 0.01, 1, 504, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(505, 561, 'Котяра на самолете', 'Kotyara_na_samolete', 'Помоги котику управлять самолетом, кликая на левую кнопку мыши. В  полете необходимо собирать зеленые бомбочки и избегать столкновения с красными звездочками, иначе киса отправится в свободный полет.', 501, 580, 'arkady,balans,detyam,zhivotnye,koshki,letalki,navyki,prepyatstviya,samolety,sobiralki', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/F7A8458014BB4F30BF7D0A17184E8C40RU', 0.01, 1, 505, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
