(507, 559, 'BMX Гонка', 'Bmx_gonka', 'Всего за минуту ты должен проехать трассу, совершая при этом финты различной сложности. Конечно, они не всегда заканчиваются удачно, но разве ты не слышишь, как кричат болельщики? Риск того стоит!', 588, 680, 'veliki,detyam,navyki,prepyatstviya,razvlecheniya,simulyatory,sportivnye,tryuki', 'sportivnye,tryuki', 'http://static.apitech.ru/C5C56F7C27B94A0E973B6E0A1C9CF830RU', 0.01, 1, 507, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(508, 558, 'BMX Выкрутасы', 'Bmx_vykrutasy', 'Покажи все на что ты способен', 572, 622, 'veliki,detyam,navyki,prepyatstviya,razvlecheniya,simulyatory,sportivnye,tryuki', 'sportivnye,tryuki', 'http://static.apitech.ru/77BA0C4A83A5421BAE65A6824B91B5F8RU', 0.01, 1, 508, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
