(510, 556, 'Симпсоны экзамен Лизы', 'Simpsony_ekzamen_lizy', 'Лиза Симпсон растет, и вот ей уже пришла пора сдавать экзамены. Твоя задача – управлять подъемником,т.к девочке нужно показать нужные точки на графике, но аккуратно, чтобы Лиза не врезалась в потолок.', 588, 660, 'arkady,devochkam,detyam,multiki,naiti', 'arkady,dlya_devochek,multiki,kvesty', 'http://static.apitech.ru/D50B9C7BECA64E598472772797B50930RU', 0.01, 1, 510, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
