(517, 549, 'Решающая атака', 'Reshayuschaya_ataka', 'До конца матча остались считанные секунды, ты должен успеть! Беги, уворачиваясь от громил, чтобы вовремя добежать до ворот. Потом прицелься и забей гол! Не сворачивай со своего пути победителя!', 608, 700, 'arkady,balans,vremya,gonki', 'arkady,gonki,fizicheskie_igry', 'http://static.apitech.ru/BDA076C755EF495E93C2AF8981E1BC8ERU', 0.01, 1, 517, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(518, 548, 'Атака снеговиков', 'Ataka_snegovikov', 'Снеговики взбесились и стали убивать всех подряд! Но тебе они не страшны. Хорошенько вооружись и заставь попрыгать эти злобные комья снега! В игре есть  магазин, где ты сможешь купить апгрейды.', 588, 710, 'arkady,detyam,led,myach,navyki,pobeg,prepyatstviya,priklyucheniya,simulyatory,sneg,sportivnye', 'arkady,priklyucheniya,sportivnye,brodilki', 'http://static.apitech.ru/362A1C9C4901451888C346B5086E8036RU', 0.01, 1, 518, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
