(520, 546, '9 кругов ада', '9_krugov_ada', 'Это реальный ад.Постораайся выжить', 688, 710, 'zaschita,zombi,oruzhie,priklyucheniya,strelyalki,uzhastiki,unichtozheniya,shutery,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/46AF407224D84F9E8E0320C2CF8A654DRU', 0.01, 1, 520, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
