(522, 544, 'Губка Боб', 'Gubka_bob', 'Помоги Губке Бобу преодалеть препядствия!', 668, 750, 'arkady,vodnye,vremya,gubka_bob,detyam,multiki,spanch_bob', 'arkady,multiki', 'http://static.apitech.ru/5D36576FD2D14FE88086A4D30D350595RU', 0.01, 1, 522, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(523, 543, 'Бойня с мутантами', 'Boinya_s_mutantami', 'Что-то в лаборатории пошло не по плану, и монстры вырвались на свободу. Тебе предстоит очистить всю местность от этих опасных тварей. У тебя есть только одна цель – выживи любой ценой.', 728, 830, 'zaschita,monstry,oruzhie,prepyatstviya,priklyucheniya,strelyalki,unichtozheniya,shutery,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/9AE99202AF474E0DA9EB7DAA049C2C4CRU', 0.01, 1, 523, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(524, 542, 'Снайпер 7', 'Snaiper_7', 'Теперь ты работаешь не один, потому что появился напарник-разведчик. Вместе с ним вам необходимо будет устранять ваших врагов и проходить нелегкие, но захватывающие миссии. Желаем удачи!', 668, 750, 'voennye,vremya,navyki,naiti,oruzhie,simulyatory,snaiper,strelyalki,unichtozheniya,shutery,eksheny', 'voennye,strelyalki,ekshn,kvesty', 'http://static.apitech.ru/FDB63F226C344635AE5CAC6875C4CB6CRU', 0.01, 1, 524, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(525, 541, 'Город мертвых', 'Gorod_mertvykh', 'Обычно мертвые нападают внезапно. И этот случай не исключение. Доберись до остальных выживших и помоги им удержать оборону. Отправь злобных мертвецов туда, откуда пришли. И естественно, беги отсюда!!', 668, 750, 'zombi,kino,monstry,strelyalki,uzhastiki,unichtozheniya,shutery,eksheny', 'strelyalki,ekshn', 'http://static.apitech.ru/8DB038585A914E2F9BD021AC47811BC9RU', 0.01, 1, 525, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(526, 540, 'Мотоманьяк', 'Motomanyak', 'Ты, самый крутой мотомэн, начинаешь свой нелегкий путь на самом простом мотоцикле. Тебе предстоит долгий путь, прежде, чем ты обретешь достойного тебя железного коня. Не посрами свою славу!', 668, 750, 'arkady,vremya,gonki,detyam,mototsikly', 'arkady,gonki', 'http://static.apitech.ru/243F52A9BE5A4075859C9E132C9BA466RU', 0.01, 1, 526, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(527, 539, 'Последний рубеж', 'Poslednii_rubezh', 'Защити последний город на Земле от жутких постакалиптических роботов. Убей их прежде, чем они разрушат последний оплот жизни на планете. Продержись как можно дольше, ведь за тобой будущее!', 538, 810, 'arkady,voennye,zaschita,kosmicheskie,oruzhie,prisheltsy,roboty,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,voennye,strelyalki,ekshn', 'http://static.apitech.ru/EE523F773BD348948A7F814563E3D446RU', 0.01, 1, 527, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(528, 538, 'Вверх к вершинам', 'Vverkh_k_vershinam', 'Поднимись на самую вершину горы!', 618, 780, 'vremya,gonki,detyam,logicheskie,mototsikly', 'gonki,logicheskie', 'http://static.apitech.ru/F8D4CD79997645CCB7E69874245D9E30RU', 0.01, 1, 528, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(529, 537, 'Вторжение', 'Vtorzhenie', 'Останови вторжение!Спаси бункер', 788, 910, 'monstry,oruzhie,strelyalki,shutery,eksheny', 'strelyalki,ekshn', 'http://static.apitech.ru/331DA7C41F1E42B29C364DE58D94DF4DRU', 0.01, 1, 529, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(530, 536, 'Весёлый вождь', 'Vesyolyi_vozhd', 'Ты одинокий вождь одного из индейских племен. Твоя цель – защитить свое бунгало от полчищ различной нечисти. Из оружия у тебя есть только стрелы. Не дай умертвиям тебя одолеть!!', 638, 810, 'arkady,detyam,zaschita,monstry,oruzhie,priklyucheniya,spasatelnye', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/362E967D7A294220ACFB112DC871AC38RU', 0.01, 1, 530, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(531, 535, 'Трудный лабиринт', 'Trudnyi_labirint', 'Его не так то просто пройти', 668, 710, 'arkady,vremya,detyam,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/2D02B366C1CE4B5CAFD1054D57783C3BRU', 0.01, 1, 531, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(532, 534, 'Мясорубка', 'Myasorubka', 'Цель этой игры – уничтожение злобных зомби. Избегай их, а не то будешь терять свое здоровье. Попутно ты должен улучшать свои характеристики, чтобы суметь спасти захваченных зомби заложников.', 716, 580, 'arkady,zaschita,zombi,monstry,oruzhie,strelyalki,unichtozheniya,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/50FC4E50D6DD4FF699DAD3D0F67BCB38RU', 0.01, 1, 532, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(533, 533, 'Адреналин', 'Adrenalin', 'Игра по типу тетриса. Запускай шарик и сбивай разноцветные блоки. А заодно и человечков, которые по этим блокам бегают. Шарик летает очень быстро, поэтому за ним очень трудно уследить. Дерзай! ', 588, 810, 'arkady,razvlecheniya,smeshnye,sobiralki,unichtozheniya', 'arkady', 'http://static.apitech.ru/0817EABA80AE4198A36D009312E39F04RU', 0.01, 1, 533, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(534, 532, 'Король парковки', 'Korol_parkovki', 'Паркуй машину как можно более точно в отмеченной области, при этом старайтесь не задевать другие машины и бордюры, иначе будет увеличиваться уровень повреждений. Очки зависят от аккуратности парковки.', 688, 750, 'arkady,vremya,detyam,logicheskie,mashiny,parkovka', 'arkady,logicheskie', 'http://static.apitech.ru/31C00271D30F45739B2EE7FD17646EF8RU', 0.01, 1, 534, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(535, 531, 'Сладкий сон', 'Sladkii_son', 'Разбуди спящий квадратик', 668, 750, 'detyam,logicheskie,naiti,smeshnye', 'logicheskie,kvesty', 'http://static.apitech.ru/C5494D4C60534D6EAFDF4276A09369C2RU', 0.01, 1, 535, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(536, 530, 'наруто ярость ниндзя', 'Naruto_yarost_nindzya', 'Увлекательная игра про Наруто', 788, 710, 'detyam,draki,multiki,naruto,nindzya,unichtozheniya,eksheny', 'anime,draki,multiki,ekshn', 'http://static.apitech.ru/DA09B4C8ACBD453AAE8C408833E846D2RU', 0.01, 1, 536, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(537, 529, 'Мафиозные разборки', 'Mafioznye_razborki', 'Всякий мафиози всегда устраивает разборки с коллегами по ремеслу. И твой персонаж не исключение. Несколькими меткими выстрелами положи противоборствующую мафиозную группировку.', 668, 750, 'oruzhie,strelyalki,unichtozheniya,shutery,eksheny', 'strelyalki,ekshn', 'http://static.apitech.ru/4AB000743D6D4D6B82AD3C9B64E0DD23RU', 0.01, 1, 537, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(538, 528, 'Кровавая бойня', 'Krovavaya_boinya', 'Замочи  зеленых пришельцев', 668, 910, 'oruzhie,strelyalki,unichtozheniya,shutery,eksheny', 'strelyalki,ekshn', 'http://static.apitech.ru/E8798CB5C699414084E86AD5A62A7730RU', 0.01, 1, 538, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(539, 527, 'Ревущая сталь', 'Revuschaya_stal', 'Горы и байк.Сможешь остаться в живых?', 588, 610, 'gonki,mototsikly,prepyatstviya', 'gonki', 'http://static.apitech.ru/ADA85F95BEF147D795669162952E7DA7RU', 0.01, 1, 539, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(540, 526, 'Мототриал', 'Mototrial', 'Управляй умело своим байком', 588, 610, 'vremya,gonki,mototsikly,prepyatstviya,tryuki', 'gonki', 'http://static.apitech.ru/DEA45D35F2BD47DB9537AAF13A9949F4RU', 0.01, 1, 540, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(541, 525, 'Запусти черепаху', 'Zapusti_cherepakhu', 'Черепашка уже сидит в пушке. Тебе остается лишь отрегулировать высоту полета и силу запуска. Игра не для слабонервных. Ты должен запустить черепашку так, чтобы она пролетела как можно дольше.', 688, 910, 'arkady,zhivotnye,letalki,razvlecheniya,smeshnye,unichtozheniya', 'arkady', 'http://static.apitech.ru/46C2166D5B224F24BC6EE730E736255ERU', 0.01, 1, 541, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(542, 524, 'Вращательный момент', 'Vraschatelnyi_moment', 'Только вращательный момент тебе поможет', 668, 750, 'gonki,mashiny,eksheny', 'gonki,ekshn', 'http://static.apitech.ru/2585D38837F84A5FB2155304E1278FF2RU', 0.01, 1, 542, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(543, 523, 'Пингвин убийца', 'Pingvin_ubiitsa', 'Твой персонаж – флегматичный пингвин, вооруженный пистолетом. Тебе нужно перестрелять всех агрессивно настроенных к тебе пингвинов, да и не только их. Эскимосы тебя тоже не любят. Цель – выжить.', 668, 750, 'arkady,detyam,zhivotnye,led,sneg', 'arkady', 'http://static.apitech.ru/394656152EDF4A529B8EA03896646255RU', 0.01, 1, 543, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(544, 522, 'Полёт пингвина', 'Polyot_pingvina', 'Управляй пингвином в полете', 668, 750, 'arkady,detyam,zhivotnye,led,letalki,sneg', 'arkady', 'http://static.apitech.ru/2F524D46ECDA48C6BC87947E2590E51DRU', 0.01, 1, 544, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(545, 521, 'Красная звезда', 'Krasnaya_zvezda', 'Головоломка «Красная звезда» придумана для самых умных. Пройти её дано не каждому. Убирайте фигуры из-под красной звезды так, чтобы сама звезда была зафиксирована на закреплённой платформе. Подумай)', 668, 750, 'arkady,detyam,logicheskie,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/DE670C3A8A314129897BB618A06B7072RU', 0.01, 1, 545, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(546, 520, 'Подводные войны', 'Podvodnye_voiny', 'Развивай и улучшай свой шарик', 588, 610, 'arkady,vodnye,detyam,logicheskie,shariki', 'arkady,logicheskie', 'http://static.apitech.ru/EDC70DA2237649C8A10D09040B379F34RU', 0.01, 1, 546, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(547, 519, 'Падение с лестницы 2', 'Padenie_s_lestnitsy_2', 'У тебя в распоряжении есть пять маленьких человечков, которых ты должен скинуть с лестницы. Причем сделать это надо особо изуверским способом. Например, установить вдоль лестницы топоры и булавы.', 588, 710, 'arkady,smeshnye', 'arkady', 'http://static.apitech.ru/4C112B647DA74C2CAB968B1FB1CD0E8BRU', 0.01, 1, 547, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(548, 518, 'Операция Зомби', 'Operatsiya_zombi', 'Собрался как-то один парень прикупить себе парочку новых стволов. Но неожиданно наступила ночь и откуда ни возьмись со всех сторон повылазили зомби! Возвращаться опасно, вот он и отстреливался с крыши', 588, 760, 'zombi,monstry,priklyucheniya,strelyalki,uzhastiki,shutery,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/DC517D28AB014672B394497350D41A42RU', 0.01, 1, 548, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(549, 517, 'Вертолетный удар', 'Vertoletnyi_udar', 'Вы пилот тяжеловооруженного вертолета «Черная акула». Вы должны добраться до конца уровня, уничтожая множество вражеских объектов на своем пути. Собирайте аптечки – они вам помогут завершить миссию.', 588, 660, 'vertolety,detyam,zaschita,letalki,prepyatstviya,priklyucheniya,simulyatory,strelyalki,unichtozheniya,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/9959B977BF4C4C2BABC3F42EFA672B75RU', 0.01, 1, 549, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(550, 516, 'Авиаудар', 'Aviaudar', 'Нанеси удар с воздуха', 588, 660, 'detyam,letalki,prepyatstviya,priklyucheniya,samolety,simulyatory,strelyalki,unichtozheniya,shutery,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/5224BBA8466A4BDABEEAD701E1D44ED6RU', 0.01, 1, 550, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(551, 515, 'Сладкий сон 2', 'Sladkii_son_2', 'Разбуди прикольный квадратик', 668, 750, 'arkady,detyam,logicheskie,razvlecheniya,smeshnye', 'arkady,logicheskie', 'http://static.apitech.ru/FBA188236FA04B07B475193667259C44RU', 0.01, 1, 551, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(552, 514, 'Музыкальная битва', 'Muzykalnaya_bitva', 'Пронесись сквозь музыку', 668, 750, 'arkady,detyam,kosmicheskie,letalki,prepyatstviya,sobiralki', 'arkady', 'http://static.apitech.ru/67A0240800C546638AB7AAE968599445RU', 0.01, 1, 552, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(553, 513, 'Кот обормот', 'Kot_obormot', 'Тебе нужно перемещать кота, привязанного к воздушному шарику, и защищать его от дракончиков, отстреливаясь от них. Из монстриков выпадает оружие, которое ты должен использовать для защиты котика.', 668, 660, 'arkady,detyam,zhivotnye,koshki,letalki,priklyucheniya,spasatelnye,strelyalki', 'arkady,priklyucheniya,strelyalki,brodilki', 'http://static.apitech.ru/9A129055B3F9444787371D1A99813C43RU', 0.01, 1, 553, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(554, 512, 'Полигон', 'Poligon', 'Твоя задача – поразить как можно большее чисто мишеней за как можно меньшее время. В твоей обойме 20 патронов, по одной на каждую мишень. За попадание начисляются очки, а за промах вычитаются. ', 588, 660, 'arkady,armiya,vremya,detyam,oruzhie,razvlecheniya,simulyatory,strelyalki', 'arkady,strelyalki', 'http://static.apitech.ru/481572C8622E4FBB9B5586E299ED6585RU', 0.01, 1, 554, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(555, 511, 'Истории Игрушек', 'Istorii_igrushek', 'Любишь игрушки?Окунись в их историю', 668, 750, 'arkady,detyam,zhivotnye,logicheskie,naiti', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/315A8A7632A249BBB85EBAE7A7FA6D21RU', 0.01, 1, 555, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(556, 510, 'Велотриал', 'Velotrial', 'Показывай самые крутые трюки!', 588, 610, 'veliki,vremya,gonki,detyam,razvlecheniya,simulyatory,tryuki', 'gonki,tryuki', 'http://static.apitech.ru/9261A6AC64B449ED8DBBB7B9F198FFC2RU', 0.01, 1, 556, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(557, 509, 'Огненный шар', 'Ognennyi_shar', 'Огонь одна из самых сильных стихий!', 633, 660, 'arkady,volshebstvo,detyam,logicheskie,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/02B7C8E325FE4C11B1294ED1D0A7E8D7RU', 0.01, 1, 557, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(558, 508, 'Наруто', 'Naruto', 'Мастерство шиноби определяется не количеством техник, которых он знает, а силой духа!', 588, 710, 'detyam,draki,multiki,naruto,priklyucheniya', 'anime,draki,multiki,priklyucheniya,brodilki', 'http://static.apitech.ru/DA77ED5DB8C04EB1958F6D054FD5F3ADRU', 0.01, 1, 558, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(559, 507, 'Экстремальные гонки', 'Ekstremalnye_gonki', 'Любишь гонки и экстрим? Играй!', 538, 610, 'vremya,gonki,detyam,mashiny,simulyatory,sportivnye', 'gonki,sportivnye', 'http://static.apitech.ru/A32B5B59E976429FA1F05031E04F76BBRU', 0.01, 1, 559, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(560, 506, 'Снайпер 6', 'Snaiper_6', 'Перед каждым уровнем вам будут даваться новые инструкции. Ваша задача – неукоснительно их выполнять. Для этого вам придется подключить вашу логику и изобретательность. Желаем удачи!', 668, 750, 'oruzhie,priklyucheniya,rolevye,simulyatory,snaiper,strelyalki,shutery,eksheny', 'priklyucheniya,strelyalki,brodilki', 'http://static.apitech.ru/83E250E783A24D249180EDA08AA1C999RU', 0.01, 1, 560, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(561, 505, 'Снайпер 5', 'Snaiper_5', 'Внимательно вчитывайтесь в инструкции, выдаваемые вам перед каждым уровнем. Вам необходимо будет чрезвычайно точно убивать ваших врагов и проходить нелегкие, но захватывающие миссии.', 668, 750, 'voennye,oruzhie,priklyucheniya,rolevye,simulyatory,snaiper,shutery,eksheny', 'priklyucheniya,strelyalki,brodilki', 'http://static.apitech.ru/13FCB61D34F54CCD8F9A7C4ABCD4A00ERU', 0.01, 1, 561, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(562, 504, 'Снайпер 4', 'Snaiper_4', 'Ваш персонаж – профессиональный киллер и вам поручили убить организацию Вуду. Подозревают, что они используют магию, поэтому вас ждет множество интересных заданий.  И пусть ваша рука не дрогнет!', 668, 750, 'voennye,oruzhie,priklyucheniya,rolevye,simulyatory,snaiper,shutery,eksheny', 'priklyucheniya,strelyalki,brodilki', 'http://static.apitech.ru/0034646AA4C9462D9B9A68A05AE15D52RU', 0.01, 1, 562, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(563, 503, 'Найди пятнышко', 'Naidi_pyatnyshko', 'Чтобы перейти на следующий уровень вам нужно будет найти на экране маленькое пятнышко того же цвета, что и прыгающие на экране смайлы, которые будут вам очень мешать. Надейтесь на свою зоркость!', 668, 750, 'arkady,voennye,vremya,detyam,naiti,smeshnye', 'arkady,dlya_devochek,poisk_predmetov,kvesty', 'http://static.apitech.ru/09284C6D4D0A49B69F06FECD4BCF6755RU', 0.01, 1, 563, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(564, 502, 'Паркурщик', 'Parkurschik', 'Главная тема этой игры – паркур. Эта игра требует внимательности и хорошей реакции. Тебе нужно помочь парню-паркурщику пройти всю трассу, перепрыгивая через предметы и лазая по стенам.', 588, 710, 'arkady,detyam,prepyatstviya,priklyucheniya,razvlecheniya,simulyatory,sobiralki', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/EABD668CA57040579F76117684B06019RU', 0.01, 1, 564, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(565, 501, 'Супер робот 2', 'Super_robot_2', 'Играй за маленького робота, которому нужно уворачиваться от большого синего шара. Расстреливай его, и шар поделится еще на два, и еще, и еще. Твоему роботу предстоит уничтожить их все. ', 668, 750, 'arkady,detyam,zaschita,roboty,sobiralki,strelyalki,unichtozheniya,fentezi,shutery,eksheny', 'arkady,strelyalki,ekshn', 'http://static.apitech.ru/F646895D9294436EB616CC3B124AC8E5RU', 0.01, 1, 565, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(566, 500, 'Звездный бой', 'Zvezdnyi_boi', 'Сделай себе карьеру на борту космического корабля! Тебе нужно сбить максимальное количество астероидов за отведенное время. При каждом выстреле нужно сбивать вражеский шаттл.', 738, 750, 'detyam,zaschita,kosmicheskie,unichtozheniya,fentezi,eksheny', 'ekshn', 'http://static.apitech.ru/BDF71CDAC429416EBB875D30AC581330RU', 0.01, 1, 566, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(567, 499, 'Снайпер 3', 'Snaiper_3', 'Очередная игра из серии «Снайпер». Вам предстоит получать заказы от босса и четко их выполнять, для чего придется подключить логику. Игрушка захватывающая, поэтому не стоит терять времени – играйте!', 668, 750, 'voennye,oruzhie,prepyatstviya,priklyucheniya,rolevye,simulyatory,snaiper,strelyalki,unichtozheniya,shutery,eksheny', 'voennye,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/7920F192987742DFBB89B88606930A88RU', 0.01, 1, 567, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(568, 498, 'Снайпер 2', 'Snaiper_2', 'Боссу снова кто-то не угодил, и он опять поручил вам разобраться с этим делом. Вам предстоит вжиться в роль настоящего профессионального убийцы. «Ничего личного, брат, это просто работа» - ваш девиз.', 668, 750, 'voennye,oruzhie,prepyatstviya,priklyucheniya,rolevye,simulyatory,snaiper,strelyalki,unichtozheniya,shutery,eksheny', 'voennye,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/75288C493D5246EE875F9AD87E187E13RU', 0.01, 1, 568, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(569, 497, 'Найди смайла', 'Naidi_smaila', 'Вам необходимо выбирать смайлы, показанные в верхней части экрана в той же последовательности в рамках отведенного времени.  Чем быстрее уровень пройден, тем больше очков вы получите. Удачи! J', 688, 710, 'arkady,naiti,razvlecheniya,smeshnye,ugadaiki', 'arkady,poisk_predmetov,kvesty', 'http://static.apitech.ru/DC18E340706B4AB7995A508607E64869RU', 0.01, 1, 569, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(570, 496, 'Точка Огня', 'Tochka_ognya', 'Ты находишься в башне на вершине горы и у тебя есть пулемет, которым ты отстреливаешься от врагов. Они бегут все ближе и ближе к тебе и даже атакуют в ответ! Не дай своей цитадели пасть!', 488, 810, 'voennye,oruzhie,prepyatstviya,priklyucheniya,strategii,unichtozheniya,eksheny', 'priklyucheniya,strategii,ekshn,brodilki', 'http://static.apitech.ru/D674B7D4D1DB4665A9986A95000737E5RU', 0.01, 1, 570, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(571, 495, 'Операция Штурм', 'Operatsiya_shturm', 'Защищай свой форт-пост всеми силами! Ты можешь стрелять, бомбить и даже вызывать поддержку с воздуха! Покупай в магазине улучшения, чтобы победа уж наверняка была твоей! Враг не пройдет!', 588, 710, 'armiya,voennye,oruzhie,prepyatstviya,priklyucheniya,strategii,unichtozheniya,eksheny', 'priklyucheniya,strategii,ekshn,brodilki', 'http://static.apitech.ru/14FF34E8D9844190994D49DB9F852CE0RU', 0.01, 1, 571, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(572, 494, 'Морская звёздочка', 'Morskaya_zvyozdochka', 'Твоя задача – не дать морской звездочке погибнуть от рыбьих хвостов или зубов! У звездочки есть небольшой листок, который служит ей защитой. Собирай ракушки и водоросли, чтобы заработать  очки.', 788, 650, 'arkady,vodnye,detyam,zhivotnye,letalki,sobiralki', 'arkady,dlya_devochek', 'http://static.apitech.ru/AF59C7546DC7474DA7D2FA4670F45F23RU', 0.01, 1, 572, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(573, 493, 'Забей пенальти', 'Zabei_penalti', 'Очень необычная игра хотя бы потому, что сделана в стиле черно-белого кино. Здесь ты должен показать себя великим игроком и забить как можно больше голов. Чтобы забить гол, выбери силу удара.', 588, 660, 'arkady,detyam,logicheskie,myach,navyki,simulyatory,sportivnye,futbol', 'arkady,logicheskie,sportivnye', 'http://static.apitech.ru/82D7EC24BBAF4A0E9D5A1B3536E423F3RU', 0.01, 1, 573, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(574, 492, 'Раздень подругу', 'Razden_podrugu', 'Конечная цель этой игры – раздеть всех девушек. Чтобы это произошло, дождитесь, когда центр мишени совпадет с траекторией движения, и только тогда стреляйте. Наградой вам станут обнаженные красотки.', 668, 750, 'arkady,obolschenie,razvlecheniya,snaiper', 'arkady', 'http://static.apitech.ru/CC51275B3E374FE28C034A4395D57B6ARU', 0.01, 1, 574, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(575, 491, 'Безумный шар', 'Bezumnyi_shar', 'Ты не должен дать шарику скатиться с поля или дать ему взорваться. Управлять шариком нелегко, т.к. он норовит упасть.  На уровне вам нужно будет достичь конечной точки и попутно собирать бонусы.', 738, 660, 'arkady,balans,detyam,letalki,logicheskie,prepyatstviya,priklyucheniya,shariki', 'arkady,logicheskie,priklyucheniya,fizicheskie_igry,brodilki', 'http://static.apitech.ru/7BFB34A7302F4B87988B1963E0A12D8ERU', 0.01, 1, 575, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(576, 490, 'Наёмник', 'Nayomnik', 'В этой игре вы профессиональный убийца и вам нужно убить всех своих врагов. В самом начале у вас будет самое простое оружие, но постепенно оно будет меняться. Проверь свою меткость и ловкость.', 788, 935, 'arkady,vremya,navyki,oruzhie,simulyatory,snaiper,shutery', 'arkady', 'http://static.apitech.ru/3EF96D03AD3841CEA18A55282DC791A5RU', 0.01, 1, 576, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(577, 489, 'Эскадрон Ангелов', 'Eskadron_angelov', 'Твоя задача – долететь из одного пункта в другой. Но так как лететь долго, а топлива мало,  то тебе придется в воздухе собирать канистры с бензином. Избегай взрывающихся предметов.', 488, 709, 'arkady,armiya,voennye,detyam,letalki,prepyatstviya,samolety', 'arkady,voennye', 'http://static.apitech.ru/BC6715C7D8CB4B6F9AF503CEAA6E55FARU', 0.01, 1, 577, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(578, 488, 'Металлический шар', 'Metallicheskii_shar', 'Проведи небольшой металлический шар по лабиринту. Управление осуществляется при помощи клавиатуры. Избегайте края площадки и по пути к точке назначения собирайте бонусы. За ни вы получаете очки.', 738, 810, 'arkady,balans,detyam,letalki,logicheskie,prepyatstviya,priklyucheniya,shariki', 'arkady,logicheskie,priklyucheniya,fizicheskie_igry,brodilki', 'http://static.apitech.ru/99F8B6A92FC548D68CA8E7F1807F2F6BRU', 0.01, 1, 578, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(579, 487, 'Ускорение', 'Uskorenie', 'Проводи свой шарик через различные препятствия и достигни пункта назначения – синего портала. Он перенесет тебя на следующий уровень. Шар быстро разгоняется, так что будь осторожен и избегай стен.', 588, 660, 'arkady,balans,detyam,letalki,logicheskie,prepyatstviya,priklyucheniya,shariki', 'arkady,logicheskie,priklyucheniya,fizicheskie_igry,brodilki', 'http://static.apitech.ru/1372F0B205FF43E99AE73B0F446A0050RU', 0.01, 1, 579, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(580, 486, 'Полет на пузыре', 'Polet_na_puzyre', 'Играй за девочку, которая надувает жвачку и на ней летает! Смешно? А вот и нет! Ведь если она столкнется с мусором, то упадет с большой высоты! Твоя задача – пролететь как можно дальше, избегая мусора', 723, 710, 'arkady,balans,gonki,detyam,letalki,prepyatstviya,puzyri', 'arkady,gonki,dlya_devochek,fizicheskie_igry', 'http://static.apitech.ru/4049947C45A2431692D7A4356531D962RU', 0.01, 1, 580, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(581, 485, 'Продержись', 'Proderzhis', 'Попробуй продержаться как можно дольше в неравной схватке с противниками!', 588, 710, 'arkady,detyam,letalki,myach,navyki,pobeg,shariki', 'arkady', 'http://static.apitech.ru/C51626D76B304E0395191CE94F0C1C5CRU', 0.01, 1, 581, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(582, 484, 'Операция Антарктида', 'Operatsiya_antarktida', 'Члены твоей команды замерзают во льдах Антарктиды, но ты мчишься им на выручку на спасательном вертолете! Забери своих друзей и возвращайся на базу. Только не разгоняйся, а то вертолет утонет в океане', 788, 910, 'arkady,vertolety,vodnye,vremya,detyam,letalki,logicheskie,prepyatstviya,priklyucheniya,simulyatory,spasatelnye', 'arkady,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/41F68E0208F042848981C2456E9D445BRU', 0.01, 1, 582, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(583, 483, 'Отстрел зомби', 'Otstrel_zombi', 'Ты стоишь абсолютно один посреди кладбища, а на тебя толпой идут зомби! Испугаешься ли ты? Конечно же нет! Ты возьмешь пистолет и начнешь отстреливаться! Ведь у тебя только одна цель – выжить!!', 588, 830, 'arkady,zombi,navyki,oruzhie,uzhastiki,unichtozheniya,shutery,eksheny', 'arkady,ekshn', 'http://static.apitech.ru/7FCD19083EC645F59DBA47637FA68E0DRU', 0.01, 1, 583, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(584, 482, 'Сжимание', 'Szhimanie', 'Тебе нужно сжать игровое пространство до размеров небольшого кубика. Сделать ты это сможешь при помощи клавиатуры.  Но учти, кубик, летающий внутри, не должен касаться перемещаемой стенки.', 688, 810, 'arkady,balans,detyam,logicheskie,razvlecheniya', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/100663FC42D44342BFC1E539F02CB0CARU', 0.01, 1, 584, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(585, 481, 'Мир парковки', 'Mir_parkovki', 'Припаркуй все что дадут', 668, 750, 'arkady,detyam,mashiny,navyki,parkovka', 'arkady', 'http://static.apitech.ru/EEF09E5FAA424162960B99C6888AA9D1RU', 0.01, 1, 585, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(586, 480, 'Кровавый рейд', 'Krovavyi_reid', 'Тебе нужно всего лишь доставить рыбку. Правда, есть такая опасность, что всю рыбу у тебя разворуют птички. Поэтому дядя Вася подгонит тебе пушку, чтобы ты этих птичек отстреливал в пути. ', 638, 790, 'arkady,vremya,gonki,gruzoviki,detyam,zhivotnye,zaschita,oruzhie,razvlecheniya,simulyatory,smeshnye,strelyalki', 'arkady,gonki,strelyalki', 'http://static.apitech.ru/3EF7DAE648314E9A8D025DCCA0F08208RU', 0.01, 1, 586, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(587, 479, 'Зэт Гейм', 'Z_game', 'Размахивай шаром мышкой!', 688, 610, 'arkady,balans,detyam,zaschita,shariki', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/A32094B7CF074F0CB2159CCB3A2E550BRU', 0.01, 1, 587, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(588, 478, 'Летающие хомяки', 'Letayuschie_khomyaki', 'Маленькие хомячки скучать не любят, поэтому все дружно увлеклись экстремальным видом спорта, а именно «запусти хомяка». Подбрось хомяка, а после отбей его подушкой. Да, эта игра не даст тебе заскучать', 588, 710, 'arkady,detyam,zhivotnye,letalki,prepyatstviya,priklyucheniya,razvlecheniya', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/8C10D0CE75164C4AAFB2DAA2422332DDRU', 0.01, 1, 588, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(589, 477, 'Запусти ежа', 'Zapusti_ezha', 'Цель игрушки – запустить ежика в небо так, чтобы он собрал максимальное количество разноцветных шариков. Управляй полетом  ежика при помощи клавиатуры. Если повезет, то еж срикошетит и  полетит дальше', 738, 660, 'arkady,detyam,zhivotnye,letalki,smeshnye', 'arkady', 'http://static.apitech.ru/070FDAD1E8D84F6EB570D43E83C88271RU', 0.01, 1, 589, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(590, 476, 'Весёлая игра', 'Vesyolaya_igra', 'самая веселая игра', 668, 750, 'arkady,detyam,letalki,samolety', 'arkady', 'http://static.apitech.ru/330D1CA4B9A240A19FE2C6BBE62FFD80RU', 0.01, 1, 590, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(591, 475, 'Осада бункера', 'Osada_bunkera', 'Защити свой бункер', 588, 760, 'voennye,detyam,zaschita,oruzhie,strategii,strelyalki,unichtozheniya,shutery,eksheny', 'voennye,strategii,strelyalki,ekshn', 'http://static.apitech.ru/8C2BC6CF97AF40F1ACBBA09D0566F670RU', 0.01, 1, 591, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(592, 474, 'Припаркуй яхту', 'Priparkui_yakhtu', 'Парковать яхту сложнее, чем машину, ведь еще надо учитывать сопротивление воды. Заходи в порт осторожно, чтобы не повредить яхту. Ведь если ты наберешь пять повреждений, то пассажиры никуда не едут.', 668, 750, 'arkady,vodnye,korabli,parkovka', 'arkady', 'http://static.apitech.ru/6CA47F6CFEC64FF6A80A77A7096B74D8RU', 0.01, 1, 592, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(593, 473, 'Наруто путь ниндзя', 'Naruto_put_nindzya', 'Победа будет моя!', 668, 750, 'detyam,draki,naruto,nindzya,eksheny', 'anime,draki,ekshn', 'http://static.apitech.ru/C85513C3E3244B80A4AD58C300AE5FD3RU', 0.01, 1, 593, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(594, 472, 'Ети спорт', 'Eti_sport', 'Йети все-таки тоже человек и ничто человеческое ему не чуждо. И спорт не стал исключением. И вот они с пингвином на пару надумали сыграть в бейсбол, правда, пингвином в качестве мяча. Установи рекорд!', 668, 750, 'arkady,detyam,zhivotnye,letalki,simulyatory,smeshnye,sneg,sportivnye,tryuki,shutery', 'arkady,sportivnye,tryuki', 'http://static.apitech.ru/800965C087C04DC9AF86410D8B62B8CERU', 0.01, 1, 594, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(595, 471, 'Закинь бумажку', 'Zakin_bumazhku', 'Замечательная игра для офисных работников. Хорошо помогает развивать меткость и коротать долгое рабочее время. Тебе сначала нужно поймать бумажку, а потом закинуть ее в мусорную корзину.', 668, 750, 'arkady,razvlecheniya,simulyatory', 'arkady', 'http://static.apitech.ru/04542FC2BD7D48AAA8827CA0EDFF6989RU', 0.01, 1, 595, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(596, 470, 'Скорость и точность', 'Tochnost_i_skorost', 'Веселая нарезка', 768, 810, 'arkady,vremya', 'arkady', 'http://static.apitech.ru/A9C0D1E49F044F389D33235CB917F40ERU', 0.01, 1, 596, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(597, 469, 'Пьяная походка', 'Pyanaya_pokhodka', 'Помоги дяде Феде дойти до дома', 668, 750, 'arkady,razvlecheniya,simulyatory,smeshnye', 'arkady', 'http://static.apitech.ru/CBF90A8912E94AD5A213E3C589AF72C4RU', 0.01, 1, 597, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(598, 468, 'Утиная охота', 'Utinaya_okhota', 'Сезон на уток открыт', 668, 750, 'arkady,detyam,zhivotnye,oruzhie,simulyatory,smeshnye,strelyalki,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/10FCA9E9A1F8407A8B0E99462853C026RU', 0.01, 1, 598, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(599, 467, 'Подводная лодка', 'Podvodnaya_lodka', 'Задача игры – потопить все вражеские корабли своими торпедами. У вас есть право только на три ошибки. Некоторые потопленные корабли дают бонус. Дайте слово морского волка, что не дадите врагам пощады!', 668, 750, 'vodnye,voennye,oruzhie,prepyatstviya,priklyucheniya', 'voennye,priklyucheniya,brodilki', 'http://static.apitech.ru/6190C1C58A214A84AA94AFF0D405A81ARU', 0.01, 1, 599, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(600, 466, 'Воздушные шары', 'Vozdushnye_shary', 'Лопни все шарики', 668, 750, 'arkady,unichtozheniya,shariki', 'arkady', 'http://static.apitech.ru/997443ACC89F401FBC426F7EC02813A6RU', 0.01, 1, 600, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(601, 465, 'Самая женская игра', 'Samaya_zhenskaya_igra', 'Эта игра что-то вроде трехмерного тетриса. Вам нужно отбивать мячик о прозрачную передвигающуюся пластину. Ударяясь о пол, мячик открывает вам части очень красивых картинок.  Откройте всю картину.', 688, 610, 'arkady,devochkam,lyubov', 'arkady,dlya_devochek', 'http://static.apitech.ru/364A3D32F8EB42A9AF144B1E2AD04D29RU', 0.01, 1, 601, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(602, 464, '3D Арканоид Красотки', '3d_arkanoid_krasotki', 'Замечательная трехмерная игрушка, предназначенная специально для ценителей женской красоты.  Отбивай мячик и открывай для себя новых соблазнительных красоток! Есть стимул побеждать ! J', 688, 610, 'arkady,obolschenie,unichtozheniya', 'arkady', 'http://static.apitech.ru/B52F7919BD674BB8BE1237514F00AA3CRU', 0.01, 1, 602, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(603, 463, '3D Арканоид Крутые тачки', '3d_arkanoid_krutye_tachki', ' Отбивай мяч - открывай тачки', 688, 610, 'arkady,mashiny,unichtozheniya', 'arkady', 'http://static.apitech.ru/9A67AB2833974A58B9F8E5027A03821ARU', 0.01, 1, 603, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(604, 462, 'Мыльный пузырь', 'Mylnyi_puzyr', 'Помоги мыльному пузырику', 688, 710, 'arkady,puzyri,razvlecheniya', 'arkady', 'http://static.apitech.ru/0432998FFC124F539BBE5476F0DD5688RU', 0.01, 1, 604, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(605, 461, 'Побег', 'Pobeg', 'Помоги ему сбежать!', 688, 810, 'detyam,logicheskie,naiti,pobeg,prepyatstviya', 'logicheskie,kvesty', 'http://static.apitech.ru/82CCCA21DF7F4FFD8032B9B14EA7C255RU', 0.01, 1, 605, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(606, 460, 'Катапульта', 'Katapulta', 'Запусти мальчика на катапульте как можно выше и дальше! Для этого выбери угол наклона катапульты и…. выстрели им! Управляй им в полете с клавиатуры, только не забудь потом раскрыть парашют!', 668, 750, 'arkady,simulyatory', 'arkady', 'http://static.apitech.ru/52CEBF5263984D1A8E4D2D0BB24EBB76RU', 0.01, 1, 606, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(607, 459, 'Пьяный стрелок', 'Pyanyi_strelok', 'Пьянству бой!', 588, 710, 'arkady,simulyatory,smeshnye,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/F3E7023F8A044FA4B5386BC59C38A7A0RU', 0.01, 1, 607, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(608, 458, 'Прыг-скок', 'Pryg-skok', 'Мега попрыгунчик', 658, 610, 'arkady,detyam,letalki,logicheskie,roboty', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/4D91E695C7C84924AD5EF188A9661032RU', 0.01, 1, 608, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(609, 457, 'Оттуристи планету', 'Otturisti_planetu', 'Проверь, насколько же ты хорошо знаешь нашу планету. В этой увлекательной игре тебя ждут самые разнообразные задания! Заодно и узнаешь, как ты на самом деле учил географию в школе! ', 668, 750, 'arkady,viktorina,razvlecheniya,ugadaiki', 'arkady', 'http://static.apitech.ru/6F7B8E00FA1247B4B76073D2B6D5C533RU', 0.01, 1, 609, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(610, 456, 'Белый медведь', 'Belyi_medved', 'Помоги медвежонку прыгать по льдинкам', 668, 750, 'arkady,zhivotnye', 'arkady', 'http://static.apitech.ru/1DE252BC1E314C71B2F9735366BEC989RU', 0.01, 1, 610, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(611, 455, 'Построение', 'Postroenie', 'В этой игрушке тебе нужно из предлагаемых деталей построить устойчивую конструкцию. Здесь ты можешь применить свои инженерные навыки! Рассчитывай баланс и расстояние между деталями,  и тебе повезет!', 738, 710, 'arkady,vodnye,detyam,spasatelnye', 'arkady,ekonomicheskie', 'http://static.apitech.ru/1A2BA3A4354A4BA3853B7EE05ED603C0RU', 0.01, 1, 611, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(612, 454, 'Спаси квадрат', 'Spasi_kvadrat', 'Помогай квадратам выжить!', 668, 750, 'arkady,detyam,logicheskie,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/9671028FC3204E458769F6167BC3160CRU', 0.01, 1, 612, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(613, 453, 'Ниндзя официант', 'Nindzya_ofitsiant', 'Стань настоящим ниндзя', 588, 660, 'detyam,navyki,nindzya,eksheny', 'ekshn', 'http://static.apitech.ru/FFD27347C7EA4ECCBC7CA52B4FB619DCRU', 0.01, 1, 613, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(614, 452, 'Свободное падение', 'Svobodnoe_padenie', 'Тебе предстоит спрыгнуть с обрыва и отправиться в свободный полет! Управляй человечком при помощи клавиатуры, чтобы он могу ловить монетки и уворачиваться от бомб. Попытайся установить новый рекорд!', 668, 710, 'arkady,simulyatory', 'arkady', 'http://static.apitech.ru/2D40304D2FB84B60A6BD09EB53349DB5RU', 0.01, 1, 614, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(615, 451, 'Найди отличия 3', 'Naidi_otlichiya_3', 'Вам дана картинка, где девочка гуляет с собакой. Вам нужно как можно быстрее найти 5 отличий. Это не так легко, ведь на первый взгляд картинки одинаковые. Не сдавайтесь и ищите!', 728, 730, 'arkady,detyam,logicheskie,naiti', 'arkady,dlya_devochek,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/794F2E43AA444EF1A5DA3D248CA4133CRU', 0.01, 1, 615, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(616, 450, 'Порталы', 'Portaly', 'Получи власть над порталами', 688, 860, 'detyam,priklyucheniya', 'priklyucheniya,brodilki', 'http://static.apitech.ru/922E37E802834DD2AF5AF845B8D53B6ARU', 0.01, 1, 616, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(617, 449, 'Припаркуйся', 'Priparkuisya', 'Стань мастером парковки', 668, 750, 'arkady,detyam,logicheskie,mashiny,parkovka', 'arkady,logicheskie', 'http://static.apitech.ru/03BEF577E1C44FB98782EBACE79F338BRU', 0.01, 1, 617, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(618, 448, 'Они идут за тобой', 'Oni_idut_za_toboi', 'Спаси человечка', 782, 704, 'arkady,monstry,pobeg,spasatelnye', 'arkady', 'http://static.apitech.ru/752B0416F6234F07863E58CE3E3B8140RU', 0.01, 1, 618, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(619, 447, 'ПВО - сбивай самолеты', 'Pvo_-_sbivai_samolety', 'Создай свою систему ПВО', 668, 750, 'voennye,detyam,samolety,simulyatory,shutery,eksheny', 'voennye,ekshn', 'http://static.apitech.ru/61754464B8364A9A8409D58DE04DFCC9RU', 0.01, 1, 619, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(620, 446, 'Улетай  Fly Away', 'Uletai__fly_away', 'Спасай стрекоз! Не дай им погибнуть!', 834, 580, 'arkady,detyam,zhivotnye,spasatelnye', 'arkady', 'http://static.apitech.ru/1EE0DCFED5E14078B6C42D0366465961RU', 0.01, 1, 620, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(621, 445, 'Снайпер', 'Snaiper', 'Перед каждой миссией вам будут даваться подробные инструкции, типа где и кого вы должны убить. Вы должны их в точности выполнять. Помните, за проваленное задание никто денег не платит!', 668, 750, 'voennye,navyki,priklyucheniya,rolevye,simulyatory,strelyalki,shutery,eksheny', 'voennye,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/339107848FB0459C8C519174C8E20B03RU', 0.01, 1, 621, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(622, 444, 'Параллельный мир', 'Parallelnyi_mir', 'Твоя задача – помочь человечку покинуть параллельный мир. На каждом уровне собирай все светящиеся шарики, ведь без них дверь на волю никогда не откроется. Управление с клавиатуры.', 782, 704, 'arkady,monstry,pobeg,spasatelnye', 'arkady', 'http://static.apitech.ru/548A940404D84A65A313DC0D8AA46161RU', 0.01, 1, 622, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(623, 443, 'Желтый шар', 'Zheltyi_shar', 'Замечательная игра с красивой графикой', 668, 750, 'arkady,detyam,logicheskie,shariki', 'arkady,logicheskie', 'http://static.apitech.ru/D3ACFECC770B4BDFAE8D04435859EA47RU', 0.01, 1, 623, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(624, 442, 'Сумасшедшая пушка', 'Sumasshedshaya_pushka', 'Запульни и наслождайся', 668, 750, 'arkady,detyam,zhivotnye,smeshnye', 'arkady', 'http://static.apitech.ru/69C53E58E3FA4D81A79C9BA631CAD990RU', 0.01, 1, 624, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(625, 441, 'Дрифт', 'Drift', 'Стань мастером дрифта', 638, 660, 'gonki,detyam,mashiny,tryuki', 'gonki', 'http://static.apitech.ru/65B30BA3213C4E7E8867EAD80E8E2288RU', 0.01, 1, 625, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(626, 440, 'Симпсоны', 'Simpsony', 'Помоги Гомеру спасти семью от карантина, используя кран. Суть игры заключается в том, чтобы отправить бронированную машину как можно дальше. Чем дальше ты бросишь машину, тем больше очков наберешь.', 668, 750, 'arkady,detyam,multiki', 'arkady,multiki', 'http://static.apitech.ru/B08AA554FF814C328786D9D1FC65C078RU', 0.01, 1, 626, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(627, 439, 'Ночной неон', 'Nochnoi_neon', 'Светодиодный мастер', 688, 710, 'arkady,detyam,letalki,logicheskie,shariki', 'arkady,logicheskie', 'http://static.apitech.ru/7F2DF4A4D153423BB882A99CFD646C2ARU', 0.01, 1, 627, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(628, 438, 'Собиратель', 'Sobiratel', 'Хочешь славы? Тебе сюда!', 668, 750, 'arkady,detyam,letalki,logicheskie,shariki', 'arkady,logicheskie', 'http://static.apitech.ru/66EB50E2936841BD93BC514F3EE93792RU', 0.01, 1, 628, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(629, 437, 'Беги мышка беги', 'Begi_myshka_begi', 'Маленькая мышка бежит по одному из столов ресторана. Лавируй между тарелками, чтобы достигнуть края одного стола и перейти на другой. Уворачивайся от людских рук, иначе тебя отдадут кошке! ', 668, 710, 'arkady,detyam,zhivotnye,pobeg,prepyatstviya,priklyucheniya,spasatelnye', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/2080558ED2454BFF829F89E53B1A0155RU', 0.01, 1, 629, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(630, 436, 'Магнитометр', 'Magnitometr', 'Замечательная игра для любознательных ребят! Передвинь металлическую шайбу в очерченную цель при помощи магнита, при этом стараясь не касаться стен. Быстрее пройдешь уровень -  больше очков получишь!', 668, 750, 'arkady,detyam,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/6F075E281C4C4C7E81FE109C7FFA9EEDRU', 0.01, 1, 630, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(631, 435, 'Супер сложная игра', 'Super_slozhnaya_igra', 'Попробуй сделать невозможное', 588, 660, 'logicheskie', 'logicheskie', 'http://static.apitech.ru/3EF9C9268B7B419A92E9FF8BF677275FRU', 0.01, 1, 631, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(632, 434, 'Запусти кошечку', 'Zapusti_koshechku', 'Отрывайся как хочешь! Супер игра', 588, 760, 'arkady,detyam,zhivotnye,koshki,letalki,razvlecheniya,smeshnye', 'arkady', 'http://static.apitech.ru/954B121744EC41ED8272FE4B5C4917B2RU', 0.01, 1, 632, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(633, 433, 'Синий шарик', 'Sinii_sharik', 'Цель игры – кликнуть мышкой на синий шар. Это сделать не так легко, ведь он то мечется по полю, то прячется за другими шарами большего размера. Если ты промахнешься, то игра закончится.', 668, 750, 'arkady,detyam,letalki,logicheskie,navyki,naiti,shariki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/2A4A5DCCEF554E2BA054633990E97130RU', 0.01, 1, 633, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(634, 432, 'Держи ритм', 'Derzhi_ritm', 'Будь лучше всех', 668, 710, 'arkady,devochkam,detyam,krasota,moda,navyki,razvlecheniya,simulyatory', 'arkady,dlya_devochek', 'http://static.apitech.ru/B06BAB924F0142DC81A3E338C642AE15RU', 0.01, 1, 634, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(635, 431, 'Мышонок экстремал', 'Myshonok_ekstremal', 'Помоги мышенку справиться с заданиями', 668, 750, 'detyam,zhivotnye,logicheskie,naiti,prepyatstviya,spasatelnye', 'logicheskie,kvesty', 'http://static.apitech.ru/DD5B1CDB79E34FF8BF80FA3D76BCD1ACRU', 0.01, 1, 635, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(636, 430, 'Уцепись за вертолёт', 'Utsepis_za_vertolyot', 'Цель игрушки – осуществить успешную попытку уцепиться за вертолет. Для этого собери лестницу из людей, используя стрелки на клавиатуре. Сложность игры в том, что живая лестница ужасно шатается!', 608, 660, 'arkady,balans,detyam,simulyatory', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/7623D8DF09C04CC69BF7F35F293B331CRU', 0.01, 1, 636, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(637, 429, 'Тир спецназа Автомат', 'Tir_spetsnaza_avtomat', 'Тебе придется стрелять по движущейся мишени. Проблема в том, что угадать, куда же она двинется в следующую секунду невозможно. Но для настоящего бойца спецназа поразить такую мишень сущий пустяк!', 588, 750, 'arkady,vremya,detyam,navyki,oruzhie,unichtozheniya,shutery', 'arkady', 'http://static.apitech.ru/AFD6EF345BD64FF089D67919400FA6BFRU', 0.01, 1, 637, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(638, 428, 'Лихая сноубордистка', 'Likhaya_snoubordistka', 'Помоги сноубордистке доехать до финиша!', 668, 750, 'devochkam,detyam,led,letalki,navyki,prepyatstviya,razvlecheniya,simulyatory,sneg,sportivnye,tryuki', 'dlya_devochek,sportivnye,tryuki', 'http://static.apitech.ru/3314B3BBA06C4953A4B0BE076A0E1C2CRU', 0.01, 1, 638, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(639, 427, 'Крутой аэрохоккей', 'Krutoi_aerokhokkei', 'Действие происходит на космическом поле, где разгорелась нешуточная битва между двумя роботами за звание чемпиона! Твоя задача – забить как можно больше голов сопернику и не дать их забить себе.', 588, 710, 'vremya,detyam,nastolnye,razvlecheniya,simulyatory', 'arkady', 'http://static.apitech.ru/8DE7238211F940BE896AC7D62EDB1866RU', 0.01, 1, 639, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(640, 426, 'Крутой тир', 'Krutoi_tir', 'И снова Тир. Любимые игры', 588, 750, 'arkady,vremya,detyam,navyki,oruzhie,unichtozheniya,shutery', 'arkady', 'http://static.apitech.ru/0DEBB6B7AF094BD5B23964FD625C91A9RU', 0.01, 1, 640, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(641, 425, 'Реактивная собака', 'Reaktivnaya_sobaka', 'Используйте мышь, чтобы отрегулировать угол и скорость полета собаки. Используйте рикошеты от пола, стен и потолка, для того чтобы долететь до различных труднодоступных зон. Стреляйте и попадайте.', 668, 750, 'arkady,balans,detyam,zhivotnye,letalki,razvlecheniya,simulyatory,smeshnye', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/3228F58A33E04F4CB1FCB90EAB5D7B56RU', 0.01, 1, 641, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(642, 424, 'Уклонись', 'Uklonis', 'Покажи свою сноровку, стань лучше всех!', 588, 760, 'arkady,detyam,logicheskie,prepyatstviya', 'arkady,logicheskie', 'http://static.apitech.ru/4E0ED42629CA49E5BC5CE81164BADE4ERU', 0.01, 1, 642, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(643, 423, 'Злобный хомяк', 'Zlobnyi_khomyak', 'Поиграй с хомячками! Отомсти им за насмешки!', 668, 750, 'arkady,detyam,zhivotnye,naiti,razvlecheniya,smeshnye', 'arkady,kvesty', 'http://static.apitech.ru/BDD82122065A4453B9BB8C4D28BCC686RU', 0.01, 1, 643, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(644, 422, 'Удержись', 'Uderzhis', 'Вам нужно контролировать свой шарик используя стрелки. Цель – остаться на поле любым способом. Вам нужно удержаться в синей плоскости, пока красные шары будут  стремиться вытолкнуть вас.', 658, 580, 'arkady,detyam,logicheskie,prepyatstviya', 'arkady,logicheskie', 'http://static.apitech.ru/BBC9EFDB9253478B8873871724D9909DRU', 0.01, 1, 644, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(645, 421, 'Клавиатурный террор', 'Klaviaturnyi_terror', 'Испытай себя! Игра не для слабых.', 588, 650, 'arkady,bomby,detyam,zaschita', 'arkady', 'http://static.apitech.ru/A52B192CDDA2432BA73A1DF3A1FA9510RU', 0.01, 1, 645, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(646, 420, 'Найди отличия 4', 'Naidi_otlichiya_4', 'Вашему внимаю представлены картинки на социальную тему. Внимательно их посмотрите и найдите все возможные отличия между ними за отведенное вам время. Будьте очень внимательны!', 613, 750, 'detyam,logicheskie,naiti', 'dlya_devochek,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/8E76084E05B64765B26B540FCDC416A6RU', 0.01, 1, 646, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(647, 419, 'Найди отличия 5', 'Naidi_otlichiya_5', 'Внимательно рассматривайте картинки и выявляйте все отличия, которые там есть. Игра тренирует внимательность и зоркость. Кроме того, она интересна сама по себе. Приятной вам игры!', 738, 750, 'detyam,logicheskie,naiti', 'dlya_devochek,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/556067CFA94345C5A884B3330CBF0392RU', 0.01, 1, 647, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(648, 418, 'Найди отличия 6', 'Naidi_otlichiya_6', 'Если вам скучно и абсолютно нечем себя занять, то приглашаем вам сыграть в игру «найди отличия». Вашему вниманию будут представлены различные интересные картинки. Помните об ускользающем времени!', 662, 791, 'detyam,logicheskie,naiti', 'dlya_devochek,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/514ECC9846BF492280EADC1D9B360205RU', 0.01, 1, 648, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(649, 417, 'Сложнейшая игра', 'Slozhneishaya_igra', 'Вы играете за красный квадратик. Вам нужно избегать синих кружков и собирать желтые.  Как только вы соберете все кружки, то вам следует двигаться к зеленому маяку, чтобы завершить уровень.', 588, 660, 'arkady,logicheskie', 'arkady,logicheskie', 'http://static.apitech.ru/EF2E3A604F2F40FC84D1C16E6A631BA7RU', 0.01, 1, 649, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(650, 416, 'Оранжевый лабиринт', 'Oranzhevyi_labirint', 'Вы двигаетесь по лабиринту в виде желтой ленточки. Управление здесь осуществляется при помощи мышки. Вам нужно избегать разных фигур красного цвета. Чтобы закончить уровень, достигните зеленого шара.', 668, 750, 'arkady,detyam,prepyatstviya,razukrashki', 'arkady', 'http://static.apitech.ru/E12BC5DDD49042319CBA326B03DE5D26RU', 0.01, 1, 650, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(651, 415, 'Милые утята', 'Milye_utyata', 'Покажи свою смекалку.', 788, 710, 'arkady,detyam,zhivotnye,logicheskie,unichtozheniya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/C793C65F4E4D40398263B68437EAE407RU', 0.01, 1, 651, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(652, 414, 'Атака зомби', 'Ataka_zombi', 'Игрушка атака-зомби! Это прекрасная возможность расслабиться. Суть игры проста – убивать настойчиво наступающих врагов-зомби. Здесь много различных уровней, что делает игрушку забавной и интересной.', 668, 750, 'arkady,bashni,detyam,logicheskie', 'arkady,strelyalki', 'http://static.apitech.ru/55BA36F970CA4238ABCC171A93C2B9D7RU', 0.01, 1, 652, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(653, 413, 'Горящая клюшка', 'Goryaschaya_klyushka', 'Любителям хоккея! Рады предложить Вам уникальную игру Горящая клюшка. Прекрасная возможность натренировать броски по воротам! Забрось определённое количество шайб сопернику в ворота и стань чемпионом!', 588, 660, 'arkady,vremya,detyam,logicheskie,prepyatstviya,sobiralki', 'arkady,logicheskie,sportivnye', 'http://static.apitech.ru/779DF76E76C44B95B5F09FF48F32CACFRU', 0.01, 1, 653, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(654, 412, 'Воздушный лабиринт', 'Vozdushnyi_labirint', 'Лабиринт в облаках! Не думай, что все будет просто!', 688, 710, 'arkady,gonki,detyam,zhivotnye,prepyatstviya,razvlecheniya,smeshnye', 'arkady,gonki', 'http://static.apitech.ru/6064D77A637241158FBD6037B1C3C1C2RU', 0.01, 1, 654, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(655, 411, 'Супер мяч', 'Super_myach', 'Невероятная новинка! Смысл прост – собери определенное количество очков и пройди множество уровней. Также имеются ограничения в попытках (три на каждый уровень). Вы должны быть точными и расчетливыми!', 668, 750, 'arkady,detyam,zhivotnye,myach,navyki,razvlecheniya,rybalka', 'arkady', 'http://static.apitech.ru/D95082AFD33F4178ABCAC3B73AE739AERU', 0.01, 1, 655, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(656, 410, 'Супер лабиринт', 'Super_labirint', 'На первый взгляд очень простая вещица.  Необходимо провести палочку по определенному пространству, при этом, не задев границ. Но уже в начале начинаются проблемы с аккуратностью! Будьте внимательны!', 668, 750, 'arkady,bomby,detyam,zhivotnye,letalki,prepyatstviya,razvlecheniya,simulyatory,smeshnye,shutery', 'arkady', 'http://static.apitech.ru/75929986813E4406A3A3D5FF916A6B27RU', 0.01, 1, 656, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(657, 409, 'Робопушка', 'Robopushka', 'Игра робопушка очень увлекательная. Даже, несмотря на небольшую сложность уровней, само оформление игры и летающий человечек, собирающий бонусы Вам будет очень интересно поиграть в нее. Желаем удачи.', 668, 750, 'arkady,detyam,letalki,navyki,oruzhie,razvlecheniya,roboty,simulyatory,tryuki,shutery,eksheny', 'arkady,tryuki,ekshn', 'http://static.apitech.ru/9F079E4AA12A4E6EACE6EEAEBD2EF1D0RU', 0.01, 1, 657, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(658, 408, 'Ракетный удар', 'Raketnyi_udar', 'Довольно интересная игра ракетный удар. Если вы любите игрушки по типу стрелялок – то это специально для вас. Смысл игры – необходимо протянуть мышкой ракету в относительно недалеко стоящего человека.', 668, 750, 'arkady,bomby,detyam,logicheskie,mashiny,oruzhie,razvlecheniya,simulyatory,smeshnye,unichtozheniya,shutery,eksheny', 'arkady,logicheskie,ekshn', 'http://static.apitech.ru/3160760108A7478CABD3A68A7717539ERU', 0.01, 1, 658, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(659, 407, 'Радужные звёзды', 'Raduzhnye_zvyozdy', 'Радужные звёзды! Смысл игры – необходимо выждать такого момента, чтобы как много больше звездочек зажглось одновременно, а потом близко подлетающие заряжались от них и передавали энергию другим. Удачи', 668, 750, 'arkady,detyam,kosmicheskie,razvlecheniya,sobiralki', 'arkady,dlya_devochek', 'http://static.apitech.ru/474917C8B56D49C0B5CE87BC43BFFEB5RU', 0.01, 1, 659, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(660, 406, 'Сказочный зайчик', 'Skazochnyi_zaichik', 'Зайчик очень хочет допрыгать до луны!', 588, 710, 'arkady,detyam,zhivotnye,razvlecheniya', 'arkady,dlya_devochek', 'http://static.apitech.ru/669FBDAD72FC44B9BA0FD7152D41F3F8RU', 0.01, 1, 660, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(661, 405, 'Линии', 'Linii', 'Игра линии! Понравится тем, кто любит игры на сообразительность! Суть игры проста, Вам необходимо передвигать линии так, что избежать каких-либо пересечений. Множество уровней разнообразят Вам игру.)', 723, 710, 'arkady,detyam,razvlecheniya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/D3E8DED88CB9460CA202738E6A6C31E0RU', 0.01, 1, 661, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(662, 404, 'Весёлые шарики', 'Vesyolye_shariki', 'Знакомая игра с усложненными правилами!', 588, 660, 'arkady,detyam,razvlecheniya,shariki', 'arkady', 'http://static.apitech.ru/1626F952F6C74096A6088BA4B47676D2RU', 0.01, 1, 662, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(663, 403, 'Война стихий', 'Voina_stikhii', 'Вступи в противоборство двух стихий - воды и огня!', 588, 660, 'arkady,detyam,razvlecheniya,fentezi,eksheny', 'arkady,ekshn', 'http://static.apitech.ru/57D75E72534C43B5927F5F4DE5123EBBRU', 0.01, 1, 663, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(664, 402, 'Супер белка', 'Super_belka', 'Смысл игры «супер белка» заключается в управлении белкой (правая кнопка мыши) таким образом, чтобы она оказалась как можно выше. При этом необходимо прыгать по орешкам и по птичкам (удваиваются очки).', 668, 750, 'arkady,detyam,zhivotnye,razvlecheniya', 'arkady,dlya_devochek', 'http://static.apitech.ru/F808E43868F8470BA32A2E830BC477D5RU', 0.01, 1, 664, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(665, 401, 'Весёлый роллер', 'Vesyolyi_roller', 'Если Вы заядлый роллер и любите преодолевать любого рода препятствия – эта игрушка для Вас! Необходимо проехать как можно большую дистанцию не споткнувшись обо что-либо, или не свалившись куда-нибудь.', 668, 750, 'arkady,gonki,detyam,navyki,prepyatstviya,razvlecheniya,sportivnye', 'arkady,gonki,sportivnye', 'http://static.apitech.ru/0CDDF7BC603442CA9C03C2F39D1CBD5CRU', 0.01, 1, 665, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(666, 400, 'Зацени сиськи', 'Zatseni_siski', 'Весьма увлекательная игрушка! Смысл заключается в том, чтобы как можно аккуратнее подсмотреть за привлекательной соседкой по дивану и не запалиться! Развивайте свою реакцию и останетесь незамеченными!', 548, 706, 'arkady,balans,krasota,obolschenie,razvlecheniya,smeshnye', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/2116F1D001BF4BD9ABCB1EFAF094D083RU', 0.01, 1, 666, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(667, 399, 'Пейнтбол', 'Peintbol', 'Интересная игрушка пейнтбол! Проверьте себя на быстроту реакции и бдительность! Убейте всех соперников и станьте первым! Множество уровней различной сложности усложнит Вам путь к победе! Желаем удачи!', 608, 870, 'arkady,detyam,navyki,oruzhie,razvlecheniya,simulyatory,strelyalki,ugadaiki,shutery,eksheny', 'arkady,strelyalki,ekshn', 'http://static.apitech.ru/AB09EAFAD7EC4B45964657EE01CC7102RU', 0.01, 1, 667, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(668, 398, 'Супер Робот', 'Super_robot', 'Смысл заключается в том, чтобы передвигаться по маленькой комнате вместе с бомбами (нельзя трогать, иначе будет бум и конец игры) собирая бонусы и ключики. И с каждым уровнем число бомб увеличивается!', 668, 750, 'arkady,detyam,zaschita,multiki,oruzhie,pobeg,prepyatstviya,razvlecheniya,roboty,strelyalki', 'arkady,multiki,strelyalki', 'http://static.apitech.ru/ADB33D5D81FE4026AE661F23B0E2863CRU', 0.01, 1, 668, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(669, 397, 'Черный спринтер', 'Chernyi_sprinter', 'Увлекательная новинка! Управляйте черным птицем из банды ямакаси (с помощью мышки), перепрыгивайте через крыши, собирайте все возможные очки и получите незабываемые впечатления от игры «черный спринтер».', 668, 750, 'arkady,detyam,navyki,razvlecheniya', 'arkady,brodilki', 'http://static.apitech.ru/53421848A6944918B12479C1532AAEFDRU', 0.01, 1, 669, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(670, 396, 'Биобашня', 'Biobashnya', 'Построй самую высокую биобашню!', 668, 750, 'arkady,balans,detyam,zaschita,razvlecheniya,simulyatory', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/0944E442258249DDA92BF5C6BE008F12RU', 0.01, 1, 670, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(671, 395, 'Трюкачи', 'Tryukachi', 'Игрушка для любителей экстремального вождения! Управляй машиной и выполняй различные уровни, различной сложности! Управлять машиной довольно просто, регулируйте скорость машины с помощью смайлика! =)', 588, 710, 'arkady,detyam,prepyatstviya,razvlecheniya', 'arkady,tryuki', 'http://static.apitech.ru/3F379A8E53E44F969EF2A531F7AB53E5RU', 0.01, 1, 671, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(672, 394, 'Монстро-дробилка', 'Monstro-drobilka', 'Уничтожай мумий и дроби монстров!', 668, 750, 'arkady,zaschita,monstry,oruzhie,razvlecheniya,strelyalki,uzhastiki,unichtozheniya,shutery,eksheny', 'arkady,strelyalki,ekshn', 'http://static.apitech.ru/D5A8A88BB93E4AE0B3B61AA67B952A07RU', 0.01, 1, 672, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(673, 393, 'Воздушные шарики', 'Vozdushnye_shariki', 'Красивая игра про воздушные шарики', 688, 750, 'arkady,detyam,letalki,logicheskie,razvlecheniya,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/CD09E03951C54D9583266CBA3529DB8CRU', 0.01, 1, 673, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(674, 392, 'Реактивная черепаха', 'Reaktivnaya_cherepakha', 'Реактивная черепаха - это супермен из мира Фауны!', 669, 752, 'arkady,detyam,zhivotnye,letalki,razvlecheniya', 'arkady', 'http://static.apitech.ru/19D6C18C1A9D441C8D65F0D4BB599D55RU', 0.01, 1, 674, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(675, 391, 'Помидоромёт', 'Pomidoromyot', 'Помидоромёт – игра с современными звёздами! Проверьте свою точность и меткость! Выберите звезду, которая Вам больше всего нравится, и кидайте помидоры, только не в саму звезду, а в номера возле неё.)', 668, 750, 'arkady,detyam,oruzhie,razvlecheniya', 'arkady', 'http://static.apitech.ru/8073329B2F7B431AB875E353379D571FRU', 0.01, 1, 675, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(676, 390, 'Реакция', 'Reaktsiya', 'Постарайтесь удержать шарик на палочке, которая наклоняется в противоположную сторону от движущейся панельки, которую двигаете Вы, чтобы не упал вниз летающий сверху шарик. Развивайте реакцию, удачи!', 668, 750, 'arkady,detyam,logicheskie,navyki,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/FCB89E48DE0A420E89C6FA456FFB6F28RU', 0.01, 1, 676, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(677, 389, 'Шматрица', 'Shmatritsa', 'Побывай в Шматрице и убереги своего человечка от опасностей!', 668, 750, 'arkady,detyam,parodii,razvlecheniya', 'arkady', 'http://static.apitech.ru/BCE9CDC406A4467EA32FC1D756EC0589RU', 0.01, 1, 677, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(678, 388, 'Уличный теннис', 'Ulichnyi_tennis', 'Почувствуй себя теннисистом на тренировке!', 668, 750, 'arkady,detyam,myach,razvlecheniya', 'arkady', 'http://static.apitech.ru/BC11226E6F744312B51989E375605FDCRU', 0.01, 1, 678, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(679, 387, 'Град пуль', 'Grad_pul', 'Всё тот же человек-амфибия! Спаси его от непонятных пуль, перетаскивая его по полю! Постепенно количество пуль будет увеличиваться, а также и скорость полёта, так что берегитесь и спасайте человечка!', 668, 750, 'arkady,oruzhie,razvlecheniya', 'arkady', 'http://static.apitech.ru/55CD0396911C422AA0E42034296C28E7RU', 0.01, 1, 679, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(680, 386, 'Притяжение', 'Prityazhenie', 'Преодолей силу притяжения и доберись до финиша!', 688, 760, 'arkady,detyam,logicheskie,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/35954AB6B00C43BEA9DDE2760D810514RU', 0.01, 1, 680, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(681, 385, 'Апстену', 'Apstenu', 'Игрушка «Апстену»! Смысл игры: постарайся пронести своего человечка так, чтобы его не придавило стенкой, и он остался жив как можно дольше! Но это не все так просто, постепенно сложность увеличивается', 668, 750, 'arkady,detyam,zhivotnye,prepyatstviya,priklyucheniya,fentezi', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/A8D9C8CE5C824946AD892691836C1CE8RU', 0.01, 1, 681, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(682, 384, 'Вынос мозга', 'Vynos_mozga', 'Весьма актуальное название игры сейчас – это Вынос мозга! На самом деле суть игры проста: вам необходимо под разными ракурсами игрового поля двигать свой прямоугольник, чтобы он ни с кем не столкнулся', 668, 750, 'arkady,detyam,zhivotnye,logicheskie,naiti,simulyatory,sobiralki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/8C9E7E852E594ED1B6FB306DF9DF2E8FRU', 0.01, 1, 682, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(683, 383, 'Шустрый оконщик', 'Shustryi_okonschik', 'Увлекательная игрушка «шустрый оконщик»! Вам необходимо оттереть все окна до блеска, при этом в доме находятся люди, которые периодически открывают окна. Будьте осторожны и не упадите с рабочего места', 588, 710, 'arkady,balans,detyam,logicheskie,mashiny,navyki,parkovka', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/14A2C9F9BEC9479C808C6613D8ECA277RU', 0.01, 1, 683, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(684, 382, 'Атака мячей', 'Ataka_myachei', 'Игрушка «Атака мячиками»! Это до воли таки сложная игра! Здесь необходимо управлять большим количеством тёмных шариков, чтобы они не выбили с выделенной территории единственный неподвижный белый шарик', 588, 710, 'arkady,detyam,myach,navyki,prepyatstviya,smeshnye,spasatelnye', 'arkady', 'http://static.apitech.ru/1D549BEDEEDE428DAB759C73AFEC116DRU', 0.01, 1, 684, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(685, 381, 'Лазер-Шмазер', 'Lazer-shmazer', 'Интересная игрушка «Лазер-шмазер»! Вам необходимо уворачиваться человечком от летящего дождя из лазеров, но при этом и не забывать об очках! С каждым уровнем скорость движения и направление изменяются', 668, 750, 'arkady,vodnye,detyam,oruzhie,razvlecheniya,unichtozheniya,shariki,shutery', 'arkady', 'http://static.apitech.ru/CC40CDF4292145828A7A9998DF3D8A53RU', 0.01, 1, 685, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(686, 380, 'Мастер YOYO', 'Master_yoyo', 'Захватывающая игра Мастер YOYO! Двигаясь на лодке необходимо отбиться от всех врагов с помощью  YOYO, и спасти возлюбленную мастера. Но помни: враги кидаются бомбами, которые могут Вас скинуть! Удачи!', 588, 710, 'arkady,balans,detyam,logicheskie,navyki,simulyatory,spasatelnye,fentezi,shariki', 'arkady,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/794E938DE1884DBCA3B0B75FB03300A5RU', 0.01, 1, 686, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(687, 379, 'Затерянный мир', 'Zateryannyi_mir', 'Летай по живописнымпейзажам на маленькой и юркой ракете!', 668, 750, 'vremya,detyam,naiti,prepyatstviya,priklyucheniya,puzyri,razvlecheniya,simulyatory,unichtozheniya', 'priklyucheniya,brodilki,kvesty', 'http://static.apitech.ru/48C4FF0797854848A43AC09FE2BBAA79RU', 0.01, 1, 687, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(688, 378, 'Лабиринтик', 'Labirintik', 'Игра «лабиринтик» - это весьма увлекательное занятие! Вам необходимо мышкой провести точку с начала лабиринта в конец, при этом нельзя касаться ни границ лабиринта, ни объектов, которые находятся там.', 638, 600, 'arkady,vremya,detyam,zhivotnye,logicheskie,prepyatstviya,razvlecheniya,simulyatory,unichtozheniya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/CF89AE2CD2914753BEA380ADCCF53224RU', 0.01, 1, 688, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(689, 377, 'Оранжевый чудак', 'Oranzhevyi_chudak', 'У оранжевого Чудака аллергия на фрукты! Уворачивайся от них!', 668, 750, 'arkady,detyam,letalki,multipleer,razvlecheniya,samolety', 'arkady,dlya_devochek', 'http://static.apitech.ru/D3B52BA6D1504F92A30C0CDB20A98211RU', 0.01, 1, 689, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(690, 376, 'Ловкач', 'Lovkach', 'Прояви ловкость и пройди все уровни!', 668, 750, 'arkady,detyam,logicheskie,navyki,prepyatstviya,razvlecheniya', 'arkady,logicheskie', 'http://static.apitech.ru/77B3C535A9D04E538F55DF5EFE622335RU', 0.01, 1, 690, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(691, 375, 'ДисКОТЭка', 'Diskoteka', 'Увлекательная игрушка «ДисКОТэка» специально для тех, кто хорошо двигается по танц. полу. Управляйте котом и собирайте только синие шарики, которые падают ему на голову, иначе будет сотрясение мозга!', 588, 710, 'arkady,basketbol,detyam,zhivotnye,parodii,razvlecheniya,simulyatory,sportivnye', 'arkady,sportivnye', 'http://static.apitech.ru/E92CE6A69E0F42FAB59BA1EAE451B214RU', 0.01, 1, 691, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(692, 374, 'Гусиная миграция', 'Gusinaya_migratsiya', 'Начало заморозок, дикие гуси мёрзнут! Помоги им аккуратно улететь на юг! Собери свою стаю, при этом, когда будете лететь нельзя ничего касаться. Будьте внимательны и у Вас всё получится! Теплой зимы! ', 668, 750, 'arkady,volshebstvo,gonki,detyam,zhivotnye,letalki,logicheskie,prepyatstviya,sobiralki,uzhastiki,fentezi', 'arkady,gonki,logicheskie', 'http://static.apitech.ru/75DE3B3E4EC74A5A952F54BC4A41E6CERU', 0.01, 1, 692, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(693, 373, 'Парковщик', 'Parkovschik', 'Покажи мастерство парковки! Припаркуй определённое число машин за отведенный период времени! При этом нельзя врезаться, иначе игра будет начинаться заново! С каждым уровнем времени будет не хватать!', 668, 750, 'arkady,detyam,logicheskie,naiti,prepyatstviya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/B393AAD157564D5DBC2D02557D3C6AA5RU', 0.01, 1, 693, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(694, 372, 'Пираньи', 'Pirani', 'Поплавай маленькой рыбкой в большом аквариуме! Только будь крайне аккуратен, так как ты не один, и тебе угрожает опасность быть съеденным. Но и не забывай себя кормить рыбками, которые мельче тебя.)', 588, 660, 'arkady,zhivotnye,razvlecheniya,simulyatory,strelyalki,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/C0A3C3A8831344DD9C8C193CE41FE7E8RU', 0.01, 1, 694, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(695, 371, 'Веселые лесные друзья', 'Happy_tree_friends', 'Игрушка «Весёлые лесные друзья»! Помоги танцующему котику не получить сотрясение мозга. Во время танца ему на голову падают различные шарики, но ему необходимо ловить только синие! Будьте внимательны!', 588, 710, 'arkady,vremya,zhivotnye,multiki,razvlecheniya,smeshnye,unichtozheniya', 'arkady,multiki', 'http://static.apitech.ru/25116362D8E1470686904BFB29E56D86RU', 0.01, 1, 695, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(696, 370, 'Воробей-обжора', 'Vorobei-obzhora', 'Накорми бедного воробушка! На каждый уровень даётся определённое время, чтобы продержаться на платформе. Это до воли таки сложно, потому что не пойманные фрукты разбивают платформу. Будьте аккуратны!', 669, 752, 'arkady,vremya,detyam,zhivotnye,razvlecheniya,smeshnye,unichtozheniya', 'arkady', 'http://static.apitech.ru/09F00AD156A241C1BC81A373C072D383RU', 0.01, 1, 696, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(697, 369, 'Космопонг 3D', 'Kosmopong_3d', 'Попробуй сыграть в пинг-понг в трехмерном пространстве!', 669, 752, 'balans,detyam,myach,navyki,razvlecheniya,simulyatory,sportivnye,futbol', 'sportivnye,fizicheskie_igry', 'http://static.apitech.ru/28351632B22247B0A6BFBEA5A39C18FCRU', 0.01, 1, 697, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(698, 368, 'На ветру', 'Na_vetru', 'Собирай звезды, удерживайся на ветру!', 669, 752, 'arkady,detyam,dragotsennosti,kino,naiti,prepyatstviya,priklyucheniya,sobiralki', 'arkady,priklyucheniya,brodilki,kvesty', 'http://static.apitech.ru/7AFAC582C57E4FA6A2A7037CDBFD2643RU', 0.01, 1, 698, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(699, 367, 'Пингвинята', 'Pingvinyata', 'Увлекательная игрушка Пингвинята! Помоги им перебраться на правую льдину. Необходимо передвигать льдинку, чтобы пингвинятки прыгали на неё и отскакивали, тем самым передвигались к своей льдине. Удачи!', 669, 752, 'arkady,detyam,zhivotnye,zaschita,kuritsa,multiki,smeshnye,sneg,sobiralki', 'arkady,dlya_devochek,multiki', 'http://static.apitech.ru/48CC25836FFF4729BE8186A971FF1102RU', 0.01, 1, 699, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(700, 366, 'Мышиная атака', 'Myshinaya_ataka', 'Мышиная атака! Вам необходимо защитить кусочек сыра от наступления мышь! Нужно их убивать вилкой! В каждом уровне количество убитых мышей увеличивается, так что сконцентрируйтесь и убейте всех мышей!', 669, 752, 'arkady,drobovik,zhivotnye,zaschita,monstry,oruzhie,priklyucheniya,sobiralki,strelyalki,unichtozheniya,shutery,eksheny', 'arkady,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/7778C9B74EF246958D0F2A3FE94B006ARU', 0.01, 1, 700, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(701, 365, 'Убегай', 'Ubegai', 'Спасайся от нашествия цветных шаров!', 669, 752, 'arkady,gonki,detyam,logicheskie,navyki,pobeg', 'arkady,gonki,logicheskie', 'http://static.apitech.ru/5F6125C2C8C4447F82AE3EB727252801RU', 0.01, 1, 701, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(702, 364, 'Надувание', 'Naduvanie', 'Увлекательная игрушка «Надувание»! Правила очень просты: Вам нужно собирать подряд шарики одного цвета. Также шарики, которые появляются сразу, постепенно надуваются, тем самым принося больше очков!', 669, 752, 'arkady,vremya,detyam,zhivotnye,logicheskie,navyki,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/3A17F04068A54D6187A5CD7BA383D016RU', 0.01, 1, 702, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(703, 363, 'Жрём мух', 'Zhryom_mukh', 'Накорми лягушку до отвала мухами в игрушке «Жрём мух»! Управлять очень просто: нажимая на голову лягушки, она достаёт язык и ест, Вам остаётся рассчитать, когда нажать, чтобы съесть как можно больше!)', 669, 752, 'arkady,vremya,zhivotnye,zamki,zaschita,naiti,smeshnye,unichtozheniya,eksheny', 'arkady,ekshn,kvesty', 'http://static.apitech.ru/E8BB63B9C72949438450A25A3829D25BRU', 0.01, 1, 703, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(704, 362, 'Веселый Вьетнам', 'Veselyi_vetnam', 'Необходимо провести через полосу с минами, бомбами и иными взрывчатыми устройствами трёх солдат! Сложность в том, что нужно управлять сразу всеми, т.к. двигая одним солдатом, вы передвигаете остальных', 588, 710, 'arkady,voennye,detyam,logicheskie,oruzhie,priklyucheniya,smeshnye,sobiralki', 'arkady,voennye,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/FD23A8DFD0834F98A1B684EABB7CC104RU', 0.01, 1, 704, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(705, 361, 'Закинь свинку', 'Zakin_svinku', 'Вроде бы простая, но вместе с тем и завораживающая игра «Закинь свинку»! Правила очень просты: Вам необходимо запустить свинку на максимально далёкое расстояние, дабы победить своих соперников! Удачи!', 668, 750, 'arkady,detyam,zhivotnye,zaschita,korabli,letalki,logicheskie,prepyatstviya,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/E82BC3E53B4A4F1D8E85B3DA0C4185B8RU', 0.01, 1, 705, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(706, 360, 'По порядку', 'Po_poryadku', 'Найди все числа и сделай это быстрее своих друзей!', 841, 852, 'arkady,gotovka,detyam,logicheskie,razvlecheniya,sobiralki,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/6BC29C9AAA924CFCBD737117926DEF74RU', 0.01, 1, 706, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(707, 359, 'Футбольная дуэль', 'Futbolnaya_duel', 'Обыграй в футбол девчонку! Думаешь это так просто? Попробуй!', 668, 750, 'detyam,myach,navyki,simulyatory,sportivnye,futbol', 'sportivnye', 'http://static.apitech.ru/924563DE7D2D43ACBE7CAB2058CBE426RU', 0.01, 1, 707, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(708, 358, 'Мастер Дартса', 'Master_dartsa', 'Игрушка для тех, кто любит отдохнуть! Правила очень просты – набери максимальное число очков и выиграй! Для броска необходимо держать левую кнопку мыши, затем сделать резкое движение вверх и отпустить', 668, 750, 'balans,darts,detyam,logicheskie,razvlecheniya,simulyatory,sportivnye', 'logicheskie,sportivnye,fizicheskie_igry', 'http://static.apitech.ru/B3162F94C05E4EE1B30E5352A3405560RU', 0.01, 1, 708, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(709, 357, 'Симпсоны прыжок Мардж', 'Simpsony_pryzhok_mardzh', '«Симпсоны прыжок Мардж» - игрушка для тех, кто быстро переключается и внимателен! Всё очень просто необходимо нажимая на кнопку «клик» разгонять Мардж, а потом, достигнув максимума, совершить прыжок.', 668, 750, 'arkady,vremya,detyam,multiki,prepyatstviya,priklyucheniya,razvlecheniya,simulyatory', 'arkady,multiki,priklyucheniya,brodilki', 'http://static.apitech.ru/F0E19DA9C5774CD885B094D886EA0416RU', 0.01, 1, 709, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(710, 356, '21', '21', 'Если Вы внимательны и любите считать, то эта игрушка для Вас! Необходимо собрать все возможные комбинации цифр, чтобы в сумме они давали 21. Чем больше циферок будет в комбинации, тем больше очков. =)', 688, 710, 'karty,logicheskie,nastolnye', 'logicheskie,kartochnye', 'http://static.apitech.ru/EE34882B8B824382B7955B47F6F8100DRU', 0.01, 1, 710, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(711, 355, 'Глазомер', 'Glazomer', 'Проверь свой глазомер на математических задачках!', 588, 610, 'arkady,balans,vremya,detyam,logicheskie,priklyucheniya', 'arkady,logicheskie,priklyucheniya', 'http://static.apitech.ru/474A35BEB0AD43CB893A75835ADB60A2RU', 0.01, 1, 711, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(712, 354, 'Набивание мяча', 'Nabivanie_myacha', 'Научись чеканить футбольный мяч также, как лучшие футболисты!', 669, 752, 'arkady,balans,vodnye,vremya,detyam,multiki,myach,navyki,razvlecheniya,simulyatory,sportivnye,futbol', 'arkady,multiki,sportivnye,fizicheskie_igry', 'http://static.apitech.ru/7FAADC8DDAA4455C89772AA4FC315FE0RU', 0.01, 1, 712, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(713, 353, 'Стрельбище', 'Strelbische', 'Игрушка «Стрельбище» для людей, которые любят точность и метко стрелять в цель! Вам необходимо пройти 3 уровня различной сложности (разное расстояние до мишени) и отстрелять как можно больше очков!)', 588, 750, 'arkady,detyam,zhivotnye,navyki,oruzhie,prepyatstviya,razvlecheniya,simulyatory,strelyalki,unichtozheniya', 'arkady,strelyalki', 'http://static.apitech.ru/AAB53FDEA4A74784848BD90F3153D018RU', 0.01, 1, 713, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(714, 352, 'Тир спецназа Дробаш', 'Tir_spetsnaza_drobash', '"""Три спецназ Дробаш""! Суть не заключается в том, чтобы отстрелять как можно больше очков, просто в конце игры будет выставляться процент аккуратности. Сложность в том, что мишень хаотично двигается!"', 588, 750, 'arkady,armiya,voennye,navyki,oruzhie,razvlecheniya,simulyatory,strelyalki,unichtozheniya', 'arkady,voennye,strelyalki', 'http://static.apitech.ru/34F1540D2CBD47DA83EE99983E62B32ERU', 0.01, 1, 714, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(715, 351, 'Веселая мышка', 'Veselaya_myshka', 'Пройди загадочный лабиринт, управляя мышкой мышкой :)', 588, 710, 'arkady,zhivotnye,prepyatstviya,smeshnye,sobiralki', 'arkady', 'http://static.apitech.ru/23FCF88EFA8045BE8299AF56854B1D72RU', 0.01, 1, 715, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(716, 350, 'Черепаший мост', 'Cherepashii_most', 'Вам необходимо перенести как можно больше кирпичей своему другу на другом берегу. Назад нужно возвращаться таким же образом. Главное не утонуть. Трудность в том, что черепахи хаотично уходят подводу.', 588, 660, 'arkady,detyam,zhivotnye,prepyatstviya', 'arkady', 'http://static.apitech.ru/E22CCC4D4FB1488AB80AEC28577FCF68RU', 0.01, 1, 716, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(717, 349, 'Симпсоны Красти', 'Simpsony_krasti', 'Не любишь пищу быстрого приготовления? Тогда эта игрушка для тебя! Управляя Симпсоном, выкидывай гамбургеры как можно дальше, при этом набирай очки! Оптимальная сила и высота на зелёненькой отметке!', 668, 750, 'arkady,vremya,detyam,multiki,priklyucheniya,smeshnye', 'arkady,multiki,priklyucheniya,brodilki', 'http://static.apitech.ru/D51CD5BE12FE462CAE7618BB599A586ARU', 0.01, 1, 717, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(718, 348, 'Симпсоны Карамба', 'Simpsony_karamba', 'Помоги Карамбе проехать дистанцию и собрать очки! Управление очень просто, удерживая мышку на кнопке клик, вы выбираете уровень прыжка, чем больше заполнится перед отпуском мышки, тем выше он прыгнет!', 668, 750, 'arkady,detyam,mashiny,multiki,priklyucheniya,smeshnye', 'arkady,multiki,priklyucheniya,brodilki', 'http://static.apitech.ru/56D9D118773B44088FB06FA919441AD2RU', 0.01, 1, 718, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(719, 347, 'Симпсоны Гомер спешит за пивом', 'Simpsony_gomer_speshit_za_pivom', 'Гомер готов лететь, чтобы успеть за прохладным напитком!', 668, 750, 'detyam,zaschita,monstry,multiki,priklyucheniya,smeshnye,spasatelnye,strelyalki,eksheny', 'multiki,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/F601C6C65E0343F59B25202C22057617RU', 0.01, 1, 719, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(720, 346, 'Смертельный прыжок', 'Smertelnyi_pryzhok', 'В этой игре даётся три прыжка с парашютом! Вам необходимо как можно точнее посалить своего игрока на землю. Управление осуществляется мышкой и пробелом (для открытия парашюта). Желаем мягкой посадки!', 668, 710, 'arkady,detyam,navyki,prepyatstviya,razvlecheniya,simulyatory,eksheny', 'arkady,ekshn', 'http://static.apitech.ru/BDE689BE5848469EA4C9AED50ABC26B3RU', 0.01, 1, 720, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(721, 345, 'Найди отличия Бикини', 'Naidi_otlichiya_bikini', 'Проверьте себя на внимательность! На каждом уровне Вам необходимо найти пять отличий, при этом время фиксировано, и стремительно уменьшается! Ваше внимание будет занято другим, мы это Вам гарантируем!', 692, 757, 'arkady,detyam,logicheskie,razvlecheniya', 'arkady,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/D33B92D2A10D43279749D7CD56461FCFRU', 0.01, 1, 721, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(722, 344, 'Быки и коровы', 'Byki_i_korovy', 'Игра на сообразительность! Отгадайте число! Оно состоит из четырёх цифр! Если вы угадываете цифру, но она не на правильном месте – это обозначается коровой, а если и место и цифра совпадают – это бык!', 669, 752, 'arkady,detyam,zhivotnye,prepyatstviya,priklyucheniya,smeshnye,spasatelnye', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/7269DA0C059C4B0994A82AF9811FEB97RU', 0.01, 1, 722, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(723, 343, 'Нашествие мух', 'Nashestvie_mukh', 'Лето - отличное время тренировать свои навыки владения мухобойкой!', 669, 752, 'arkady,detyam,zhivotnye,letalki,prepyatstviya,razvlecheniya,smeshnye', 'arkady', 'http://static.apitech.ru/3E233E269866454C8E1A8E1CE285B7F9RU', 0.01, 1, 723, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(724, 342, '8бит Киллер', '8bit_killer', 'Спаси 8битную галактику от атак злобных захватчиков!', 588, 660, 'arkady,detyam,razvlecheniya,smeshnye', 'arkady', 'http://static.apitech.ru/3961AF137B59419E8F9A6DF92F92E20FRU', 0.01, 1, 724, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(725, 341, 'Замочи Клоуна', 'Zamochi_klouna', 'Тебе не нравятся клоуны? Отыграйся на них здесь!', 668, 750, 'arkady,navyki,prepyatstviya,smeshnye,eksheny', 'arkady,ekshn', 'http://static.apitech.ru/0130A3ED0C7C432283A2A7BF02533393RU', 0.01, 1, 725, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(726, 340, 'Охота За Костями', 'Okhota_za_kostyami', 'Докажи себе и всем остальным, что живые существа намного активнее реагируют на действия окружающей среды, чем роботы! Смысл игры заключается в том, что Вы (собака) должны быстрее робота забрать кость!', 668, 750, 'arkady,detyam,logicheskie,navyki,naiti,prepyatstviya,razvlecheniya,simulyatory,sobiralki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/3389AF1A8FD7499FB43390FB4F31687BRU', 0.01, 1, 726, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(727, 339, 'Морской рыбак', 'Morskoi_rybak', 'Заядлым любителям рыбалки! Закидывайте удочку и вытягивайте маленькую и большую рыбёшку, а также получайте за это очки! Не забывайте следить за расстоянием и натяжением лески (зависит от веса рыбы)!', 668, 750, 'arkady,vodnye,detyam,zhivotnye,logicheskie,monstry,navyki,prepyatstviya,priklyucheniya,rybalka,simulyatory,sobiralki', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/40679BD1E92E4DEBBB7BE2B6B5C69BAERU', 0.01, 1, 727, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(728, 338, 'Сорвиголова', 'Sorvigolova', 'Устрой кровавое месиво! Стреляй и зарабатывай!', 728, 717, 'draki,priklyucheniya,eksheny', 'draki,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/004AE96EDE9D4FC8A837C782B9CB0DC4RU', 0.01, 1, 728, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(729, 337, 'Космический баскетбол', 'Kosmicheskii_basketbol', 'Увлекательная игрушка Космический баскетбол! Развивай свою меткость и точность бросков. Собирай очки и проходи различные сложные уровни! Управление простое, мышкой задать направление мячику и кинуть.', 668, 750, 'arkady,basketbol,detyam,kino,kosmicheskie,logicheskie,myach,navyki,priklyucheniya,razvlecheniya,sportivnye', 'arkady,logicheskie,priklyucheniya,sportivnye,brodilki', 'http://static.apitech.ru/0C637018D6F04015AECA75701EC8FBC4RU', 0.01, 1, 729, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(730, 336, 'Запрыг', 'Zapryg', '"Ещё одна интересная игрушка ""Запрыг"". Она до воли таки сложная. Управление вроде бы простое, но для того чтобы получилось хорошо необходимо тренироваться! Научитесь перепрыгивать мусорные баки города."', 668, 750, 'arkady,detyam', 'arkady', 'http://static.apitech.ru/5B59BEC98C9648FFAEADEA42A67B27CDRU', 0.01, 1, 730, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(731, 335, 'Охота за рыбой', 'Okhota_za_ryboi', 'Постарайтесь прокормить своего кота-любимца, управляя мышкой! Сложность в том, что еда появляется внезапно и Вам необходимо опередить чужого кота. Иначе Ваш кот умрёт с голоду, и Ваша игра закончится!', 668, 750, 'arkady,vodnye,detyam,zhivotnye,logicheskie,navyki,simulyatory,sobiralki', 'arkady,logicheskie', 'http://static.apitech.ru/645E872A4B3E4C6CA787AC8376031F56RU', 0.01, 1, 731, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(732, 334, 'Резкий и Дерзкий', 'Rezkii_i_derzkii', 'Неважно, кто ты! Главное быстро бегать!', 668, 710, 'arkady,detyam,letalki,prepyatstviya', 'arkady', 'http://static.apitech.ru/F90D3D3B3B1644C4879B9C12517694E2RU', 0.01, 1, 732, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(733, 333, 'Пингви', 'Pingvi', 'Говорят, что прыжки в воду с трамплина зародились в Антарктиде... Среди пингвинов :)', 668, 710, 'arkady,detyam,zhivotnye,letalki,multiki,sneg,sobiralki', 'arkady,multiki', 'http://static.apitech.ru/A0DF7157E5C940B4801834E35151FB6BRU', 0.01, 1, 733, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(734, 332, 'Лыжный слалом', 'Lyzhnyi_slalom', 'До Олимпиады в Сочи еще далеко, но тренировки можно начинать уже сегодня!', 668, 750, 'gonki,detyam,prepyatstviya,razvlecheniya,simulyatory,sneg,sportivnye,tryuki', 'gonki,sportivnye,tryuki', 'http://static.apitech.ru/497AA27B48B64D8C8CEF8935AA64D752RU', 0.01, 1, 734, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(735, 331, 'Скейтер рампа', 'Skeiter_rampa', 'Новые приключения отважного Скейтера!', 588, 710, 'balans,detyam,navyki,prepyatstviya,razvlecheniya,simulyatory,skeitbordy,sportivnye,tryuki', 'sportivnye,tryuki,fizicheskie_igry', 'http://static.apitech.ru/FC7ECA655C864D6D8849FF6CBEBAB433RU', 0.01, 1, 735, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(736, 330, 'Веселая рыбалка', 'Veselaya_rybalka', 'В России рыбалка - это всегда весело!', 588, 750, 'arkady,vodnye,detyam,zhivotnye,navyki,prepyatstviya,razvlecheniya,simulyatory,sobiralki', 'arkady', 'http://static.apitech.ru/E8A2EB5A772F4176A0E0F185377514F9RU', 0.01, 1, 736, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(737, 329, 'Шайбу', 'Shaibu', 'Шайбу! Шайбу! Шайбу! Россия, вперед!', 548, 680, 'detyam,logicheskie,navyki,sportivnye', 'logicheskie,sportivnye', 'http://static.apitech.ru/13BBA70F7F1D467ABD39F4F44E42828BRU', 0.01, 1, 737, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(738, 328, 'Бегущий человек', 'Beguschii_chelovek', 'Помоги бегущему человеку добежать до конца лабиринта. Причём выходить за рамки нельзя! Чем ближе подводить мышку к человеку, тем медленнее он будет бежать, но не остановится, и наоборот! Удачной игры!', 668, 710, 'arkady,gonki,detyam,prepyatstviya,fentezi,eksheny', 'arkady,gonki,ekshn', 'http://static.apitech.ru/6DDDA944F4EB4D6FAEE0B820C4C46F18RU', 0.01, 1, 738, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(739, 327, 'Чеканка мяча 3D', 'Chekanka_myacha_3d', 'Играй в «чеканку мяча 3D». Эта игрушка научит тебя набивать мячик о стену множество раз, не потеряв его ни разу. Помни, что чем больше ты набьёшь раз без потерь, тем больше очков ты получишь! Удачи!)', 668, 750, 'arkady,detyam,logicheskie,myach,navyki,sportivnye', 'arkady,logicheskie,sportivnye', 'http://static.apitech.ru/C37EED483DD7412D9FE87E853ED1DEB1RU', 0.01, 1, 739, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(740, 326, 'Горчичник', 'Gorchichnik', 'Играй в игру горчичник и научись аккуратно вести мячик по полю! Чем дальше проведёшь по полю мяч, тем больше очков получишь. Но помни, что нельзя получать жёлтые карточки, так что старайся обходить их', 668, 750, 'arkady,detyam,logicheskie,prepyatstviya,priklyucheniya', 'arkady,logicheskie,priklyucheniya,brodilki', 'http://static.apitech.ru/4158DA52C6FE4DDE870EBA14EBFED7FFRU', 0.01, 1, 740, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(741, 325, 'Закинь змею', 'Zakin_zmeyu', 'Соревнуйся с друзьями: кто дальше кинет Змеюку? :)', 588, 710, 'arkady,detyam,zhivotnye,logicheskie,prepyatstviya', 'arkady,logicheskie', 'http://static.apitech.ru/F6453B59864C44DCBDB6799B3384ABE7RU', 0.01, 1, 741, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(742, 324, 'Пони тоже кони', 'Poni_tozhe_koni', 'Убедись, что пони удивительные! Проходи дистанцию, собирай яблоки (восстанавливай энергию), перепрыгивай различные препятствия и приходи к финишу первым! Один щелчок – простой прыжок, два – высокий!', 488, 710, 'arkady,detyam,zhivotnye,zaschita,prepyatstviya,spasatelnye', 'arkady,dlya_devochek', 'http://static.apitech.ru/A72EFD4EFD7A4F98B60087523706CF89RU', 0.01, 1, 742, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(743, 323, 'Полет Да Винчи', 'Polet_da_vinchi', 'Увлекательные полены на Дельтаплане! Бесплатно только здесь! :)', 668, 750, 'arkady,detyam,kosmicheskie,letalki,prepyatstviya,simulyatory,sobiralki', 'arkady', 'http://static.apitech.ru/5C98FC938DAA4C629B93DABE1758B0CFRU', 0.01, 1, 743, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(744, 322, 'Смертельное Сальто', 'Smertelnoe_salto', 'Любите экстрим? Тогда эта игра для Вас! Делайте сальто на канате как можно больше раз и набирайте соответственно очки! Для нормальных прыжков нужно всё время нажимать на мышку надо головой спортсмена!', 668, 750, 'arkady,letalki,navyki', 'arkady,tryuki', 'http://static.apitech.ru/AA0D28600E1A4B0B9BD4E681E86C18EARU', 0.01, 1, 744, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(745, 321, 'Паркур', 'Parkur', 'Помоги начинающему ямакаси забраться на крышу по стенкам здания в игре «паркур»! Нажимая на кнопку мышки, отталкивайтесь поочерёдно о противоположные стены здания  и тем самым поднимайтесь на крышу!', 668, 750, 'arkady,vremya,detyam,navyki,pobeg,prepyatstviya,priklyucheniya,simulyatory,sportivnye', 'arkady,priklyucheniya,sportivnye,brodilki', 'http://static.apitech.ru/AB5C512BF13643828F95381F3219DAD1RU', 0.01, 1, 745, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(746, 320, 'Заплыв', 'Zaplyv', 'Научись управлять могучей подводной лодкой в одиночку. Старайся не касаться глубоководных мин, иначе будет большой бум! Удерживая мышку, подлодка будет подниматься, а отпустив, пойдёт на опускание!', 688, 710, 'vodnye,detyam,navyki,prepyatstviya,priklyucheniya,razvlecheniya', 'arkady,priklyucheniya', 'http://static.apitech.ru/3B1388F71B4E4CE684DD2AF3829BA437RU', 0.01, 1, 746, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(747, 319, 'Точный пас', 'Tochnyi_pas', 'Отточи мастерство реакции и выиграй друзей в новой игре!', 588, 750, 'balans,detyam,logicheskie,myach,navyki,simulyatory,futbol', 'logicheskie,fizicheskie_igry', 'http://static.apitech.ru/3AEFE40992E7440F8FBED989B05DC47CRU', 0.01, 1, 747, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(748, 318, 'Крылатая ракета', 'Krylataya_raketa', 'Почувствуй себя ракетой!', 668, 750, 'arkady,voennye,detyam,letalki,oruzhie,prepyatstviya,razvlecheniya,simulyatory', 'arkady,voennye', 'http://static.apitech.ru/7A60E4DEEF3547B4B4DF4F97F280BE47RU', 0.01, 1, 748, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(749, 317, 'Звезда пинг-понга', 'Zvezda_ping-ponga', 'Симулятор настольного тенниса теперь Вконтакте!', 668, 750, 'vremya,detyam,myach,navyki,nastolnye,razvlecheniya', 'sportivnye', 'http://static.apitech.ru/4310857ADF6A426D9B4011276A108DE9RU', 0.01, 1, 749, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(750, 316, 'Стрельба из пистолета', 'Strelba_iz_pistoleta', 'А ты такой же Меткий Стрелок как твои друзья?', 588, 750, 'voennye,oruzhie,prepyatstviya,razvlecheniya,simulyatory,strelyalki,shutery', 'voennye,strelyalki', 'http://static.apitech.ru/9CA42F9B84FD4F328B9A8A764F3733BDRU', 0.01, 1, 750, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(751, 315, 'Вломи велосипедисту', 'Vlomi_velosipedistu', 'Увлекательная игрушка! Смысл очень прост: необходимо запустить велосипедиста в долгий полёт с помощью биты!) Чем больше пролетит – тем лучше! Не переживайте, приземляется он очень аккуратно и мягко!', 588, 760, 'arkady,vremya,priklyucheniya,razvlecheniya,simulyatory,smeshnye,eksheny', 'arkady,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/253527E24D3A4F1584ECF01B446F71DERU', 0.01, 1, 751, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(752, 314, 'Найди отличия 2', 'Naidi_otlichiya_2', 'Много интересных отличий найти сможешь ты!', 668, 750, 'arkady,detyam,logicheskie,naiti', 'arkady,dlya_devochek,logicheskie,poisk_predmetov,kvesty', 'http://static.apitech.ru/D909260BEA0D4BFDA932106CD28BDE38RU', 0.01, 1, 752, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(753, 313, 'Супер Соник', 'Super_sonik', 'Проверь, как быстро ты можешь нажимать на левую кнопку своей компьютерной мышки! С помощью своей ловкости рук Вам необходимо помочь соннику пройти сложный уровень и не умереть, попав на острие шипов!)', 668, 750, 'vremya,gonki,detyam,multiki,priklyucheniya,sobiralki,eksheny', 'gonki,multiki,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/55965964973B43F88149C8C20A351922RU', 0.01, 1, 753, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(754, 312, 'Пружинный футбол', 'Pruzhinnyi_futbol', 'Играй в футбол и забивай сопернику голы! Управляй своими игроками с помощью мыши! Для более сильного удара (когда мяч у него) оттяни немного своего игрока назад, нажав на него мышкой, и резко отпусти!', 668, 750, 'arkady,balans,detyam,myach,futbol', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/3C9F536F2123417D89DD30AA7541F553RU', 0.01, 1, 754, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(755, 311, 'Веселый сноубордист', 'Veselyi_snoubordist', 'Катайся на сноуборде и летом!', 668, 750, 'balans,vremya,gonki,detyam,navyki,prepyatstviya,razvlecheniya,sneg,sportivnye,tryuki', 'gonki,sportivnye,tryuki,fizicheskie_igry', 'http://static.apitech.ru/327639D199EE4962ACCD634967394D0ARU', 0.01, 1, 755, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(756, 310, 'Баскетбол слэм данк', 'Basketbol_slem_dank', 'Стань лучшим баскетболистом среди друзей!', 588, 750, 'basketbol,detyam,draki,myach,navyki,razvlecheniya,sportivnye', 'draki,sportivnye', 'http://static.apitech.ru/5E48C7A5D9784454AB7E89A48D4FDDB8RU', 0.01, 1, 756, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(757, 309, 'Чумовые пингвины', 'Chumovye_pingviny', '«Чумовые пингвины» - игрушка по типу гольфа, только этот вариант на льду и с пингвинами! Выбирайте направление скольжения пингвина и пытайтесь попасть в отверстие Имейте в виду, что ещё есть и ветер!', 588, 710, 'arkady,detyam,zhivotnye,led,priklyucheniya,razvlecheniya,smeshnye,sneg,spasatelnye', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/DF05E27953F84C298FF6CBF973E82F12RU', 0.01, 1, 757, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(758, 308, 'НЛО', 'Nlo', 'Заработай бабла, наблюдая тарелки! Обгони друзей!', 668, 750, 'arkady,detyam,kosmicheskie,letalki,oruzhie,prepyatstviya,priklyucheniya,prisheltsy,unichtozheniya', 'arkady,priklyucheniya,brodilki', 'http://static.apitech.ru/E762E16EEE774DD8B49EB32E321F12FBRU', 0.01, 1, 758, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(759, 307, 'Дельтаплан', 'Deltaplan', 'Летай над всем миром на дельтаплане! Вначале нажимай как можно быстрее на мышку, чтобы игрок мог разогнаться, а потом только для поддержания высоты. Остерегайся всяких птиц и других помех в воздухе!)', 588, 660, 'arkady,letalki,prepyatstviya,samolety,simulyatory', 'arkady', 'http://static.apitech.ru/303BEE6D7DD2441391F15FB02DCF4172RU', 0.01, 1, 759, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(760, 306, 'Вышибала', 'Vyshibala', 'Это гораздо интереснее чем боулинг! Кегли скучно вышибать!', 638, 660, 'oruzhie,priklyucheniya,rolevye,smeshnye,sobiralki,strelyalki,ulichnye,eksheny', 'priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/8F12CD97AE3B47F5AA995BE7136420CARU', 0.01, 1, 760, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(761, 305, 'Тир спецназа', 'Tir_spetsnaza', 'Играйте в тир спецназа! Развивайте точность и аккуратность стрельбы! Стреляйте по движущейся мишени – получайте очки, а также процент аккуратности проделанной работы! Будьте внимательны и вы победите!', 588, 750, 'arkady,armiya,voennye,vremya,detyam,oruzhie,priklyucheniya,sobiralki,strelyalki,shutery,eksheny', 'arkady,voennye,priklyucheniya,strelyalki,ekshn,brodilki', 'http://static.apitech.ru/C1408C9A923546559530AA59F8B7E316RU', 0.01, 1, 761, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(762, 304, 'Подземный лабиринт', 'Podzemnyi_labirint', 'Игра на ловкость и умение быстро двигаться!', 668, 750, 'detyam,logicheskie,naiti,prepyatstviya,sobiralki', 'logicheskie,kvesty', 'http://static.apitech.ru/C161E27251A14EEA8BCD4188D8C05952RU', 0.01, 1, 762, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(763, 303, 'Шустрый Художник', 'Shustryi_khudozhnik', 'Шарик, ручка, и гравитация - что еще нужно для развлечений?!', 688, 710, 'arkady,balans,volshebstvo,detyam,logicheskie,magiya,naiti,razvlecheniya,razukrashki,ugadaiki', 'arkady,dlya_devochek,logicheskie,fizicheskie_igry', 'http://static.apitech.ru/A71ACC8E60DD4C6FA87D25EC0A2BCE38RU', 0.01, 1, 763, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(764, 302, 'Релакс', 'Relaks', 'Слушай любимую музыку и играй в увлекательную игру одновременно!', 669, 752, 'arkady,detyam,logicheskie,razvlecheniya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/5D12601D02F44B05B5D73C8C5716B88DRU', 0.01, 1, 764, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(765, 301, 'Карапузы', 'Karapuzy', 'Почувствуй себя многодетной мамочкой, которая пытается усмотреть за всеми сразу! Вам необходимо как можно быстрее, то накормить ребёнка, то успокоить. Сделайте это путём перетягивания соски к ребёнку.', 648, 750, 'arkady,devochkam,detyam,smeshnye', 'arkady,dlya_devochek', 'http://static.apitech.ru/3F37EF86E6834501B90FFC2370FB2A46RU', 0.01, 1, 765, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
