(804, 261, 'Космические Захватчики', 'Kosmicheskie_zakhvatchiki', 'Землю атакуют инопланетяне!!! Жизнь нашей планеты в Ваших руках, капитан. Атакуйте захватчиков на своём космическом корабле, переходите с уровня на уровень, приближайте победу над вражескими войсками.', 588, 710, 'arkady,zaschita,korabli,kosmicheskie,priklyucheniya,prisheltsy,razvlecheniya,unichtozheniya', 'arkady,priklyucheniya,strelyalki', 'http://static.apitech.ru/F9958174B871422CA90D76A3FBE07831RU', 0.01, 1, 804, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(805, 260, 'Миссия Обороны', 'Missiya_oborony', 'Гуманитарная помощь спешит к нашим войскам, но её постоянно пытаются атаковать вражеские подразделения. Защити машину с припасами, уничтожая всех, кто будет препятствовать её продвижению! За Родину!', 588, 710, 'arkady,armiya,voennye,zaschita,priklyucheniya,razvlecheniya,strelyalki,tanki', 'arkady,priklyucheniya,strelyalki', 'http://static.apitech.ru/5FCD181500614424AAE352A64F0720F2RU', 0.01, 1, 805, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(806, 259, 'Безумные Гонки', 'Bezumnye_gonki', 'Самые безумные гонки вконтакте!', 588, 710, 'gonki,detyam,mashiny', 'gonki', 'http://static.apitech.ru/A9F062BE1CA14E2F84D45124F5D1AF13RU', 0.01, 1, 806, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(807, 258, 'Пасьянс Пирамида', 'Pasyans_piramida', 'Отвлекитесь от повседневных проблем и разложите старый добрый пасьянс. «Пасьянс Пирамида» поможет Вам расслабиться на некоторое время, в тот же момент подпитывая Ваш мозг интеллектуальными работами.', 588, 710, 'karty,logicheskie,naiti,nastolnye,razvlecheniya,vnimanie', 'logicheskie,strategii,kartochnye', 'http://static.apitech.ru/84B6A8B8ABF8421785361C92E119C40BRU', 0.01, 1, 807, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(808, 257, 'Посади марсоход', 'Posadi_marsokhod', 'Вы когда-нибудь управляли марсоходом? Если нет, то это Ваш звёздный час! Вам предстоит миссия по посадке марсохода на станцию, при этом Вы должны учесть все факторы посадки: скорость и местоположение.', 588, 710, 'arkady,balans,korabli,kosmicheskie,prepyatstviya,razvlecheniya', 'arkady,priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/D73BC66CF3AF4F778CD792B3769B43E7RU', 0.01, 1, 808, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(809, 256, 'Лопай шарики', 'Lopai_shariki', 'Постарайся лопнуть все возможные воздушные шары дротиками. Выбирайте силу броска и направление, а там дело пойдёт само. Больше лопнули шаров – больше получите очков – больше шансов на победу у друзей.', 588, 710, 'arkady,logicheskie,razvlecheniya,unichtozheniya,shariki', 'arkady,strelyalki', 'http://static.apitech.ru/01D912934F1F4B4EAA2695A3804F8976RU', 0.01, 1, 809, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(810, 255, 'Пинг-понг Мастер', 'Ping-pong_master', 'Тренируйся, и когда-нибудь ты станешь Пинг-понг Мастером!', 588, 710, 'arkady,balans,navyki,razvlecheniya,simulyatory,sportivnye', 'arkady,sportivnye,fizicheskie_igry', 'http://static.apitech.ru/9D3536FAC0F64BA888A622BD93D570EERU', 0.01, 1, 810, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(811, 254, 'Слови мышу', 'Slovi_myshu', 'Словите шуструю мышку, застраивая её каменными башенками. Но и мышка умна, так что придётся сильно потрудиться. Если она уйдёт за пределы экрана, то Вы проиграете. Раскройте в себе истинного мышелова.', 588, 710, 'bashni,zhivotnye,logicheskie,prepyatstviya,razvlecheniya', 'logicheskie,priklyucheniya', 'http://static.apitech.ru/F01F4356F97343D78199527C2C820A39RU', 0.01, 1, 811, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(812, 253, 'Запомни Путь', 'Zapomni_put', 'Когда у тебя один друг, то запомнить путь к его дому очень легко. А если их у тебя много, причём к каждому надо зайти в своё время, то здесь надо задействовать память и внимательность. Проверьте себя.', 588, 710, 'arkady,vremya,logicheskie,naiti,pamyat,razvlecheniya,vnimanie', 'arkady,logicheskie,strategii', 'http://static.apitech.ru/3D887A87F4DE48ACA0C0B54455648E9CRU', 0.01, 1, 812, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(813, 252, 'Супер Змейка', 'Super_zmeika', 'Поиграй в змейку для расслабления. Увеличь маленькую змейку до гигантских размеров, поедая яблоки, разбросанные по игровой территории. Только не врежься в препятствие, не то придётся начинать сначала.', 588, 710, 'arkady,detyam,zhivotnye,prepyatstviya,razvlecheniya,frukty,reaktsiya,zmeika', 'arkady,priklyucheniya', 'http://static.apitech.ru/51B9571850A84FA09E1B5F93A4287469RU', 0.01, 1, 813, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(814, 251, 'Удержи Фонари', 'Uderzhi_fonari', 'Удержать фонари в воздухе – задача из непростых. Помогите клоуну удержать построение из фонарей в воздухе как можно больше, но не меньше указанного времени. Только надо уметь пользоваться клавиатурой.', 588, 710, 'arkady,balans,priklyucheniya,razvlecheniya,reaktsiya', 'arkady,priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/6ECF951EDD594CCA83C8AAED14D2308ERU', 0.01, 1, 814, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(815, 250, 'Гонки в Лабиринте', 'Gonki_v_labirinte', '«Гонки в лабиринте» требуют внимательности и размышления. Достигните указанного предмета, продвигаясь по запутанному лабиринту прежде, чем это сделает Ваш соперник. Бонусы на трассе помогут победить.', 588, 710, 'arkady,gonki,detyam,zhivotnye,logicheskie,naiti,prepyatstviya,sobiralki', 'arkady,gonki,logicheskie,kvesty', 'http://static.apitech.ru/729EE0010D7248B0810C8C91BD540DD6RU', 0.01, 1, 815, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(816, 249, 'Помоги Водиле', 'Pomogi_vodile', 'Игра «Помоги водиле» для тех, кто дружит с математикой. Каждый хочет прокатиться в автобусе бесплатно или заплатить меньше. Но твоё умение счёта не допустит обмана. Проезд строго про прейскуранту!', 588, 710, 'arkady,detyam,mashiny,naiti,simulyatory', 'arkady,poisk_predmetov,kvesty', 'http://static.apitech.ru/7616597A586F4029B28A756442865A5FRU', 0.01, 1, 816, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(817, 248, 'Найди 5 отличий', 'Naidi_5_otlichii', 'Известная игра на внимательность «Найди 5 отличий» теперь и здесь! Найдите 5 отличий между 2 картинками. Но эти отличия могут быть так замаскированы, что не каждому дано найти их. Используй подсказки.', 588, 710, 'arkady,detyam,logicheskie,pamyat,ugadaiki', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/F9B26F5A79274868A6139AD263DCE0C9RU', 0.01, 1, 817, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(818, 247, 'Убей пришельца Спаси ребенка', 'Ubei_prisheltsa_spasi_rebenka', 'Вам предстоит выполнить важную миссию на Земле: спасти детей от инопланетян. Не допустите, чтобы пришельцы забрали наших детей! Используйте для этого пушку и щиты. Ваша точность – залог победы.', 588, 710, 'arkady,zaschita,kosmicheskie,prisheltsy,razvlecheniya,unichtozheniya,pushki', 'priklyucheniya,strelyalki,ekshn', 'http://static.apitech.ru/6F42401F24114224B41BFEB1F3DBD4B0RU', 0.01, 1, 818, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(819, 246, 'Паучок и Пчелки', 'Pauchok_i_pchelki', 'Трудолюбивые пчёлки не дают пауку покоя. Помогите паучку: управляйте им, плетите сети и заманивайте пчёл в свои ловушки. Но смотрите, чтобы пчела не ужалила, когда плетёте паутину, а то будет больно.', 588, 710, 'arkady,prepyatstviya,razvlecheniya,nasekomye,reaktsiya', 'arkady', 'http://static.apitech.ru/732F976D10E843DCB03CC6022DD67B15RU', 0.01, 1, 819, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(820, 245, 'Что случилось в комнате', 'Chto_sluchilos_v_komnate', 'Что-то случилось в комнате, но что именно? Включаем свою память! Смотрите на расположение предметов, запоминайте их, и отмечайте места, где произошли изменения. Быстрота + внимательность = победа.', 588, 710, 'arkady,logicheskie,pamyat,razvlecheniya,ugadaiki,vnimanie', 'arkady,poisk_predmetov,kvesty', 'http://static.apitech.ru/7D33DFBAC7CF476BA1EC4C30D595EBEARU', 0.01, 1, 820, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(821, 244, 'Змейка Мышкой', 'Zmeika_myshkoi', 'Вырасти самую длинную змейку используя только МЫШКУ!', 588, 710, 'arkady,detyam,zhivotnye,razvlecheniya,sobiralki', 'arkady', 'http://static.apitech.ru/AF2D760AE55C40EF84F4C6814D43281DRU', 0.01, 1, 821, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(822, 243, 'Поймай Букашек', 'Poimai_bukashek', 'Научись управляться с мыльными пузырями!', 588, 710, 'arkady,detyam,zhivotnye,puzyri,razvlecheniya,simulyatory,sobiralki', 'arkady,dlya_devochek', 'http://static.apitech.ru/DBE5E5127F674056ACCE5E74E035CC85RU', 0.01, 1, 822, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(823, 242, 'Сгоняй за Сыром', 'Sgonyai_za_syrom', 'Помоги бедной мышке победить голод – проведи её к кусочку сыра через речку. Наилучший вариант – по досочкам без кошечек. Сухая и живая мышка вполне лучше выглядит, чем мокрая. Быстрота – залог успеха.', 588, 710, 'arkady,detyam,zhivotnye,logicheskie,prepyatstviya', 'arkady,dlya_devochek,logicheskie', 'http://static.apitech.ru/191D7C7CCC9E4585AA75ED5494BD6125RU', 0.01, 1, 823, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(824, 241, 'Веселый Грузчик', 'Veselyi_gruzchik', 'Помоги грузчику расставить ящики по местам.', 588, 710, 'vremya,gruzoviki,logicheskie', 'logicheskie', 'http://static.apitech.ru/44B0DADAA4ED49E1864712FDEB047FDFRU', 0.01, 1, 824, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(825, 240, 'Аэрохоккей', 'Aerokhokkei', 'Лучший хоккей онлайн!', 588, 710, 'navyki,nastolnye,simulyatory,sportivnye', 'sportivnye', 'http://static.apitech.ru/A4D457808E174EFAA1EF1211DA474D30RU', 0.01, 1, 825, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(826, 239, 'Кликомания', 'Klikomaniya', 'Дайте Вашему мозгу возможность отдохнуть – поиграйте в «Кликоманию». Смысл игры прост – нажмите на соединение трёх и более квадратиков, и они пропадут. Чем больше пропадёт, тем больше очков получите.', 588, 710, 'arkady,detyam,logicheskie,razvlecheniya,unichtozheniya', 'arkady,logicheskie', 'http://static.apitech.ru/356111E0DF714548B2C67CB84EDC58D2RU', 0.01, 1, 826, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(827, 238, 'Мастер Парковки', 'Master_parkovki', 'Припаркуйте свою машину согласно заданным условиям. В этой игре надо уметь отлично рассчитывать траекторию движения машины при нажатии то или иной клавиши управления. Быстрее и точнее – вот цель игры.', 588, 710, 'arkady,mashiny,parkovka,prepyatstviya,razvlecheniya,reaktsiya', 'arkady', 'http://static.apitech.ru/37703EBDD1F74A99A9E8163DE1B8909CRU', 0.01, 1, 827, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(828, 237, 'Индиана Джонс', 'Indiana_dzhons', 'Помогите известному герою добраться до несметных сокровищ. Управляйте Индианой Джонс, нажимая требуемые клавиши. Попробуйте добраться до конца живым. Быстрее доберётесь – больше сокровищ Ваши.', 588, 710, 'arkady,detyam,kino,priklyucheniya,spasatelnye,fentezi,eksheny', 'arkady,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/46708DA59AC241DC8222534F862944E6RU', 0.01, 1, 828, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(829, 236, 'Защита Замка', 'Zaschita_zamka', 'Защити свой замок от врагов, не дай его разрушить! Приобретай пушки, расставляй их по карте согласно твоему стратегическому плану, уничтожай вражеский транспорт. Чем дольше продержишься – тем лучше.', 588, 710, 'arkady,armiya,bashni,voennye,detyam,zamki,zaschita,logicheskie,oruzhie,strategii,tanki,unichtozheniya,shutery', 'arkady,voennye,logicheskie,strategii', 'http://static.apitech.ru/8BAE117B8B7940F9A1E4E01E525D6D6DRU', 0.01, 1, 829, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
INSERT INTO `vii_wtgames` (`id`, `wtg_id`, `wtg_title`, `wtg_name`, `wtg_desc`, `wtg_height`, `wtg_width`, `wtg_tags`, `wtg_genres`, `wtg_apppath`, `wtg_popular`, `wtg_votes`, `wtg_new`, `wtg_created`, `wtg_img16`, `wtg_img50`, `wtg_img75`, `wtg_img100`, `wtg_img120`, `wtg_img200`) VALUES
(830, 235, 'Письма Счастья', 'Pisma_schastya', 'Собирайте письма, расформировывая их по своим почтовым ящикам. Каждому письму есть соответствующий почтовый сборник. Смотрите, не ошибайтесь! Все эти долгожданные письма несут только приятные новости.', 588, 710, 'arkady,devochkam,navyki,razvlecheniya,reaktsiya', 'arkady,dlya_devochek', 'http://static.apitech.ru/A1D504FAE425458086BF5B7DEB7488A1RU', 0.01, 1, 830, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(831, 234, 'Маджонг В Контакте', 'Madzhong_v_kontakte', 'Увлекательная игрушка «Маджонг в Контакте»! Смысл очень простой: разбери кучу фигурок по парам, которые будут 100 % идентичны друг другу! Специально для Вас два уровня игры: классический и  простой!', 588, 710, 'arkady,logicheskie,navyki,naiti,razvlecheniya', 'dlya_devochek,logicheskie,strategii', 'http://static.apitech.ru/9B003D7C6D10487F8EBA21DE0A7C1868RU', 0.01, 1, 831, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(832, 233, 'Золотоискатель', 'Zolotoiskatel', 'Игра «Золотоискатель» - это один из способов стать виртуальным миллионером. Вытаскивайте куски золота из земли и получайте за это деньги. Больше золота = больше денег = больше шансов стать богачом!', 588, 710, 'arkady,navyki,naiti,priklyucheniya,razvlecheniya,sokrovischa', 'arkady,priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/1424C2BE74E64D43A3FD0C57308FB0D5RU', 0.01, 1, 832, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(833, 232, 'Четыре В Ряд', 'Chetyre_v_ryad', 'Заполняйте кружочками специальную доску и старайтесь составить диагональную, вертикальную или горизонтальную линию из 4 кругов одного цвета. Старайтесь помешать сопернику построить свою линию. Удачи!', 588, 710, 'arkady,logicheskie,navyki,razvlecheniya,vnimanie', 'arkady,logicheskie', 'http://static.apitech.ru/A037A58C67534627B32E84DF07D464B6RU', 0.01, 1, 833, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(834, 231, 'Кручу Верчу', 'Kruchu_verchu', 'Успей уследить за монеткой в стаканчиках :)', 588, 710, 'arkady,detyam,pamyat', 'arkady', 'http://static.apitech.ru/07168342B1974B1CB0AF5A67C4BD987FRU', 0.01, 1, 834, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(835, 230, 'Кролик vs Черепаха', 'Krolik_vs_cherepakha', 'Кто сказал, что черепаха медленная и неповоротливая? В данной игре Вам предстоит опровергнуть это. Собирайте появляющиеся на экране цветы, прежде чем кролик успеет съесть их, коснувшись их черепахой.', 588, 710, 'arkady,gonki,detyam,zhivotnye,razvlecheniya,sobiralki', 'arkady,gonki', 'http://static.apitech.ru/579E7EA5339548C7B1465813F9F5D1C5RU', 0.01, 1, 835, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(836, 229, 'Брейкер', 'Breiker', 'Игра из детства! Находите три и более кубика с одинаковыми цветами и убирайте их с экрана. Чем больше исчезло – тем больше очков. Веселитесь вволю, соревнуйтесь с друзьями, получайте удовольствие!', 588, 710, 'arkady,logicheskie,naiti,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/736AA6B6DF6342568D4F83AD66F6CA9FRU', 0.01, 1, 836, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(837, 228, 'Разноцветные Пары', 'Raznotsvetnye_pary', 'Собирай пары и набирай много очков.Стань лучшим', 588, 710, 'arkady,detyam,logicheskie,naiti,unichtozheniya,shariki', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/4BE69B78861B4C2FA621A1D548DB2020RU', 0.01, 1, 837, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(838, 227, 'Пакман', 'Pakman', 'Одна из самых известных в мире игр «PacMan» теперь и у нас! Собирайте таблетки и убегайте от монстров. Скушайте красную таблетку и сами погоняйтесь за ними. Чем больше таблеток, тем больше Вам очков.', 588, 710, 'arkady,detyam,naiti,pobeg,prepyatstviya,prizraki,priklyucheniya,sobiralki,eksheny', 'arkady,priklyucheniya,ekshn,brodilki', 'http://static.apitech.ru/8A623D4146AC4CFE8BAAED26E764BC5ERU', 0.01, 1, 838, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(839, 226, 'Веселая Зума', 'Veselaya_zuma', 'Весёлая Зума теперь у нас! Стреляйте по разноцветным шарам, составляйте комбинации из трёх и более одноцветных. Больше уничтожено – больше очков. Но не дайте им попасть к вам в центр - это поражение!)', 588, 710, 'arkady,logicheskie,navyki,priklyucheniya,razvlecheniya,strelyalki,unichtozheniya,fentezi,shutery', 'arkady,dlya_devochek,logicheskie,priklyucheniya,strelyalki,brodilki', 'http://static.apitech.ru/E54A876DE2D1436AA086B74B898405E6RU', 0.01, 1, 839, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(840, 225, 'Безумный Таксист', 'Bezumnyi_taksist', 'Преодолейте указанную дистанцию за определённое время, доставьте пассажира до пункта назначения. Для достижения этой цели Вам надо будет не только развивать высокую скорость, но перепрыгивать машины.', 588, 710, 'arkady,vremya,gonki,mashiny,navyki,prepyatstviya,simulyatory', 'arkady,gonki', 'http://static.apitech.ru/192F61F243EE4FCFA816B4CA0E338D58RU', 0.01, 1, 840, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(841, 224, 'Новогодняя Гирлянда', 'Novogodnyaya_girlyanda', 'Получите новогоднее настроение, украшая ёлку разноцветной гирляндой. Соединяйте проводки с генератором и лампочками, включайте праздничное освещение! Конечно, придётся потрудится, но оно того стоит.', 588, 710, 'arkady,logicheskie,razvlecheniya,rozhdestvo,ukrashenie', 'arkady,logicheskie', 'http://static.apitech.ru/877960588C0F4B968C606C28FC3969BCRU', 0.01, 1, 841, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(842, 223, 'Бильярд', 'Bilyard', 'Хотите погонять шары по столу, но ни того, ни другого под рукой нет? Мини-игра «Бильярд» поможет Вам отвлечься от насущных проблем. Забивайте шары в лунки, зарабатывайте очки, соревнуйтесь с друзьями!', 588, 710, 'arkady,bilyard,navyki,razvlecheniya,simulyatory,shariki', 'arkady,sportivnye,fizicheskie_igry', 'http://static.apitech.ru/5956C6B3DA3A40BDAC4AACCF165B2692RU', 0.01, 1, 842, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(843, 222, 'Падающие Шарики', 'Padayuschie_shariki', 'Всем известная игра «Падающие шарики». Стреляйте разноцветными шарами, собирайте комбинацию из трёх и более одноцветных шаров и заставляйте их исчезнуть с экрана. Не позволяйте им задавить Вас!', 588, 710, 'arkady,devochkam,razvlecheniya,unichtozheniya,shariki,shutery', 'arkady,dlya_devochek,strelyalki', 'http://static.apitech.ru/4AAAB1DBEE2A4E12B7B9070679555FA3RU', 0.01, 1, 843, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(844, 221, 'Летающие Диски', 'Letayuschie_diski', 'Соревнуйтесь с друзьями в спортивной стрельбе по дискам. Тут курсор выступает как  ружьё. Но, несмотря на то, что навёл и выстрелил, здесь не всё так просто. Ведь скорость дисков разная, а их много.', 588, 710, 'arkady,razvlecheniya,strelyalki,reaktsiya', 'arkady,sportivnye,strategii', 'http://static.apitech.ru/2DC8672301A24023AC22F3FF7E4D551BRU', 0.01, 1, 844, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(845, 220, 'Звёздочки', 'Zvyozdochki', 'Весёлая игрушка «Звёздочки» заключается в составлении комбинаций из трёх и более одноцветных звёзд. Для игры следует затратить чуть-чуть усилий на внимательность, а в остальном – можно и отдохнуть!', 588, 710, 'arkady,detyam,logicheskie,naiti,razvlecheniya,sobiralki,unichtozheniya', 'arkady,logicheskie,kvesty', 'http://static.apitech.ru/B3DE29F76FF84ECBA917155605874CD9RU', 0.01, 1, 845, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(846, 219, 'Хеллоуин', 'Khellouin', 'Игра с мобильного телефона перекочевала к Вам в компьютер. Составляйте тыковки таким образом, чтобы образовался ряд из 3 и более. Но смотрите: как только тыква дотронется до края, Вы сразу проиграете!', 588, 710, 'arkady,logicheskie,razvlecheniya,unichtozheniya', 'arkady', 'http://static.apitech.ru/CBA5A32D28364EEF9EA4E242DCD05A89RU', 0.01, 1, 846, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(847, 218, 'Пять Костяшек', 'Pyat_kostyashek', 'Игра «5 костяшек» - для самых наблюдательных. Найдите, где костяшки построены таким образом, чтобы можно было выбрать наибольшее количество одинаковых. Больше одинаковых костяшек – больше очков.', 588, 710, 'arkady,logicheskie,naiti,nastolnye,razvlecheniya,vnimanie', 'arkady,logicheskie', 'http://static.apitech.ru/DEE9A2A80B06451697C0DEB01C0C0C87RU', 0.01, 1, 847, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(848, 217, 'Снеговик На Лыжах', 'Snegovik_na_lyzhakh', 'Добавьте снежным шарам нужные компоненты: сучья, морковку и шишки – и получится настоящий красивый снеговик. Управляя шариками из снега, закреплённых на лыжах, объезжайте деревья и собирайте вещи.', 588, 710, 'arkady,detyam,prepyatstviya,priklyucheniya,razvlecheniya,sobiralki', 'arkady,priklyucheniya,sportivnye', 'http://static.apitech.ru/405DA39426704B85A2E7104D382FBFA2RU', 0.01, 1, 848, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(849, 216, 'Стреляй Рогаткой', 'Strelyai_rogatkoi', 'Хотите «убить» время любыми способами? Тогда постреляйте по банке из рогатки! За каждое попадание Вы получаете очки, и банка взмывает в воздух. Ваша цель – продержать банку как можно больше в воздухе.', 588, 710, 'arkady,balans,razvlecheniya,strelyalki,reaktsiya', 'arkady,strelyalki,fizicheskie_igry', 'http://static.apitech.ru/6EEBA3B9C9B94700AA2429129F259CE4RU', 0.01, 1, 849, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(850, 215, 'Жонглёр', 'Zhonglyor', 'Хотите пожонглировать разноцветными шариками? Тогда эта мини-игра именно для Вас. Точные нажатия на кнопки помогут вам жонглировать шариками, которые просто падают с неба. Смотрите, не роняйте их! ', 588, 710, 'arkady,balans,navyki,priklyucheniya,razvlecheniya,tryuki,shariki', 'priklyucheniya,fizicheskie_igry', 'http://static.apitech.ru/2CDFB4C4CA914583AAC792F5704448C3RU', 0.01, 1, 850, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(851, 214, 'Воздушный Змей', 'Vozdushnyi_zmei', 'Воздушные змеи – это так весело. Окунитесь в детство, поиграв с воздушным змеем. Удерживайте его как можно дольше на своей верёвочке, не то улетит. А с детскими радостями так не хочется расставаться.', 588, 710, 'arkady,balans,detyam,navyki,razvlecheniya,reaktsiya', 'arkady', 'http://static.apitech.ru/DE1042EB67544B1CB5A110035D3331ABRU', 0.01, 1, 851, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(852, 213, 'Прыгающие Фрукты', 'Prygayuschie_frukty', 'Вкусные фрукты уже готовы появиться на Вашем столе. Но их надо собрать! Помогите собрать всё, что даёт фруктовый сад, в корзину. Но будьте внимательны: надо собирать все фрукты, не позволяя им упасть!', 588, 710, 'arkady,devochkam,detyam,navyki,razvlecheniya,frukty,reaktsiya', 'arkady,dlya_devochek,fizicheskie_igry', 'http://static.apitech.ru/2C506AE13F174D959783A1A4AC2FD8DBRU', 0.01, 1, 852, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(853, 212, 'Летающие Шарики', 'Letayuschie_shariki', 'Весёлая игра, связанная со стрельбой по шарикам в космосе. Стреляйте себе в удовольствие и зарабатывайте очки. Взорвав один шарик, получай два. Учтите: хотя бы один шарик должен остаться на экране!', 588, 710, 'arkady,detyam,letalki,puzyri,razvlecheniya,samolety,strelyalki,unichtozheniya,shariki,shutery', 'arkady,strelyalki', 'http://static.apitech.ru/5C96A10F941A4C4F8857709F54E8E8AERU', 0.01, 1, 853, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg'),
(854, 211, 'Высокая Башня', 'Vysokaya_bashnya', 'Увлекательная игра, смысл которой заключён в построении высочайшей  в мире башни. Почувствуй себя строителем. Только не забудь внизу поставить предупреждение, а то не все блоки попадают куда надо=)', 588, 710, 'arkady,balans,bashni,detyam,navyki,razvlecheniya', 'arkady,fizicheskie_igry', 'http://static.apitech.ru/B98A90A4B6254C5FBA73B42ABA4A70D1RU', 0.01, 1, 854, 1334174400, 'png', 'jpg', 'jpg', 'jpg', 'jpg', 'jpg');
